the result should be considered undefined behavior.
Examples:
const buf = Buffer.from([0x12, 0x34, 0x56, 0x78, 0x90, 0xab]);

// Prints: 1234567890ab
console.log(buf.readIntLE(0, 6).toString(16));

// Prints: -546f87a9cbee
console.log(buf.readIntBE(0, 6).toString(16));

// Throws an exception: RangeError: Index out of range
console.log(buf.readIntBE(1, 6).toString(16));

buf.readUInt8(offset[, noAssert])


offset {Integer} Where to start reading. Must satisfy: 0 &lt;= offset &lt;= buf.length - 1
noAssert {Boolean} Skip offset validation? Default: false
Return: {Integer}

Reads an unsigned 8-bit integer from buf at the specified offset.
Setting noAssert to true allows offset to be beyond the end of buf, but
the result should be considered undefined behavior.
Examples:
const buf = Buffer.from([1, -2]);

// Prints: 1
console.log(buf.readUInt8(0));

// Prints: 254
console.log(buf.readUInt8(1));

// Throws an exception: RangeError: Index out of range
console.log(buf.readUInt8(2));

buf.readUInt16BE(offset[, noAssert])
buf.readUInt16LE(offset[, noAssert])


offset {Integer} Where to start reading. Must satisfy: 0 &lt;= offset &lt;= buf.length - 2
noAssert {Boolean} Skip offset validation? Default: false
Return: {Integer}

Reads an unsigned 16-bit integer from buf at the specified offset with
specified endian format (readUInt16BE() returns big endian, readUInt16LE()
returns little endian).
Setting noAssert to true allows offset to be beyond the end of buf, but
the result should be considered undefined behavior.
Examples:
const buf = Buffer.from([0x12, 0x34, 0x56]);

// Prints: 1234
console.log(buf.readUInt16BE(0).toString(16));

// Prints: 3412
console.log(buf.readUInt16LE(0).toString(16));

// Prints: 3456
console.log(buf.readUInt16BE(1).toString(16));

// Prints: 5634
console.log(buf.readUInt16LE(1).toString(16));

// Throws an exception: RangeError: Index out of range
console.log(buf.readUInt16LE(2).toString(16));

buf.readUInt32BE(offset[, noAssert])
buf.readUInt32LE(offset[, noAssert])


offset {Integer} Where to start reading. Must satisfy: 0 &lt;= offset &lt;= buf.length - 4
noAssert {Boolean} Skip offset validation? Default: false
Return: {Integer}

Reads an unsigned 32-bit integer from buf at the specified offset with
specified endian format (readUInt32BE() returns big endian,
readUInt32LE() returns little endian).
Setting noAssert to true allows offset to be beyond the end of buf, but
the result should be considered undefined behavior.
Examples:
const buf = Buffer.from([0x12, 0x34, 0x56, 0x78]);

// Prints: 12345678
console.log(buf.readUInt32BE(0).toString(16));

// Prints: 78563412
console.log(buf.readUInt32LE(0).toString(16));

// Throws an exception: RangeError: Index out of range
console.log(buf.readUInt32LE(1).toString(16));

buf.readUIntBE(offset, byteLength[, noAssert])
buf.readUIntLE(offset, byteLength[, noAssert])


offset {Integer} Where to start reading. Must satisfy: 0 &lt;= offset &lt;= buf.length - byteLength
byteLength {Integer} How many bytes to read. Must satisfy: 0 &lt; byteLength &lt;= 6
noAssert {Boolean} Skip offset and byteLength validation? Default: false
Return: {Integer}

Reads byteLength number of bytes from buf at the specified offset
and interprets the result as an unsigned integer. Supports up to 48
bits of accuracy.
Setting noAssert to true allows offset to be beyond the end of buf, but
the result should be considered undefined behavior.
Examples:
const buf = Buffer.from([0x12, 0x34, 0x56, 0x78, 0x90, 0xab]);

// Prints: 1234567890ab
console.log(buf.readUIntLE(0, 6).toString(16));

// Prints: ab9078563412
console.log(buf.readUIntBE(0, 6).toString(16));

// Throws an exception: RangeError: Index out of range
console.log(buf.readUIntBE(1, 6).toString(16));

buf.slice([start[, end]])


start {Integer} Where the new Buffer will start. Default: 0
end {Integer} Where the new Buffer will end (not inclusive).
Default: buf.length
Return: {Buffer}

Returns a new Buffer that references the same memory as the original, but
offset and cropped by the start and end indices.
Note that modifying the new Buffer slice will modify the memory in the
original Buffer because the allocated memory of the two objects overlap.
Example: Create a Buffer with the ASCII alphabet, take a slice, and then modify
one byte from the original Buffer
const buf1 = Buffer.allocUnsafe(26);

for (var i = 0 ; i &lt; 26 ; i++) {
  // 97 is the decimal ASCII value for &#39;a&#39;
  buf1[i] = i + 97;
}

const buf2 = buf1.slice(0, 3);

// Prints: abc
console.log(buf2.toString(&#39;ascii&#39;, 0, buf2.length));

buf1[0] = 33;

// Prints: !bc
console.log(buf2.toString(&#39;ascii&#39;, 0, buf2.length));

Specifying negative indexes causes the slice to be generated relative to the
end of buf rather than the beginning.
Examples:
const buf = Buffer.from(&#39;buffer&#39;);

// Prints: buffe
// (Equivalent to buf.slice(0, 5))
console.log(buf.slice(-6, -1).toString());

// Prints: buff
// (Equivalent to buf.slice(0, 4))
console.log(buf.slice(-6, -2).toString());

// Prints: uff
// (Equivalent to buf.slice(1, 4))
console.log(buf.slice(-5, -2).toString());

buf.swap16()


Return: {Buffer} A reference to buf

Interprets buf as an array of unsigned 16-bit integers and swaps the byte-order
in-place. Throws a RangeError if buf.length is not a multiple of 2.
Examples:
const buf1 = Buffer.from([0x1, 0x2, 0x3, 0x4, 0x5, 0x6, 0x7, 0x8]);

// Prints: &lt;Buffer 01 02 03 04 05 06 07 08&gt;
console.log(buf1);

buf1.swap16();

// Prints: &lt;Buffer 02 01 04 03 06 05 08 07&gt;
console.log(buf1);


const buf2 = Buffer.from([0x1, 0x2, 0x3]);

// Throws an exception: RangeError: Buffer size must be a multiple of 16-bits
buf2.swap32();

buf.swap32()


Return: {Buffer} A reference to buf

Interprets buf as an array of unsigned 32-bit integers and swaps the byte-order
in-place. Throws a RangeError if buf.length is not a multiple of 4.
Examples:
const buf1 = Buffer.from([0x1, 0x2, 0x3, 0x4, 0x5, 0x6, 0x7, 0x8]);

// Prints &lt;Buffer 01 02 03 04 05 06 07 08&gt;
console.log(buf1);

buf1.swap32();

// Prints &lt;Buffer 04 03 02 01 08 07 06 05&gt;
console.log(buf1);


const buf2 = Buffer.from([0x1, 0x2, 0x3]);

// Throws an exception: RangeError: Buffer size must be a multiple of 32-bits
buf2.swap32();

buf.swap64()


Return: {Buffer} A reference to buf

Interprets buf as an array of 64-bit numbers and swaps the byte-order in-place.
Throws a RangeError if buf.length is not a multiple of 8.
Examples:
const buf1 = Buffer.from([0x1, 0x2, 0x3, 0x4, 0x5, 0x6, 0x7, 0x8]);

// Prints &lt;Buffer 01 02 03 04 05 06 07 08&gt;
console.log(buf1);

buf1.swap64();

// Prints &lt;Buffer 08 07 06 05 04 03 02 01&gt;
console.log(buf1);


const buf2 = Buffer.from([0x1, 0x2, 0x3]);

// Throws an exception: RangeError: Buffer size must be a multiple of 64-bits
buf2.swap64();

Note that JavaScript cannot encode 64-bit integers. This method is intended
for working with 64-bit floats.
buf.toString([encoding[, start[, end]]])


encoding {String} The character encoding to decode to. Default: &#39;utf8&#39;
start {Integer} Where to start decoding. Default: 0
end {Integer} Where to stop decoding (not inclusive). Default: buf.length
Return: {String}

Decodes buf to a string according to the specified character encoding in encoding.
start and end may be passed to decode only a subset of buf.
Examples:
const buf1 = Buffer.allocUnsafe(26);

for (var i = 0 ; i &lt; 26 ; i++) {
  // 97 is the decimal ASCII value for &#39;a&#39;
  buf1[i] = i + 97;
}

// Prints: abcdefghijklmnopqrstuvwxyz
console.log(buf.toString(&#39;ascii&#39;));

// Prints: abcde
console.log(buf.toString(&#39;ascii&#39;, 0, 5));


const buf2 = Buffer.from(&#39;tést&#39;);

// Prints: tés
console.log(buf.toString(&#39;utf8&#39;, 0, 3));

// Prints: tés
console.log(buf.toString(undefined, 0, 3));

buf.toJSON()


Return: {Object}

Returns a JSON representation of buf. JSON.stringify() implicitly calls
this function when stringifying a Buffer instance.
Example:
const buf = Buffer.from([0x1, 0x2, 0x3, 0x4, 0x5]);
const json = JSON.stringify(buf);

// Prints: {&quot;type&quot;:&quot;Buffer&quot;,&quot;data&quot;:[1,2,3,4,5]}
console.log(json);

const copy = JSON.parse(json, (key, value) =&gt; {
  return value &amp;&amp; value.type === &#39;Buffer&#39;
    ? Buffer.from(value.data)
    : value;
});

// Prints: &lt;Buffer 01 02 03 04 05&gt;
console.log(copy);

buf.values()


Return: {Iterator}

Creates and returns an iterator for buf values (bytes). This function is
called automatically when a Buffer is used in a for..of statement.
Examples:
const buf = Buffer.from(&#39;buffer&#39;);

// Prints:
//   98
//   117
//   102
//   102
//   101
//   114
for (var value of buf.values()) {
  console.log(value);
}

// Prints:
//   98
//   117
//   102
//   102
//   101
//   114
for (var value of buf) {
  console.log(value);
}

buf.write(string[, offset[, length]][, encoding])


string {String} String to be written to buf
offset {Integer} Where to start writing string. Default: 0
length {Integer} How many bytes to write. Default: buf.length - offset
encoding {String} The character encoding of string. Default: &#39;utf8&#39;
Return: {Integer} Number of bytes written

Writes string to buf at offset according to the character encoding in encoding.
The length parameter is the number of bytes to write. If buf did not contain
enough space to fit the entire string, only a partial amount of string will
be written. However, partially encoded characters will not be written.
Example:
const buf = Buffer.allocUnsafe(256);

const len = buf.write(&#39;\u00bd + \u00bc = \u00be&#39;, 0);

// Prints: 12 bytes: ½ + ¼ = ¾
console.log(`${len} bytes: ${buf.toString(&#39;utf8&#39;, 0, len)}`);

buf.writeDoubleBE(value, offset[, noAssert])
buf.writeDoubleLE(value, offset[, noAssert])


value {Number} Number to be written to buf
offset {Integer} Where to start writing. Must satisfy: 0 &lt;= offset &lt;= buf.length - 8
noAssert {Boolean} Skip value and offset validation? Default: false
Return: {Integer} offset plus the number of bytes written

Writes value to buf at the specified offset with specified endian
format (writeDoubleBE() writes big endian, writeDoubleLE() writes little
endian). value should be a valid 64-bit double. Behavior is undefined when
value is anything other than a 64-bit double.
Setting noAssert to true allows the encoded form of value to extend beyond
the end of buf, but the result should be considered undefined behavior.
Examples:
const buf = Buffer.allocUnsafe(8);

buf.writeDoubleBE(0xdeadbeefcafebabe, 0);

// Prints: &lt;Buffer 43 eb d5 b7 dd f9 5f d7&gt;
console.log(buf);

buf.writeDoubleLE(0xdeadbeefcafebabe, 0);

// Prints: &lt;Buffer d7 5f f9 dd b7 d5 eb 43&gt;
console.log(buf);

buf.writeFloatBE(value, offset[, noAssert])
buf.writeFloatLE(value, offset[, noAssert])


value {Number} Number to be written to buf
offset {Integer} Where to start writing. Must satisfy: 0 &lt;= offset &lt;= buf.length - 4
noAssert {Boolean} Skip value and offset validation? Default: false
Return: {Integer} offset plus the number of bytes written

Writes value to buf at the specified offset with specified endian
format (writeFloatBE() writes big endian, writeFloatLE() writes little
endian). value should be a valid 32-bit float. Behavior is undefined when
value is anything other than a 32-bit float.
Setting noAssert to true allows the encoded form of value to extend beyond
the end of buf, but the result should be considered undefined behavior.
Examples:
const buf = Buffer.allocUnsafe(4);

buf.writeFloatBE(0xcafebabe, 0);

// Prints: &lt;Buffer 4f 4a fe bb&gt;
console.log(buf);

buf.writeFloatLE(0xcafebabe, 0);

// Prints: &lt;Buffer bb fe 4a 4f&gt;
console.log(buf);

buf.writeInt8(value, offset[, noAssert])


value {Integer} Number to be written to buf
offset {Integer} Where to start writing. Must satisfy: 0 &lt;= offset &lt;= buf.length - 1
noAssert {Boolean} Skip value and offset validation? Default: false
Return: {Integer} offset plus the number of bytes written

Writes value to buf at the specified offset. value should be a valid
signed 8-bit integer. Behavior is undefined when value is anything other than
a signed 8-bit integer.
Setting noAssert to true allows the encoded form of value to extend beyond
the end of buf, but the result should be considered undefined behavior.
value is interpreted and written as a two&#39;s complement signed integer.
Examples:
const buf = Buffer.allocUnsafe(2);

buf.writeInt8(2, 0);
buf.writeInt8(-2, 1);

// Prints: &lt;Buffer 02 fe&gt;
console.log(buf);

buf.writeInt16BE(value, offset[, noAssert])
buf.writeInt16LE(value, offset[, noAssert])


value {Integer} Number to be written to buf
offset {Integer} Where to start writing. Must satisfy: 0 &lt;= offset &lt;= buf.length - 2
noAssert {Boolean} Skip value and offset validation? Default: false
Return: {Integer} offset plus the number of bytes written

Writes value to buf at the specified offset with specified endian
format (writeInt16BE() writes big endian, writeInt16LE() writes little
endian). value should be a valid signed 16-bit integer. Behavior is undefined
when value is anything other than a signed 16-bit integer.
Setting noAssert to true allows the encoded form of value to extend beyond
the end of buf, but the result should be considered undefined behavior.
value is interpreted and written as a two&#39;s complement signed integer.
Examples:
const buf = Buffer.allocUnsafe(4);

buf.writeInt16BE(0x0102, 0);
buf.writeInt16LE(0x0304, 2);

// Prints: &lt;Buffer 01 02 04 03&gt;
console.log(buf);

buf.writeInt32BE(value, offset[, noAssert])
buf.writeInt32LE(value, offset[, noAssert])


value {Integer} Number to be written to buf
offset {Integer} Where to start writing. Must satisfy: 0 &lt;= offset &lt;= buf.length - 4
noAssert {Boolean} Skip value and offset validation? Default: false
Return: {Integer} offset plus the number of bytes written

Writes value to buf at the specified offset with specified endian
format (writeInt32BE() writes big endian, writeInt32LE() writes little
endian). value should be a valid signed 32-bit integer. Behavior is undefined
when value is anything other than a signed 32-bit integer.
Setting noAssert to true allows the encoded form of value to extend beyond
the end of buf, but the result should be considered undefined behavior.
value is interpreted and written as a two&#39;s complement signed integer.
Examples:
const buf = Buffer.allocUnsafe(8);

buf.writeInt32BE(0x01020304, 0);
buf.writeInt32LE(0x05060708, 4);

// Prints: &lt;Buffer 01 02 03 04 08 07 06 05&gt;
console.log(buf);

buf.writeIntBE(value, offset, byteLength[, noAssert])
buf.writeIntLE(value, offset, byteLength[, noAssert])


value {Integer} Number to be written to buf
offset {Integer} Where to start writing. Must satisfy: 0 &lt;= offset &lt;= buf.length - byteLength
byteLength {Integer} How many bytes to write. Must satisfy: 0 &lt; byteLength &lt;= 6
noAssert {Boolean} Skip value, offset, and byteLength validation?
Default: false
Return: {Integer} offset plus the number of bytes written

Writes byteLength bytes of value to buf at the specified offset.
Supports up to 48 bits of accuracy. Behavior is undefined when value is
anything other than a signed integer.
Setting noAssert to true allows the encoded form of value to extend beyond
the end of buf, but the result should be considered undefined behavior.
Examples:
const buf = Buffer.allocUnsafe(6);

buf.writeUIntBE(0x1234567890ab, 0, 6);

// Prints: &lt;Buffer 12 34 56 78 90 ab&gt;
console.log(buf);

buf.writeUIntLE(0x1234567890ab, 0, 6);

// Prints: &lt;Buffer ab 90 78 56 34 12&gt;
console.log(buf);

buf.writeUInt8(value, offset[, noAssert])


value {Integer} Number to be written to buf
offset {Integer} Where to start writing. Must satisfy: 0 &lt;= offset &lt;= buf.length - 1
noAssert {Boolean} Skip value and offset validation? Default: false
Return: {Integer} offset plus the number of bytes written

Writes value to buf at the specified offset. value should be a
valid unsigned 8-bit integer. Behavior is undefined when value is anything
other than an unsigned 8-bit integer.
Setting noAssert to true allows the encoded form of value to extend beyond
the end of buf, but the result should be considered undefined behavior.
Examples:
const buf = Buffer.allocUnsafe(4);

buf.writeUInt8(0x3, 0);
buf.writeUInt8(0x4, 1);
buf.writeUInt8(0x23, 2);
buf.writeUInt8(0x42, 3);

// Prints: &lt;Buffer 03 04 23 42&gt;
console.log(buf);

buf.writeUInt16BE(value, offset[, noAssert])
buf.writeUInt16LE(value, offset[, noAssert])


value {Integer} Number to be written to buf
offset {Integer} Where to start writing. Must satisfy: 0 &lt;= offset &lt;= buf.length - 2
noAssert {Boolean} Skip value and offset validation? Default: false
Return: {Integer} offset plus the number of bytes written

Writes value to buf at the specified offset with specified endian
format (writeUInt16BE() writes big endian, writeUInt16LE() writes little
endian). value should be a valid unsigned 16-bit integer. Behavior is
undefined when value is anything other than an unsigned 16-bit integer.
Setting noAssert to true allows the encoded form of value to extend beyond
the end of buf, but the result should be considered undefined behavior.
Examples:
const buf = Buffer.allocUnsafe(4);

buf.writeUInt16BE(0xdead, 0);
buf.writeUInt16BE(0xbeef, 2);

// Prints: &lt;Buffer de ad be ef&gt;
console.log(buf);

buf.writeUInt16LE(0xdead, 0);
buf.writeUInt16LE(0xbeef, 2);

// Prints: &lt;Buffer ad de ef be&gt;
console.log(buf);

buf.writeUInt32BE(value, offset[, noAssert])
buf.writeUInt32LE(value, offset[, noAssert])


value {Integer} Number to be written to buf
offset {Integer} Where to start writing. Must satisfy: 0 &lt;= offset &lt;= buf.length - 4
noAssert {Boolean} Skip value and offset validation? Default: false
Return: {Integer} offset plus the number of bytes written

Writes value to buf at the specified offset with specified endian
format (writeUInt32BE() writes big endian, writeUInt32LE() writes little
endian). value should be a valid unsigned 32-bit integer. Behavior is
undefined when value is anything other than an unsigned 32-bit integer.
Setting noAssert to true allows the encoded form of value to extend beyond
the end of buf, but the result should be considered undefined behavior.
Examples:
const buf = Buffer.allocUnsafe(4);

buf.writeUInt32BE(0xfeedface, 0);

// Prints: &lt;Buffer fe ed fa ce&gt;
console.log(buf);

buf.writeUInt32LE(0xfeedface, 0);

// Prints: &lt;Buffer ce fa ed fe&gt;
console.log(buf);

buf.writeUIntBE(value, offset, byteLength[, noAssert])
buf.writeUIntLE(value, offset, byteLength[, noAssert])


value {Integer} Number to be written to buf
offset {Integer} Where to start writing. Must satisfy: 0 &lt;= offset &lt;= buf.length - byteLength
byteLength {Integer} How many bytes to write. Must satisfy: 0 &lt; byteLength &lt;= 6
noAssert {Boolean} Skip value, offset, and byteLength validation?
Default: false
Return: {Integer} offset plus the number of bytes written

Writes byteLength bytes of value to buf at the specified offset.
Supports up to 48 bits of accuracy. Behavior is undefined when value is
anything other than an unsigned integer.
Setting noAssert to true allows the encoded form of value to extend beyond
the end of buf, but the result should be considered undefined behavior.
Examples:
const buf = Buffer.allocUnsafe(6);

buf.writeUIntBE(0x1234567890ab, 0, 6);

// Prints: &lt;Buffer 12 34 56 78 90 ab&gt;
console.log(buf);

buf.writeUIntLE(0x1234567890ab, 0, 6);

// Prints: &lt;Buffer ab 90 78 56 34 12&gt;
console.log(buf);

buffer.INSPECT_MAX_BYTES


{Integer} Default: 50

Returns the maximum number of bytes that will be returned when
buf.inspect() is called. This can be overridden by user modules. See
util.inspect() for more details on buf.inspect() behavior.
Note that this is a property on the buffer module as returned by
require(&#39;buffer&#39;), not on the Buffer global or a Buffer instance.
buffer.kMaxLength


{Integer} The largest size allowed for a single Buffer instance

On 32-bit architectures, this value is (2^30)-1 (~1GB).
On 64-bit architectures, this value is (2^31)-1 (~2GB).
Class: SlowBuffer

Stability: 0 - Deprecated: Use [`Buffer.allocUnsafeSlow()`] instead.
Returns an un-pooled Buffer.
In order to avoid the garbage collection overhead of creating many individually
allocated Buffer instances, by default allocations under 4KB are sliced from a
single larger allocated object. This approach improves both performance and memory
usage since v8 does not need to track and cleanup as many Persistent objects.
In the case where a developer may need to retain a small chunk of memory from a
pool for an indeterminate amount of time, it may be appropriate to create an
un-pooled Buffer instance using SlowBuffer then copy out the relevant bits.
Example:
// Need to keep around a few small chunks of memory
const store = [];

socket.on(&#39;readable&#39;, () =&gt; {
  const data = socket.read();

  // Allocate for retained data
  const sb = SlowBuffer(10);

  // Copy the data into the new allocation
  data.copy(sb, 0, 0, 10);

  store.push(sb);
});

Use of SlowBuffer should be used only as a last resort after a developer
has observed undue memory retention in their applications.
new SlowBuffer(size)

Stability: 0 - Deprecated: Use [`Buffer.allocUnsafeSlow()`] instead.

size {Integer} The desired length of the new SlowBuffer

Allocates a new SlowBuffer of size bytes. The size must be less than
or equal to the value of buffer.kMaxLength. Otherwise, a RangeError is
thrown. A zero-length Buffer will be created if size &lt;= 0.
The underlying memory for SlowBuffer instances is not initialized. The
contents of a newly created SlowBuffer are unknown and could contain
sensitive data. Use buf.fill(0) to initialize a SlowBuffer to zeroes.
Example:
const SlowBuffer = require(&#39;buffer&#39;).SlowBuffer;

const buf = new SlowBuffer(5);

// Prints (contents may vary): &lt;Buffer 78 e0 82 02 01&gt;
console.log(buf);

buf.fill(0);

// Prints: &lt;Buffer 00 00 00 00 00&gt;
console.log(buf);

addons.html.body:
title: addons
tags: node
date: 2016-08-11 10:27:51
Addons
Node.js Addons are dynamically-linked shared objects, written in C or C++, that
can be loaded into Node.js using the require() function, and used
just as if they were an ordinary Node.js module. They are used primarily to
provide an interface between JavaScript running in Node.js and C/C++ libraries.
At the moment, the method for implementing Addons is rather complicated,
involving knowledge of several components and APIs :

V8: the C++ library Node.js currently uses to provide the
JavaScript implementation. V8 provides the mechanisms for creating objects,
calling functions, etc. V8&#39;s API is documented mostly in the
v8.h header file (deps/v8/include/v8.h in the Node.js source
tree), which is also available online.

libuv: The C library that implements the Node.js event loop, its worker
threads and all of the asynchronous behaviors of the platform. It also
serves as a cross-platform abstraction library, giving easy, POSIX-like
access across all major operating systems to many common system tasks, such
as interacting with the filesystem, sockets, timers and system events. libuv
also provides a pthreads-like threading abstraction that may be used to
power more sophisticated asynchronous Addons that need to move beyond the
standard event loop. Addon authors are encouraged to think about how to
avoid blocking the event loop with I/O or other time-intensive tasks by
off-loading work via libuv to non-blocking system operations, worker threads
or a custom use of libuv&#39;s threads.

Internal Node.js libraries. Node.js itself exports a number of C/C++ APIs
that Addons can use &mdash; the most important of which is the
node::ObjectWrap class.

Node.js includes a number of other statically linked libraries including
OpenSSL. These other libraries are located in the deps/ directory in the
Node.js source tree. Only the V8 and OpenSSL symbols are purposefully
re-exported by Node.js and may be used to various extents by Addons.
See Linking to Node.js&#39; own dependencies for additional information.


All of the following examples are available for download and may
be used as a starting-point for your own Addon.
Hello world
This &quot;Hello world&quot; example is a simple Addon, written in C++, that is the
equivalent of the following JavaScript code:
module.exports.hello = () =&gt; &#39;world&#39;;

First, create the file hello.cc:
// hello.cc
#include &lt;node.h&gt;

namespace demo {

using v8::FunctionCallbackInfo;
using v8::Isolate;
using v8::Local;
using v8::Object;
using v8::String;
using v8::Value;

void Method(const FunctionCallbackInfo&lt;Value&gt;&amp; args) {
  Isolate* isolate = args.GetIsolate();
  args.GetReturnValue().Set(String::NewFromUtf8(isolate, &quot;world&quot;));
}

void init(Local&lt;Object&gt; exports) {
  NODE_SET_METHOD(exports, &quot;hello&quot;, Method);
}

NODE_MODULE(addon, init)

}  // namespace demo

Note that all Node.js Addons must export an initialization function following
the pattern:
void Initialize(Local&lt;Object&gt; exports);
NODE_MODULE(module_name, Initialize)

There is no semi-colon after NODE_MODULE as it&#39;s not a function (see
node.h).
The module_name must match the filename of the final binary (excluding
the .node suffix).
In the hello.cc example, then, the initialization function is init and the
Addon module name is addon.
Building
Once the source code has been written, it must be compiled into the binary
addon.node file. To do so, create a file called binding.gyp in the
top-level of the project describing the build configuration of your module
using a JSON-like format. This file is used by node-gyp -- a tool written
specifically to compile Node.js Addons.
{
  &quot;targets&quot;: [
    {
      &quot;target_name&quot;: &quot;addon&quot;,
      &quot;sources&quot;: [ &quot;hello.cc&quot; ]
    }
  ]
}

Note: A version of the node-gyp utility is bundled and distributed with
Node.js as part of npm. This version is not made directly available for
developers to use and is intended only to support the ability to use the
npm install command to compile and install Addons. Developers who wish to
use node-gyp directly can install it using the command
npm install -g node-gyp. See the node-gyp installation instructions for
more information, including platform-specific requirements.
Once the binding.gyp file has been created, use node-gyp configure to
generate the appropriate project build files for the current platform. This
will generate either a Makefile (on Unix platforms) or a vcxproj file
(on Windows) in the build/ directory.
Next, invoke the node-gyp build command to generate the compiled addon.node
file. This will be put into the build/Release/ directory.
When using npm install to install a Node.js Addon, npm uses its own bundled
version of node-gyp to perform this same set of actions, generating a
compiled version of the Addon for the user&#39;s platform on demand.
Once built, the binary Addon can be used from within Node.js by pointing
require() to the built addon.node module:
// hello.js
const addon = require(&#39;./build/Release/addon&#39;);

console.log(addon.hello()); // &#39;world&#39;

Please see the examples below for further information or
https://github.com/arturadib/node-qt for an example in production.
Because the exact path to the compiled Addon binary can vary depending on how
it is compiled (i.e. sometimes it may be in ./build/Debug/), Addons can use
the bindings package to load the compiled module.
Note that while the bindings package implementation is more sophisticated
in how it locates Addon modules, it is essentially using a try-catch pattern
similar to:
try {
  return require(&#39;./build/Release/addon.node&#39;);
} catch (err) {
  return require(&#39;./build/Debug/addon.node&#39;);
}

Linking to Node.js&#39; own dependencies
Node.js uses a number of statically linked libraries such as V8, libuv and
OpenSSL. All Addons are required to link to V8 and may link to any of the
other dependencies as well. Typically, this is as simple as including
the appropriate #include &lt;...&gt; statements (e.g. #include &lt;v8.h&gt;) and
node-gyp will locate the appropriate headers automatically. However, there
are a few caveats to be aware of:

When node-gyp runs, it will detect the specific release version of Node.js
and download either the full source tarball or just the headers. If the full
source is downloaded, Addons will have complete access to the full set of
Node.js dependencies. However, if only the Node.js headers are downloaded, then
only the symbols exported by Node.js will be available.

node-gyp can be run using the --nodedir flag pointing at a local Node.js
source image. Using this option, the Addon will have access to the full set of
dependencies.


Loading Addons using require()
The filename extension of the compiled Addon binary is .node (as opposed
to .dll or .so). The require() function is written to look for
files with the .node file extension and initialize those as dynamically-linked
libraries.
When calling require(), the .node extension can usually be
omitted and Node.js will still find and initialize the Addon. One caveat,
however, is that Node.js will first attempt to locate and load modules or
JavaScript files that happen to share the same base name. For instance, if
there is a file addon.js in the same directory as the binary addon.node,
then require(&#39;addon&#39;) will give precedence to the addon.js file
and load it instead.
Native Abstractions for Node.js
Each of the examples illustrated in this document make direct use of the
Node.js and V8 APIs for implementing Addons. It is important to understand
that the V8 API can, and has, changed dramatically from one V8 release to the
next (and one major Node.js release to the next). With each change, Addons may
need to be updated and recompiled in order to continue functioning. The Node.js
release schedule is designed to minimize the frequency and impact of such
changes but there is little that Node.js can do currently to ensure stability
of the V8 APIs.
The Native Abstractions for Node.js (or nan) provide a set of tools that
Addon developers are recommended to use to keep compatibility between past and
future releases of V8 and Node.js. See the nan examples for an
illustration of how it can be used.
Addon examples
Following are some example Addons intended to help developers get started. The
examples make use of the V8 APIs. Refer to the online V8 reference
for help with the various V8 calls, and V8&#39;s Embedder&#39;s Guide for an
explanation of several concepts used such as handles, scopes, function
templates, etc.
Each of these examples using the following binding.gyp file:
{
  &quot;targets&quot;: [
    {
      &quot;target_name&quot;: &quot;addon&quot;,
      &quot;sources&quot;: [ &quot;addon.cc&quot; ]
    }
  ]
}

In cases where there is more than one .cc file, simply add the additional
filename to the sources array. For example:
&quot;sources&quot;: [&quot;addon.cc&quot;, &quot;myexample.cc&quot;]

Once the binding.gyp file is ready, the example Addons can be configured and
built using node-gyp:
$ node-gyp configure build

Function arguments
Addons will typically expose objects and functions that can be accessed from
JavaScript running within Node.js. When functions are invoked from JavaScript,
the input arguments and return value must be mapped to and from the C/C++
code.
The following example illustrates how to read function arguments passed from
JavaScript and how to return a result:
// addon.cc
#include &lt;node.h&gt;

namespace demo {

using v8::Exception;
using v8::FunctionCallbackInfo;
using v8::Isolate;
using v8::Local;
using v8::Number;
using v8::Object;
using v8::String;
using v8::Value;

// This is the implementation of the &quot;add&quot; method
// Input arguments are passed using the
// const FunctionCallbackInfo&lt;Value&gt;&amp; args struct
void Add(const FunctionCallbackInfo&lt;Value&gt;&amp; args) {
  Isolate* isolate = args.GetIsolate();

  // Check the number of arguments passed.
  if (args.Length() &lt; 2) {
    // Throw an Error that is passed back to JavaScript
    isolate-&gt;ThrowException(Exception::TypeError(
        String::NewFromUtf8(isolate, &quot;Wrong number of arguments&quot;)));
    return;
  }

  // Check the argument types
  if (!args[0]-&gt;IsNumber() || !args[1]-&gt;IsNumber()) {
    isolate-&gt;ThrowException(Exception::TypeError(
        String::NewFromUtf8(isolate, &quot;Wrong arguments&quot;)));
    return;
  }

  // Perform the operation
  double value = args[0]-&gt;NumberValue() + args[1]-&gt;NumberValue();
  Local&lt;Number&gt; num = Number::New(isolate, value);

  // Set the return value (using the passed in
  // FunctionCallbackInfo&lt;Value&gt;&amp;)
  args.GetReturnValue().Set(num);
}

void Init(Local&lt;Object&gt; exports) {
  NODE_SET_METHOD(exports, &quot;add&quot;, Add);
}

NODE_MODULE(addon, Init)

}  // namespace demo

Once compiled, the example Addon can be required and used from within Node.js:
// test.js
const addon = require(&#39;./build/Release/addon&#39;);

console.log(&#39;This should be eight:&#39;, addon.add(3, 5));

Callbacks
It is common practice within Addons to pass JavaScript functions to a C++
function and execute them from there. The following example illustrates how
to invoke such callbacks:
// addon.cc
#include &lt;node.h&gt;

namespace demo {

using v8::Function;
using v8::FunctionCallbackInfo;
using v8::Isolate;
using v8::Local;
using v8::Null;
using v8::Object;
using v8::String;
using v8::Value;

void RunCallback(const FunctionCallbackInfo&lt;Value&gt;&amp; args) {
  Isolate* isolate = args.GetIsolate();
  Local&lt;Function&gt; cb = Local&lt;Function&gt;::Cast(args[0]);
  const unsigned argc = 1;
  Local&lt;Value&gt; argv[argc] = { String::NewFromUtf8(isolate, &quot;hello world&quot;) };
  cb-&gt;Call(Null(isolate), argc, argv);
}

void Init(Local&lt;Object&gt; exports, Local&lt;Object&gt; module) {
  NODE_SET_METHOD(module, &quot;exports&quot;, RunCallback);
}

NODE_MODULE(addon, Init)

}  // namespace demo

Note that this example uses a two-argument form of Init() that receives
the full module object as the second argument. This allows the Addon
to completely overwrite exports with a single function instead of
adding the function as a property of exports.
To test it, run the following JavaScript:
// test.js
const addon = require(&#39;./build/Release/addon&#39;);

addon((msg) =&gt; {
  console.log(msg); // &#39;hello world&#39;
});

Note that, in this example, the callback function is invoked synchronously.
Object factory
Addons can create and return new objects from within a C++ function as
illustrated in the following example. An object is created and returned with a
property msg that echoes the string passed to createObject():
// addon.cc
#include &lt;node.h&gt;

namespace demo {

using v8::FunctionCallbackInfo;
using v8::Isolate;
using v8::Local;
using v8::Object;
using v8::String;
using v8::Value;

void CreateObject(const FunctionCallbackInfo&lt;Value&gt;&amp; args) {
  Isolate* isolate = args.GetIsolate();

  Local&lt;Object&gt; obj = Object::New(isolate);
  obj-&gt;Set(String::NewFromUtf8(isolate, &quot;msg&quot;), args[0]-&gt;ToString());

  args.GetReturnValue().Set(obj);
}

void Init(Local&lt;Object&gt; exports, Local&lt;Object&gt; module) {
  NODE_SET_METHOD(module, &quot;exports&quot;, CreateObject);
}

NODE_MODULE(addon, Init)

}  // namespace demo

To test it in JavaScript:
// test.js
const addon = require(&#39;./build/Release/addon&#39;);

var obj1 = addon(&#39;hello&#39;);
var obj2 = addon(&#39;world&#39;);
console.log(obj1.msg, obj2.msg); // &#39;hello world&#39;

Function factory
Another common scenario is creating JavaScript functions that wrap C++
functions and returning those back to JavaScript:
// addon.cc
#include &lt;node.h&gt;

namespace demo {

using v8::Function;
using v8::FunctionCallbackInfo;
using v8::FunctionTemplate;
using v8::Isolate;
using v8::Local;
using v8::Object;
using v8::String;
using v8::Value;

void MyFunction(const FunctionCallbackInfo&lt;Value&gt;&amp; args) {
  Isolate* isolate = args.GetIsolate();
  args.GetReturnValue().Set(String::NewFromUtf8(isolate, &quot;hello world&quot;));
}

void CreateFunction(const FunctionCallbackInfo&lt;Value&gt;&amp; args) {
  Isolate* isolate = args.GetIsolate();

  Local&lt;FunctionTemplate&gt; tpl = FunctionTemplate::New(isolate, MyFunction);
  Local&lt;Function&gt; fn = tpl-&gt;GetFunction();

  // omit this to make it anonymous
  fn-&gt;SetName(String::NewFromUtf8(isolate, &quot;theFunction&quot;));

  args.GetReturnValue().Set(fn);
}

void Init(Local&lt;Object&gt; exports, Local&lt;Object&gt; module) {
  NODE_SET_METHOD(module, &quot;exports&quot;, CreateFunction);
}

NODE_MODULE(addon, Init)

}  // namespace demo

To test:
// test.js
const addon = require(&#39;./build/Release/addon&#39;);

var fn = addon();
console.log(fn()); // &#39;hello world&#39;

Wrapping C++ objects
It is also possible to wrap C++ objects/classes in a way that allows new
instances to be created using the JavaScript new operator:
// addon.cc
#include &lt;node.h&gt;
#include &quot;myobject.h&quot;

namespace demo {

using v8::Local;
using v8::Object;

void InitAll(Local&lt;Object&gt; exports) {
  MyObject::Init(exports);
}

NODE_MODULE(addon, InitAll)

}  // namespace demo

Then, in myobject.h, the wrapper class inherits from node::ObjectWrap:
// myobject.h
#ifndef MYOBJECT_H
#define MYOBJECT_H

#include &lt;node.h&gt;
#include &lt;node_object_wrap.h&gt;

namespace demo {

class MyObject : public node::ObjectWrap {
 public:
  static void Init(v8::Local&lt;v8::Object&gt; exports);

 private:
  explicit MyObject(double value = 0);
  ~MyObject();

  static void New(const v8::FunctionCallbackInfo&lt;v8::Value&gt;&amp; args);
  static void PlusOne(const v8::FunctionCallbackInfo&lt;v8::Value&gt;&amp; args);
  static v8::Persistent&lt;v8::Function&gt; constructor;
  double value_;
};

}  // namespace demo

#endif

In myobject.cc, implement the various methods that are to be exposed.
Below, the method plusOne() is exposed by adding it to the constructor&#39;s
prototype:
// myobject.cc
#include &quot;myobject.h&quot;

namespace demo {

using v8::Context;
using v8::Function;
using v8::FunctionCallbackInfo;
using v8::FunctionTemplate;
using v8::Isolate;
using v8::Local;
using v8::Number;
using v8::Object;
using v8::Persistent;
using v8::String;
using v8::Value;

Persistent&lt;Function&gt; MyObject::constructor;

MyObject::MyObject(double value) : value_(value) {
}

MyObject::~MyObject() {
}

void MyObject::Init(Local&lt;Object&gt; exports) {
  Isolate* isolate = exports-&gt;GetIsolate();

  // Prepare constructor template
  Local&lt;FunctionTemplate&gt; tpl = FunctionTemplate::New(isolate, New);
  tpl-&gt;SetClassName(String::NewFromUtf8(isolate, &quot;MyObject&quot;));
  tpl-&gt;InstanceTemplate()-&gt;SetInternalFieldCount(1);

  // Prototype
  NODE_SET_PROTOTYPE_METHOD(tpl, &quot;plusOne&quot;, PlusOne);

  constructor.Reset(isolate, tpl-&gt;GetFunction());
  exports-&gt;Set(String::NewFromUtf8(isolate, &quot;MyObject&quot;),
               tpl-&gt;GetFunction());
}

void MyObject::New(const FunctionCallbackInfo&lt;Value&gt;&amp; args) {
  Isolate* isolate = args.GetIsolate();

  if (args.IsConstructCall()) {
    // Invoked as constructor: `new MyObject(...)`
    double value = args[0]-&gt;IsUndefined() ? 0 : args[0]-&gt;NumberValue();
    MyObject* obj = new MyObject(value);
    obj-&gt;Wrap(args.This());
    args.GetReturnValue().Set(args.This());
  } else {
    // Invoked as plain function `MyObject(...)`, turn into construct call.
    const int argc = 1;
    Local&lt;Value&gt; argv[argc] = { args[0] };
    Local&lt;Context&gt; context = isolate-&gt;GetCurrentContext();
    Local&lt;Function&gt; cons = Local&lt;Function&gt;::New(isolate, constructor);
    Local&lt;Object&gt; result =
        cons-&gt;NewInstance(context, argc, argv).ToLocalChecked();
    args.GetReturnValue().Set(result);
  }
}

void MyObject::PlusOne(const FunctionCallbackInfo&lt;Value&gt;&amp; args) {
  Isolate* isolate = args.GetIsolate();

  MyObject* obj = ObjectWrap::Unwrap&lt;MyObject&gt;(args.Holder());
  obj-&gt;value_ += 1;

  args.GetReturnValue().Set(Number::New(isolate, obj-&gt;value_));
}

}  // namespace demo

To build this example, the myobject.cc file must be added to the
binding.gyp:
{
  &quot;targets&quot;: [
    {
      &quot;target_name&quot;: &quot;addon&quot;,
      &quot;sources&quot;: [
        &quot;addon.cc&quot;,
        &quot;myobject.cc&quot;
      ]
    }
  ]
}

Test it with:
// test.js
const addon = require(&#39;./build/Release/addon&#39;);

var obj = new addon.MyObject(10);
console.log(obj.plusOne()); // 11
console.log(obj.plusOne()); // 12
console.log(obj.plusOne()); // 13

Factory of wrapped objects
Alternatively, it is possible to use a factory pattern to avoid explicitly
creating object instances using the JavaScript new operator:
var obj = addon.createObject();
// instead of:
// var obj = new addon.Object();

First, the createObject() method is implemented in addon.cc:
// addon.cc
#include &lt;node.h&gt;
#include &quot;myobject.h&quot;

namespace demo {

using v8::FunctionCallbackInfo;
using v8::Isolate;
using v8::Local;
using v8::Object;
using v8::String;
using v8::Value;

void CreateObject(const FunctionCallbackInfo&lt;Value&gt;&amp; args) {
  MyObject::NewInstance(args);
}

void InitAll(Local&lt;Object&gt; exports, Local&lt;Object&gt; module) {
  MyObject::Init(exports-&gt;GetIsolate());

  NODE_SET_METHOD(module, &quot;exports&quot;, CreateObject);
}

NODE_MODULE(addon, InitAll)

}  // namespace demo

In myobject.h, the static method NewInstance() is added to handle
instantiating the object. This method takes the place of using new in
JavaScript:
// myobject.h
#ifndef MYOBJECT_H
#define MYOBJECT_H

#include &lt;node.h&gt;
#include &lt;node_object_wrap.h&gt;

namespace demo {

class MyObject : public node::ObjectWrap {
 public:
  static void Init(v8::Isolate* isolate);
  static void NewInstance(const v8::FunctionCallbackInfo&lt;v8::Value&gt;&amp; args);

 private:
  explicit MyObject(double value = 0);
  ~MyObject();

  static void New(const v8::FunctionCallbackInfo&lt;v8::Value&gt;&amp; args);
  static void PlusOne(const v8::FunctionCallbackInfo&lt;v8::Value&gt;&amp; args);
  static v8::Persistent&lt;v8::Function&gt; constructor;
  double value_;
};

}  // namespace demo

#endif

The implementation in myobject.cc is similar to the previous example:
// myobject.cc
#include &lt;node.h&gt;
#include &quot;myobject.h&quot;

namespace demo {

using v8::Context;
using v8::Function;
using v8::FunctionCallbackInfo;
using v8::FunctionTemplate;
using v8::Isolate;
using v8::Local;
using v8::Number;
using v8::Object;
using v8::Persistent;
using v8::String;
using v8::Value;

Persistent&lt;Function&gt; MyObject::constructor;

MyObject::MyObject(double value) : value_(value) {
}

MyObject::~MyObject() {
}

void MyObject::Init(Isolate* isolate) {
  // Prepare constructor template
  Local&lt;FunctionTemplate&gt; tpl = FunctionTemplate::New(isolate, New);
  tpl-&gt;SetClassName(String::NewFromUtf8(isolate, &quot;MyObject&quot;));
  tpl-&gt;InstanceTemplate()-&gt;SetInternalFieldCount(1);

  // Prototype
  NODE_SET_PROTOTYPE_METHOD(tpl, &quot;plusOne&quot;, PlusOne);

  constructor.Reset(isolate, tpl-&gt;GetFunction());
}

void MyObject::New(const FunctionCallbackInfo&lt;Value&gt;&amp; args) {
  Isolate* isolate = args.GetIsolate();

  if (args.IsConstructCall()) {
    // Invoked as constructor: `new MyObject(...)`
    double value = args[0]-&gt;IsUndefined() ? 0 : args[0]-&gt;NumberValue();
    MyObject* obj = new MyObject(value);
    obj-&gt;Wrap(args.This());
    args.GetReturnValue().Set(args.This());
  } else {
    // Invoked as plain function `MyObject(...)`, turn into construct call.
    const int argc = 1;
    Local&lt;Value&gt; argv[argc] = { args[0] };
    Local&lt;Function&gt; cons = Local&lt;Function&gt;::New(isolate, constructor);
    Local&lt;Context&gt; context = isolate-&gt;GetCurrentContext();
    Local&lt;Object&gt; instance =
        cons-&gt;NewInstance(context, argc, argv).ToLocalChecked();
    args.GetReturnValue().Set(instance);
  }
}

void MyObject::NewInstance(const FunctionCallbackInfo&lt;Value&gt;&amp; args) {
  Isolate* isolate = args.GetIsolate();

  const unsigned argc = 1;
  Local&lt;Value&gt; argv[argc] = { args[0] };
  Local&lt;Function&gt; cons = Local&lt;Function&gt;::New(isolate, constructor);
  Local&lt;Context&gt; context = isolate-&gt;GetCurrentContext();
  Local&lt;Object&gt; instance =
      cons-&gt;NewInstance(context, argc, argv).ToLocalChecked();

  args.GetReturnValue().Set(instance);
}

void MyObject::PlusOne(const FunctionCallbackInfo&lt;Value&gt;&amp; args) {
  Isolate* isolate = args.GetIsolate();

  MyObject* obj = ObjectWrap::Unwrap&lt;MyObject&gt;(args.Holder());
  obj-&gt;value_ += 1;

  args.GetReturnValue().Set(Number::New(isolate, obj-&gt;value_));
}

