  Isolate* isolate = args.GetIsolate();

  const unsigned argc = 1;
  Local&lt;Value&gt; argv[argc] = { args[0] };
  Local&lt;Function&gt; cons = Local&lt;Function&gt;::New(isolate, constructor);
  Local&lt;Context&gt; context = isolate-&gt;GetCurrentContext();
  Local&lt;Object&gt; instance =
      cons-&gt;NewInstance(context, argc, argv).ToLocalChecked();

  args.GetReturnValue().Set(instance);
}

}  // namespace demo

Test it with:
// test.js
const addon = require(&#39;./build/Release/addon&#39;);

var obj1 = addon.createObject(10);
var obj2 = addon.createObject(20);
var result = addon.add(obj1, obj2);

console.log(result); // 30

AtExit hooks
An &quot;AtExit&quot; hook is a function that is invoked after the Node.js event loop
has ended but before the JavaScript VM is terminated and Node.js shuts down.
&quot;AtExit&quot; hooks are registered using the node::AtExit API.
void AtExit(callback, args)

callback: void (*)(void*) - A pointer to the function to call at exit.
args: void* - A pointer to pass to the callback at exit.

Registers exit hooks that run after the event loop has ended but before the VM
is killed.
AtExit takes two parameters: a pointer to a callback function to run at exit,
and a pointer to untyped context data to be passed to that callback.
Callbacks are run in last-in first-out order.
The following addon.cc implements AtExit:
// addon.cc
#undef NDEBUG
#include &lt;assert.h&gt;
#include &lt;stdlib.h&gt;
#include &lt;node.h&gt;

namespace demo {

using node::AtExit;
using v8::HandleScope;
using v8::Isolate;
using v8::Local;
using v8::Object;

static char cookie[] = &quot;yum yum&quot;;
static int at_exit_cb1_called = 0;
static int at_exit_cb2_called = 0;

static void at_exit_cb1(void* arg) {
  Isolate* isolate = static_cast&lt;Isolate*&gt;(arg);
  HandleScope scope(isolate);
  Local&lt;Object&gt; obj = Object::New(isolate);
  assert(!obj.IsEmpty()); // assert VM is still alive
  assert(obj-&gt;IsObject());
  at_exit_cb1_called++;
}

static void at_exit_cb2(void* arg) {
  assert(arg == static_cast&lt;void*&gt;(cookie));
  at_exit_cb2_called++;
}

static void sanity_check(void*) {
  assert(at_exit_cb1_called == 1);
  assert(at_exit_cb2_called == 2);
}

void init(Local&lt;Object&gt; exports) {
  AtExit(sanity_check);
  AtExit(at_exit_cb2, cookie);
  AtExit(at_exit_cb2, cookie);
  AtExit(at_exit_cb1, exports-&gt;GetIsolate());
}

NODE_MODULE(addon, init);

}  // namespace demo

Test in JavaScript by running:
// test.js
const addon = require(&#39;./build/Release/addon&#39;);

child_process.html.body:
title: child_process
tags: node
date: 2016-08-11 10:27:51
Child Process
Stability: 2 - Stable
The child_process module provides the ability to spawn child processes in
a manner that is similar, but not identical, to popen(3). This capability
is primarily provided by the child_process.spawn() function:
const spawn = require(&#39;child_process&#39;).spawn;
const ls = spawn(&#39;ls&#39;, [&#39;-lh&#39;, &#39;/usr&#39;]);

ls.stdout.on(&#39;data&#39;, (data) =&gt; {
  console.log(`stdout: ${data}`);
});

ls.stderr.on(&#39;data&#39;, (data) =&gt; {
  console.log(`stderr: ${data}`);
});

ls.on(&#39;close&#39;, (code) =&gt; {
  console.log(`child process exited with code ${code}`);
});

By default, pipes for stdin, stdout and stderr are established between
the parent Node.js process and the spawned child. It is possible to stream data
through these pipes in a non-blocking way. Note, however, that some programs
use line-buffered I/O internally. While that does not affect Node.js, it can
mean that data sent to the child process may not be immediately consumed.
The child_process.spawn() method spawns the child process asynchronously,
without blocking the Node.js event loop. The child_process.spawnSync()
function provides equivalent functionality in a synchronous manner that blocks
the event loop until the spawned process either exits or is terminated.
For convenience, the child_process module provides a handful of synchronous
and asynchronous alternatives to child_process.spawn() and
child_process.spawnSync().  Note that each of these alternatives are
implemented on top of child_process.spawn() or child_process.spawnSync().

child_process.exec(): spawns a shell and runs a command within that shell,
passing the stdout and stderr to a callback function when complete.
child_process.execFile(): similar to child_process.exec() except that
it spawns the command directly without first spawning a shell.
child_process.fork(): spawns a new Node.js process and invokes a
specified module with an IPC communication channel established that allows
sending messages between parent and child.
child_process.execSync(): a synchronous version of
child_process.exec() that will block the Node.js event loop.
child_process.execFileSync(): a synchronous version of
child_process.execFile() that will block the Node.js event loop.

For certain use cases, such as automating shell scripts, the
synchronous counterparts may be more convenient. In many cases, however,
the synchronous methods can have significant impact on performance due to
stalling the event loop while spawned processes complete.
Asynchronous Process Creation
The child_process.spawn(), child_process.fork(), child_process.exec(),
and child_process.execFile() methods all follow the idiomatic asynchronous
programming pattern typical of other Node.js APIs.
Each of the methods returns a ChildProcess instance. These objects
implement the Node.js EventEmitter API, allowing the parent process to
register listener functions that are called when certain events occur during
the life cycle of the child process.
The child_process.exec() and child_process.execFile() methods additionally
allow for an optional callback function to be specified that is invoked
when the child process terminates.
Spawning .bat and .cmd files on Windows
The importance of the distinction between child_process.exec() and
child_process.execFile() can vary based on platform. On Unix-type operating
systems (Unix, Linux, OSX) child_process.execFile() can be more efficient
because it does not spawn a shell. On Windows, however, .bat and .cmd
files are not executable on their own without a terminal, and therefore cannot
be launched using child_process.execFile(). When running on Windows, .bat
and .cmd files can be invoked using child_process.spawn() with the shell
option set, with child_process.exec(), or by spawning cmd.exe and passing
the .bat or .cmd file as an argument (which is what the shell option and
child_process.exec() do).
// On Windows Only ...
const spawn = require(&#39;child_process&#39;).spawn;
const bat = spawn(&#39;cmd.exe&#39;, [&#39;/c&#39;, &#39;my.bat&#39;]);

bat.stdout.on(&#39;data&#39;, (data) =&gt; {
  console.log(data);
});

bat.stderr.on(&#39;data&#39;, (data) =&gt; {
  console.log(data);
});

bat.on(&#39;exit&#39;, (code) =&gt; {
  console.log(`Child exited with code ${code}`);
});

// OR...
const exec = require(&#39;child_process&#39;).exec;
exec(&#39;my.bat&#39;, (err, stdout, stderr) =&gt; {
  if (err) {
    console.error(err);
    return;
  }
  console.log(stdout);
});

child_process.exec(command[, options][, callback])


command {String} The command to run, with space-separated arguments
options {Object}
cwd {String} Current working directory of the child process
env {Object} Environment key-value pairs
encoding {String} (Default: &#39;utf8&#39;)
shell {String} Shell to execute the command with
(Default: &#39;/bin/sh&#39; on UNIX, &#39;cmd.exe&#39; on Windows, The shell should
 understand the -c switch on UNIX or /s /c on Windows. On Windows,
 command line parsing should be compatible with cmd.exe.)
timeout {Number} (Default: 0)
maxBuffer {Number} largest amount of data (in bytes) allowed on
stdout or stderr - if exceeded child process is killed (Default: 200*1024)
killSignal {String} (Default: &#39;SIGTERM&#39;)
uid {Number} Sets the user identity of the process. (See setuid(2).)
gid {Number} Sets the group identity of the process. (See setgid(2).)


callback {Function} called with the output when process terminates
error {Error}
stdout {String|Buffer}
stderr {String|Buffer}


Return: {ChildProcess}

Spawns a shell then executes the command within that shell, buffering any
generated output.
const exec = require(&#39;child_process&#39;).exec;
exec(&#39;cat *.js bad_file | wc -l&#39;, (error, stdout, stderr) =&gt; {
  if (error) {
    console.error(`exec error: ${error}`);
    return;
  }
  console.log(`stdout: ${stdout}`);
  console.log(`stderr: ${stderr}`);
});

If a callback function is provided, it is called with the arguments
(error, stdout, stderr). On success, error will be null.  On error,
error will be an instance of Error. The error.code property will be
the exit code of the child process while error.signal will be set to the
signal that terminated the process. Any exit code other than 0 is considered
to be an error.
The stdout and stderr arguments passed to the callback will contain the
stdout and stderr output of the child process. By default, Node.js will decode
the output as UTF-8 and pass strings to the callback. The encoding option
can be used to specify the character encoding used to decode the stdout and
stderr output. If encoding is &#39;buffer&#39;, or an unrecognized character
encoding, Buffer objects will be passed to the callback instead.
The options argument may be passed as the second argument to customize how
the process is spawned. The default options are:
{
  encoding: &#39;utf8&#39;,
  timeout: 0,
  maxBuffer: 200*1024,
  killSignal: &#39;SIGTERM&#39;,
  cwd: null,
  env: null
}

If timeout is greater than 0, the parent will send the the signal
identified by the killSignal property (the default is &#39;SIGTERM&#39;) if the
child runs longer than timeout milliseconds.
Note: Unlike the exec(3) POSIX system call, child_process.exec() does not
replace the existing process and uses a shell to execute the command.
child_process.execFile(file[, args][, options][, callback])


file {String} The name or path of the executable file to run
args {Array} List of string arguments
options {Object}
cwd {String} Current working directory of the child process
env {Object} Environment key-value pairs
encoding {String} (Default: &#39;utf8&#39;)
timeout {Number} (Default: 0)
maxBuffer {Number} largest amount of data (in bytes) allowed on
stdout or stderr - if exceeded child process is killed (Default: 200*1024)
killSignal {String} (Default: &#39;SIGTERM&#39;)
uid {Number} Sets the user identity of the process. (See setuid(2).)
gid {Number} Sets the group identity of the process. (See setgid(2).)


callback {Function} called with the output when process terminates
error {Error}
stdout {String|Buffer}
stderr {String|Buffer}


Return: {ChildProcess}

The child_process.execFile() function is similar to child_process.exec()
except that it does not spawn a shell. Rather, the specified executable file
is spawned directly as a new process making it slightly more efficient than
child_process.exec().
The same options as child_process.exec() are supported. Since a shell is not
spawned, behaviors such as I/O redirection and file globbing are not supported.
const execFile = require(&#39;child_process&#39;).execFile;
const child = execFile(&#39;node&#39;, [&#39;--version&#39;], (error, stdout, stderr) =&gt; {
  if (error) {
    throw error;
  }
  console.log(stdout);
});

The stdout and stderr arguments passed to the callback will contain the
stdout and stderr output of the child process. By default, Node.js will decode
the output as UTF-8 and pass strings to the callback. The encoding option
can be used to specify the character encoding used to decode the stdout and
stderr output. If encoding is &#39;buffer&#39;, or an unrecognized character
encoding, Buffer objects will be passed to the callback instead.
child_process.fork(modulePath[, args][, options])


modulePath {String} The module to run in the child
args {Array} List of string arguments
options {Object}
cwd {String} Current working directory of the child process
env {Object} Environment key-value pairs
execPath {String} Executable used to create the child process
execArgv {Array} List of string arguments passed to the executable
(Default: process.execArgv)
silent {Boolean} If true, stdin, stdout, and stderr of the child will be
piped to the parent, otherwise they will be inherited from the parent, see
the &#39;pipe&#39; and &#39;inherit&#39; options for child_process.spawn()&#39;s
stdio for more details (Default: false)
stdio {Array} Supports the array version of child_process.spawn()&#39;s
stdio option. When this option is provided, it overrides silent.
uid {Number} Sets the user identity of the process. (See setuid(2).)
gid {Number} Sets the group identity of the process. (See setgid(2).)


Return: {ChildProcess}

The child_process.fork() method is a special case of
child_process.spawn() used specifically to spawn new Node.js processes.
Like child_process.spawn(), a ChildProcess object is returned. The returned
ChildProcess will have an additional communication channel built-in that
allows messages to be passed back and forth between the parent and child. See
child.send() for details.
It is important to keep in mind that spawned Node.js child processes are
independent of the parent with exception of the IPC communication channel
that is established between the two. Each process has it&#39;s own memory, with
their own V8 instances. Because of the additional resource allocations
required, spawning a large number of child Node.js processes is not
recommended.
By default, child_process.fork() will spawn new Node.js instances using the
process.execPath of the parent process. The execPath property in the
options object allows for an alternative execution path to be used.
Node.js processes launched with a custom execPath will communicate with the
parent process using the file descriptor (fd) identified using the
environment variable NODE_CHANNEL_FD on the child process. The input and
output on this fd is expected to be line delimited JSON objects.
Note: Unlike the fork(2) POSIX system call, child_process.fork() does
not clone the current process.
child_process.spawn(command[, args][, options])


command {String} The command to run
args {Array} List of string arguments
options {Object}
cwd {String} Current working directory of the child process
env {Object} Environment key-value pairs
stdio {Array|String} Child&#39;s stdio configuration. (See
options.stdio)
detached {Boolean} Prepare child to run independently of its parent
process. Specific behavior depends on the platform, see
options.detached)
uid {Number} Sets the user identity of the process. (See setuid(2).)
gid {Number} Sets the group identity of the process. (See setgid(2).)
shell {Boolean|String} If true, runs command inside of a shell. Uses
&#39;/bin/sh&#39; on UNIX, and &#39;cmd.exe&#39; on Windows. A different shell can be
specified as a string. The shell should understand the -c switch on UNIX,
or /s /c on Windows. Defaults to false (no shell).


return: {ChildProcess}

The child_process.spawn() method spawns a new process using the given
command, with command line arguments in args. If omitted, args defaults
to an empty array.
A third argument may be used to specify additional options, with these defaults:
{
  cwd: undefined,
  env: process.env
}

Use cwd to specify the working directory from which the process is spawned.
If not given, the default is to inherit the current working directory.
Use env to specify environment variables that will be visible to the new
process, the default is process.env.
Example of running ls -lh /usr, capturing stdout, stderr, and the
exit code:
const spawn = require(&#39;child_process&#39;).spawn;
const ls = spawn(&#39;ls&#39;, [&#39;-lh&#39;, &#39;/usr&#39;]);

ls.stdout.on(&#39;data&#39;, (data) =&gt; {
  console.log(`stdout: ${data}`);
});

ls.stderr.on(&#39;data&#39;, (data) =&gt; {
  console.log(`stderr: ${data}`);
});

ls.on(&#39;close&#39;, (code) =&gt; {
  console.log(`child process exited with code ${code}`);
});

Example: A very elaborate way to run ps ax | grep ssh
const spawn = require(&#39;child_process&#39;).spawn;
const ps = spawn(&#39;ps&#39;, [&#39;ax&#39;]);
const grep = spawn(&#39;grep&#39;, [&#39;ssh&#39;]);

ps.stdout.on(&#39;data&#39;, (data) =&gt; {
  grep.stdin.write(data);
});

ps.stderr.on(&#39;data&#39;, (data) =&gt; {
  console.log(`ps stderr: ${data}`);
});

ps.on(&#39;close&#39;, (code) =&gt; {
  if (code !== 0) {
    console.log(`ps process exited with code ${code}`);
  }
  grep.stdin.end();
});

grep.stdout.on(&#39;data&#39;, (data) =&gt; {
  console.log(`${data}`);
});

grep.stderr.on(&#39;data&#39;, (data) =&gt; {
  console.log(`grep stderr: ${data}`);
});

grep.on(&#39;close&#39;, (code) =&gt; {
  if (code !== 0) {
    console.log(`grep process exited with code ${code}`);
  }
});

Example of checking for failed exec:
const spawn = require(&#39;child_process&#39;).spawn;
const child = spawn(&#39;bad_command&#39;);

child.on(&#39;error&#39;, (err) =&gt; {
  console.log(&#39;Failed to start child process.&#39;);
});

options.detached

On Windows, setting options.detached to true makes it possible for the
child process to continue running after the parent exits. The child will have
its own console window. Once enabled for a child process, it cannot be
disabled.
On non-Windows platforms, if options.detached is set to true, the child
process will be made the leader of a new process group and session. Note that
child processes may continue running after the parent exits regardless of
whether they are detached or not.  See setsid(2) for more information.
By default, the parent will wait for the detached child to exit. To prevent
the parent from waiting for a given child, use the child.unref() method.
Doing so will cause the parent&#39;s event loop to not include the child in its
reference count, allowing the parent to exit independently of the child, unless
there is an established IPC channel between the child and parent.
When using the detached option to start a long-running process, the process
will not stay running in the background after the parent exits unless it is
provided with a stdio configuration that is not connected to the parent.
If the parent&#39;s stdio is inherited, the child will remain attached to the
controlling terminal.
Example of a long-running process, by detaching and also ignoring its parent
stdio file descriptors, in order to ignore the parent&#39;s termination:
const spawn = require(&#39;child_process&#39;).spawn;

const child = spawn(process.argv[0], [&#39;child_program.js&#39;], {
  detached: true,
  stdio: &#39;ignore&#39;
});

child.unref();

Alternatively one can redirect the child process&#39; output into files:
const fs = require(&#39;fs&#39;);
const spawn = require(&#39;child_process&#39;).spawn;
const out = fs.openSync(&#39;./out.log&#39;, &#39;a&#39;);
const err = fs.openSync(&#39;./out.log&#39;, &#39;a&#39;);

const child = spawn(&#39;prg&#39;, [], {
 detached: true,
 stdio: [ &#39;ignore&#39;, out, err ]
});

child.unref();

options.stdio

The options.stdio option is used to configure the pipes that are established
between the parent and child process. By default, the child&#39;s stdin, stdout,
and stderr are redirected to corresponding child.stdin, child.stdout, and
child.stderr streams on the ChildProcess object. This is equivalent to
setting the options.stdio equal to [&#39;pipe&#39;, &#39;pipe&#39;, &#39;pipe&#39;].
For convenience, options.stdio may be one of the following strings:

&#39;pipe&#39; - equivalent to [&#39;pipe&#39;, &#39;pipe&#39;, &#39;pipe&#39;] (the default)
&#39;ignore&#39; - equivalent to [&#39;ignore&#39;, &#39;ignore&#39;, &#39;ignore&#39;]
&#39;inherit&#39; - equivalent to [process.stdin, process.stdout, process.stderr]
 or [0,1,2]

Otherwise, the value of options.stdio is an array where each index corresponds
to an fd in the child. The fds 0, 1, and 2 correspond to stdin, stdout,
and stderr, respectively. Additional fds can be specified to create additional
pipes between the parent and child. The value is one of the following:

&#39;pipe&#39; - Create a pipe between the child process and the parent process.
The parent end of the pipe is exposed to the parent as a property on the
child_process object as child.stdio[fd]. Pipes created for
fds 0 - 2 are also available as child.stdin, child.stdout
and child.stderr, respectively.
&#39;ipc&#39; - Create an IPC channel for passing messages/file descriptors
between parent and child. A ChildProcess may have at most one IPC stdio
file descriptor. Setting this option enables the child.send() method.
If the child writes JSON messages to this file descriptor, the
child.on(&#39;message&#39;) event handler will be triggered in the parent.
If the child is a Node.js process, the presence of an IPC channel will enable
process.send(), process.disconnect(), process.on(&#39;disconnect&#39;), and
process.on(&#39;message&#39;) within the child.
&#39;ignore&#39; - Instructs Node.js to ignore the fd in the child. While Node.js
will always open fds 0 - 2 for the processes it spawns, setting the fd to
&#39;ignore&#39; will cause Node.js to open /dev/null and attach it to the
child&#39;s fd.
{Stream} object - Share a readable or writable stream that refers to a tty,
file, socket, or a pipe with the child process. The stream&#39;s underlying
file descriptor is duplicated in the child process to the fd that
corresponds to the index in the stdio array. Note that the stream must
have an underlying descriptor (file streams do not until the &#39;open&#39;
event has occurred).
Positive integer - The integer value is interpreted as a file descriptor
that is is currently open in the parent process. It is shared with the child
process, similar to how {Stream} objects can be shared.
null, undefined - Use default value. For stdio fds 0, 1 and 2 (in other
words, stdin, stdout, and stderr) a pipe is created. For fd 3 and up, the
default is &#39;ignore&#39;.

Example:
const spawn = require(&#39;child_process&#39;).spawn;

// Child will use parent&#39;s stdios
spawn(&#39;prg&#39;, [], { stdio: &#39;inherit&#39; });

// Spawn child sharing only stderr
spawn(&#39;prg&#39;, [], { stdio: [&#39;pipe&#39;, &#39;pipe&#39;, process.stderr] });

// Open an extra fd=4, to interact with programs presenting a
// startd-style interface.
spawn(&#39;prg&#39;, [], { stdio: [&#39;pipe&#39;, null, null, null, &#39;pipe&#39;] });

It is worth noting that when an IPC channel is established between the
parent and child processes, and the child is a Node.js process, the child
is launched with the IPC channel unreferenced (using unref()) until the
child registers an event handler for the process.on(&#39;disconnect&#39;) event.
This allows the child to exit normally without the process being held open
by the open IPC channel.
See also: child_process.exec() and child_process.fork()
Synchronous Process Creation
The child_process.spawnSync(), child_process.execSync(), and
child_process.execFileSync() methods are synchronous and WILL block
the Node.js event loop, pausing execution of any additional code until the
spawned process exits.
Blocking calls like these are mostly useful for simplifying general purpose
scripting tasks and for simplifying the loading/processing of application
configuration at startup.
child_process.execFileSync(file[, args][, options])


file {String} The name or path of the executable file to run
args {Array} List of string arguments
options {Object}
cwd {String} Current working directory of the child process
input {String|Buffer} The value which will be passed as stdin to the
spawned process
supplying this value will override stdio[0]


stdio {Array} Child&#39;s stdio configuration. (Default: &#39;pipe&#39;)
stderr by default will be output to the parent process&#39; stderr unless
stdio is specified


env {Object} Environment key-value pairs
uid {Number} Sets the user identity of the process. (See setuid(2).)
gid {Number} Sets the group identity of the process. (See setgid(2).)
timeout {Number} In milliseconds the maximum amount of time the process
is allowed to run. (Default: undefined)
killSignal {String} The signal value to be used when the spawned process
will be killed. (Default: &#39;SIGTERM&#39;)
maxBuffer {Number} largest amount of data (in bytes) allowed on
stdout or stderr - if exceeded child process is killed
encoding {String} The encoding used for all stdio inputs and outputs. (Default: &#39;buffer&#39;)


return: {Buffer|String} The stdout from the command

The child_process.execFileSync() method is generally identical to
child_process.execFile() with the exception that the method will not return
until the child process has fully closed. When a timeout has been encountered
and killSignal is sent, the method won&#39;t return until the process has
completely exited. Note that if the child process intercepts and handles
the SIGTERM signal and does not exit, the parent process will still wait
until the child process has exited.
If the process times out, or has a non-zero exit code, this method will
throw.  The Error object will contain the entire result from
child_process.spawnSync()
child_process.execSync(command[, options])


command {String} The command to run
options {Object}
cwd {String} Current working directory of the child process
input {String|Buffer} The value which will be passed as stdin to the
spawned process
supplying this value will override stdio[0]


stdio {Array} Child&#39;s stdio configuration. (Default: &#39;pipe&#39;)
stderr by default will be output to the parent process&#39; stderr unless
stdio is specified


env {Object} Environment key-value pairs
shell {String} Shell to execute the command with
(Default: &#39;/bin/sh&#39; on UNIX, &#39;cmd.exe&#39; on Windows, The shell should
 understand the -c switch on UNIX or /s /c on Windows. On Windows,
 command line parsing should be compatible with cmd.exe.)
uid {Number} Sets the user identity of the process. (See setuid(2).)
gid {Number} Sets the group identity of the process. (See setgid(2).)
timeout {Number} In milliseconds the maximum amount of time the process
is allowed to run. (Default: undefined)
killSignal {String} The signal value to be used when the spawned process
will be killed. (Default: &#39;SIGTERM&#39;)
maxBuffer {Number} largest amount of data (in bytes) allowed on
stdout or stderr - if exceeded child process is killed
encoding {String} The encoding used for all stdio inputs and outputs.
(Default: &#39;buffer&#39;)


return: {Buffer|String} The stdout from the command

The child_process.execSync() method is generally identical to
child_process.exec() with the exception that the method will not return until
the child process has fully closed. When a timeout has been encountered and
killSignal is sent, the method won&#39;t return until the process has completely
exited. Note that if  the child process intercepts and handles the SIGTERM
signal and doesn&#39;t exit, the parent process will wait until the child
process has exited.
If the process times out, or has a non-zero exit code, this method will
throw.  The Error object will contain the entire result from
child_process.spawnSync()
child_process.spawnSync(command[, args][, options])


command {String} The command to run
args {Array} List of string arguments
options {Object}
cwd {String} Current working directory of the child process
input {String|Buffer} The value which will be passed as stdin to the
spawned process
supplying this value will override stdio[0]


stdio {Array} Child&#39;s stdio configuration.
env {Object} Environment key-value pairs
uid {Number} Sets the user identity of the process. (See setuid(2).)
gid {Number} Sets the group identity of the process. (See setgid(2).)
timeout {Number} In milliseconds the maximum amount of time the process
is allowed to run. (Default: undefined)
killSignal {String} The signal value to be used when the spawned process
will be killed. (Default: &#39;SIGTERM&#39;)
maxBuffer {Number} largest amount of data (in bytes) allowed on
stdout or stderr - if exceeded child process is killed
encoding {String} The encoding used for all stdio inputs and outputs.
(Default: &#39;buffer&#39;)
shell {Boolean|String} If true, runs command inside of a shell. Uses
&#39;/bin/sh&#39; on UNIX, and &#39;cmd.exe&#39; on Windows. A different shell can be
specified as a string. The shell should understand the -c switch on UNIX,
or /s /c on Windows. Defaults to false (no shell).


return: {Object}
pid {Number} Pid of the child process
output {Array} Array of results from stdio output
stdout {Buffer|String} The contents of output[1]
stderr {Buffer|String} The contents of output[2]
status {Number} The exit code of the child process
signal {String} The signal used to kill the child process
error {Error} The error object if the child process failed or timed out



The child_process.spawnSync() method is generally identical to
child_process.spawn() with the exception that the function will not return
until the child process has fully closed. When a timeout has been encountered
and killSignal is sent, the method won&#39;t return until the process has
completely exited. Note that if the process intercepts and handles the
SIGTERM signal and doesn&#39;t exit, the parent process will wait until the child
process has exited.
Class: ChildProcess

Instances of the ChildProcess class are EventEmitters that represent
spawned child processes.
Instances of ChildProcess are not intended to be created directly. Rather,
use the child_process.spawn(), child_process.exec(),
child_process.execFile(), or child_process.fork() methods to create
instances of ChildProcess.
Event: &#39;close&#39;


code {Number} the exit code if the child exited on its own.
signal {String} the signal by which the child process was terminated.

The &#39;close&#39; event is emitted when the stdio streams of a child process have
been closed. This is distinct from the &#39;exit&#39; event, since multiple
processes might share the same stdio streams.
Event: &#39;disconnect&#39;

The &#39;disconnect&#39; event is emitted after calling the
child.disconnect() method in parent process or process.disconnect() in child process. After
disconnecting it is no longer possible to send or receive messages, and the
child.connected property is false.
Event: &#39;error&#39;

err {Error} the error.

The &#39;error&#39; event is emitted whenever:

The process could not be spawned, or
The process could not be killed, or
Sending a message to the child process failed.

Note that the &#39;exit&#39; event may or may not fire after an error has occurred.
If you are listening to both the &#39;exit&#39; and &#39;error&#39; events, it is important
to guard against accidentally invoking handler functions multiple times.
See also child.kill() and child.send().
Event: &#39;exit&#39;


code {Number} the exit code if the child exited on its own.
signal {String} the signal by which the child process was terminated.

The &#39;exit&#39; event is emitted after the child process ends. If the process
exited, code is the final exit code of the process, otherwise null. If the
process terminated due to receipt of a signal, signal is the string name of
the signal, otherwise null. One of the two will always be non-null.
Note that when the &#39;exit&#39; event is triggered, child process stdio streams
might still be open.
Also, note that Node.js establishes signal handlers for SIGINT and
SIGTERM and Node.js processes will not terminate immediately due to receipt
of those signals. Rather, Node.js will perform a sequence of cleanup actions
and then will re-raise the handled signal.
See waitpid(2).
Event: &#39;message&#39;


message {Object} a parsed JSON object or primitive value.
sendHandle {Handle} a net.Socket or net.Server object, or
undefined.

The &#39;message&#39; event is triggered when a child process uses process.send()
to send messages.
child.connected


{Boolean} Set to false after child.disconnect() is called

The child.connected property indicates whether it is still possible to send
and receive messages from a child process. When child.connected is false, it
is no longer possible to send or receive messages.
child.disconnect()

Closes the IPC channel between parent and child, allowing the child to exit
gracefully once there are no other connections keeping it alive. After calling
this method the child.connected and process.connected properties in both
the parent and child (respectively) will be set to false, and it will be no
longer possible to pass messages between the processes.
The &#39;disconnect&#39; event will be emitted when there are no messages in the
process of being received. This will most often be triggered immediately after
calling child.disconnect().
Note that when the child process is a Node.js instance (e.g. spawned using
child_process.fork()), the process.disconnect() method can be invoked
within the child process to close the IPC channel as well.
child.kill([signal])


signal {String}

The child.kill() methods sends a signal to the child process. If no argument
is given, the process will be sent the &#39;SIGTERM&#39; signal. See signal(7) for
a list of available signals.
const spawn = require(&#39;child_process&#39;).spawn;
const grep = spawn(&#39;grep&#39;, [&#39;ssh&#39;]);

grep.on(&#39;close&#39;, (code, signal) =&gt; {
  console.log(
    `child process terminated due to receipt of signal ${signal}`);
});

// Send SIGHUP to process
grep.kill(&#39;SIGHUP&#39;);

The ChildProcess object may emit an &#39;error&#39; event if the signal cannot be
delivered. Sending a signal to a child process that has already exited is not
an error but may have unforeseen consequences. Specifically, if the process
identifier (PID) has been reassigned to another process, the signal will be
delivered to that process instead which can have unexpected results.
Note that while the function is called kill, the signal delivered to the
child process may not actually terminate the process.
See kill(2) for reference.
Also note: on Linux, child processes of child processes will not be terminated
when attempting to kill their parent. This is likely to happen when running a
new process in a shell or with use of the shell option of ChildProcess, such
as in this example:
&#39;use strict&#39;;
const spawn = require(&#39;child_process&#39;).spawn;

let child = spawn(&#39;sh&#39;, [&#39;-c&#39;,
  `node -e &quot;setInterval(() =&gt; {
      console.log(process.pid, &#39;is alive&#39;)
    }, 500);&quot;`
  ], {
    stdio: [&#39;inherit&#39;, &#39;inherit&#39;, &#39;inherit&#39;]
  });

setTimeout(() =&gt; {
  child.kill(); // does not terminate the node process in the shell
}, 2000);

child.pid


{Number} Integer

Returns the process identifier (PID) of the child process.
Example:
const spawn = require(&#39;child_process&#39;).spawn;
const grep = spawn(&#39;grep&#39;, [&#39;ssh&#39;]);

console.log(`Spawned child pid: ${grep.pid}`);
grep.stdin.end();

child.send(message[, sendHandle[, options]][, callback])


message {Object}
sendHandle {Handle}
options {Object}
callback {Function}
Return: {Boolean}

When an IPC channel has been established between the parent and child (
i.e. when using child_process.fork()), the child.send() method can be
used to send messages to the child process. When the child process is a Node.js
instance, these messages can be received via the process.on(&#39;message&#39;) event.
For example, in the parent script:
const cp = require(&#39;child_process&#39;);
const n = cp.fork(`${__dirname}/sub.js`);

n.on(&#39;message&#39;, (m) =&gt; {
  console.log(&#39;PARENT got message:&#39;, m);
});

n.send({ hello: &#39;world&#39; });

And then the child script, &#39;sub.js&#39; might look like this:
process.on(&#39;message&#39;, (m) =&gt; {
  console.log(&#39;CHILD got message:&#39;, m);
});

process.send({ foo: &#39;bar&#39; });

Child Node.js processes will have a process.send() method of their own that
allows the child to send messages back to the parent.
There is a special case when sending a {cmd: &#39;NODE_foo&#39;} message. All messages
containing a NODE_ prefix in its cmd property are considered to be reserved
for use within Node.js core and will not be emitted in the child&#39;s
process.on(&#39;message&#39;) event. Rather, such messages are emitted using the
process.on(&#39;internalMessage&#39;) event and are consumed internally by Node.js.
Applications should avoid using such messages or listening for
&#39;internalMessage&#39; events as it is subject to change without notice.
The optional sendHandle argument that may be passed to child.send() is for
passing a TCP server or socket object to the child process. The child will
receive the object as the second argument passed to the callback function
registered on the process.on(&#39;message&#39;) event. Any data that is received
and buffered in the socket will not be sent to the child.
The options argument, if present, is an object used to parameterize the
sending of certain types of handles. options supports the following
properties:

keepOpen - A Boolean value that can be used when passing instances of
net.Socket. When true, the socket is kept open in the sending process.
Defaults to false.

The optional callback is a function that is invoked after the message is
sent but before the child may have received it.  The function is called with a
single argument: null on success, or an Error object on failure.
If no callback function is provided and the message cannot be sent, an
&#39;error&#39; event will be emitted by the ChildProcess object. This can happen,
for instance, when the child process has already exited.
child.send() will return false if the channel has closed or when the
backlog of unsent messages exceeds a threshold that makes it unwise to send
more. Otherwise, the method returns true. The callback function can be
used to implement flow control.
Example: sending a server object
The sendHandle argument can be used, for instance, to pass the handle of
a TCP server object to the child process as illustrated in the example below:
const child = require(&#39;child_process&#39;).fork(&#39;child.js&#39;);

// Open up the server object and send the handle.
const server = require(&#39;net&#39;).createServer();
server.on(&#39;connection&#39;, (socket) =&gt; {
  socket.end(&#39;handled by parent&#39;);
});
server.listen(1337, () =&gt; {
  child.send(&#39;server&#39;, server);
});

The child would then receive the server object as:
process.on(&#39;message&#39;, (m, server) =&gt; {
  if (m === &#39;server&#39;) {
    server.on(&#39;connection&#39;, (socket) =&gt; {
      socket.end(&#39;handled by child&#39;);
    });
  }
});

Once the server is now shared between the parent and child, some connections
can be handled by the parent and some by the child.
While the example above uses a server created using the net module, dgram
module servers use exactly the same workflow with the exceptions of listening on
a &#39;message&#39; event instead of &#39;connection&#39; and using server.bind() instead of
server.listen(). This is, however, currently only supported on UNIX platforms.
Example: sending a socket object
Similarly, the sendHandler argument can be used to pass the handle of a
socket to the child process. The example below spawns two children that each
handle connections with &quot;normal&quot; or &quot;special&quot; priority:
const normal = require(&#39;child_process&#39;).fork(&#39;child.js&#39;, [&#39;normal&#39;]);
const special = require(&#39;child_process&#39;).fork(&#39;child.js&#39;, [&#39;special&#39;]);

// Open up the server and send sockets to child
const server = require(&#39;net&#39;).createServer();
server.on(&#39;connection&#39;, (socket) =&gt; {

  // If this is special priority
  if (socket.remoteAddress === &#39;74.125.127.100&#39;) {
    special.send(&#39;socket&#39;, socket);
    return;
  }
  // This is normal priority
  normal.send(&#39;socket&#39;, socket);
});
server.listen(1337);

The child.js would receive the socket handle as the second argument passed
to the event callback function:
process.on(&#39;message&#39;, (m, socket) =&gt; {
  if (m === &#39;socket&#39;) {
    socket.end(`Request handled with ${process.argv[2]} priority`);
  }
});

Once a socket has been passed to a child, the parent is no longer capable of
tracking when the socket is destroyed. To indicate this, the .connections
property becomes null. It is recommended not to use .maxConnections when
this occurs.
Note: this function uses JSON.stringify() internally to serialize the
message.
child.stderr


{Stream}

A Readable Stream that represents the child process&#39;s stderr.
If the child was spawned with stdio[2] set to anything other than &#39;pipe&#39;,
then this will be undefined.
child.stderr is an alias for child.stdio[2]. Both properties will refer to
the same value.
child.stdin


{Stream}

A Writable Stream that represents the child process&#39;s stdin.
Note that if a child process waits to read all of its input, the child will not
continue until this stream has been closed via end().
If the child was spawned with stdio[0] set to anything other than &#39;pipe&#39;,
then this will be undefined.
child.stdin is an alias for child.stdio[0]. Both properties will refer to
the same value.
child.stdio


{Array}

A sparse array of pipes to the child process, corresponding with positions in
the stdio option passed to child_process.spawn() that have been set
to the value &#39;pipe&#39;. Note that child.stdio[0], child.stdio[1], and
child.stdio[2] are also available as child.stdin, child.stdout, and
child.stderr, respectively.
In the following example, only the child&#39;s fd 1 (stdout) is configured as a
pipe, so only the parent&#39;s child.stdio[1] is a stream, all other values in
the array are null.
const assert = require(&#39;assert&#39;);
const fs = require(&#39;fs&#39;);
const child_process = require(&#39;child_process&#39;);

const child = child_process.spawn(&#39;ls&#39;, {
    stdio: [
      0, // Use parents stdin for child
      &#39;pipe&#39;, // Pipe child&#39;s stdout to parent
      fs.openSync(&#39;err.out&#39;, &#39;w&#39;) // Direct child&#39;s stderr to a file
    ]
});

assert.equal(child.stdio[0], null);
assert.equal(child.stdio[0], child.stdin);

assert(child.stdout);
assert.equal(child.stdio[1], child.stdout);

assert.equal(child.stdio[2], null);
assert.equal(child.stdio[2], child.stderr);

child.stdout


{Stream}

A Readable Stream that represents the child process&#39;s stdout.
If the child was spawned with stdio[1] set to anything other than &#39;pipe&#39;,
then this will be undefined.
child.stdout is an alias for child.stdio[1]. Both properties will refer
to the same value.
maxBuffer and Unicode
It is important to keep in mind that the maxBuffer option specifies the
largest number of octets allowed on stdout or stderr. If this value is
exceeded, then the child process is terminated. This particularly impacts
output that includes multibyte character encodings such as UTF-8 or UTF-16.
For instance, the following will output 13 UTF-8 encoded octets to stdout
although there are only 4 characters:
console.log(&#39;中文测试&#39;);

cluster.html.body:
title: cluster
tags: node
date: 2016-08-11 10:27:51
Cluster
Stability: 2 - Stable
A single instance of Node.js runs in a single thread. To take advantage of
multi-core systems the user will sometimes want to launch a cluster of Node.js
processes to handle the load.
The cluster module allows you to easily create child processes that
all share server ports.
const cluster = require(&#39;cluster&#39;);
const http = require(&#39;http&#39;);
const numCPUs = require(&#39;os&#39;).cpus().length;

if (cluster.isMaster) {
  // Fork workers.
  for (var i = 0; i &lt; numCPUs; i++) {
    cluster.fork();
  }

  cluster.on(&#39;exit&#39;, (worker, code, signal) =&gt; {
    console.log(`worker ${worker.process.pid} died`);
  });
} else {
  // Workers can share any TCP connection
  // In this case it is an HTTP server
  http.createServer((req, res) =&gt; {
    res.writeHead(200);
    res.end(&#39;hello world\n&#39;);
  }).listen(8000);
}

Running Node.js will now share port 8000 between the workers:
$ NODE_DEBUG=cluster node server.js
23521,Master Worker 23524 online
23521,Master Worker 23526 online
23521,Master Worker 23523 online
23521,Master Worker 23528 online

Please note that, on Windows, it is not yet possible to set up a named pipe
server in a worker.
How It Works

The worker processes are spawned using the child_process.fork() method,
so that they can communicate with the parent via IPC and pass server
handles back and forth.
The cluster module supports two methods of distributing incoming
connections.
The first one (and the default one on all platforms except Windows),
is the round-robin approach, where the master process listens on a
port, accepts new connections and distributes them across the workers
in a round-robin fashion, with some built-in smarts to avoid
overloading a worker process.
The second approach is where the master process creates the listen
socket and sends it to interested workers. The workers then accept
incoming connections directly.
The second approach should, in theory, give the best performance.
In practice however, distribution tends to be very unbalanced due
to operating system scheduler vagaries. Loads have been observed
where over 70% of all connections ended up in just two processes,
out of a total of eight.
Because server.listen() hands off most of the work to the master
process, there are three cases where the behavior between a normal
Node.js process and a cluster worker differs:

server.listen({fd: 7}) Because the message is passed to the master,
file descriptor 7 in the parent will be listened on, and the
handle passed to the worker, rather than listening to the worker&#39;s
idea of what the number 7 file descriptor references.
server.listen(handle) Listening on handles explicitly will cause
the worker to use the supplied handle, rather than talk to the master
process.  If the worker already has the handle, then it&#39;s presumed
that you know what you are doing.
server.listen(0) Normally, this will cause servers to listen on a
random port.  However, in a cluster, each worker will receive the
same &quot;random&quot; port each time they do listen(0).  In essence, the
port is random the first time, but predictable thereafter.  If you
want to listen on a unique port, generate a port number based on the
cluster worker ID.

There is no routing logic in Node.js, or in your program, and no shared
state between the workers.  Therefore, it is important to design your
program such that it does not rely too heavily on in-memory data objects
for things like sessions and login.
Because workers are all separate processes, they can be killed or
re-spawned depending on your program&#39;s needs, without affecting other
workers.  As long as there are some workers still alive, the server will
continue to accept connections.  If no workers are alive, existing connections
will be dropped and new connections will be refused.  Node.js does not
automatically manage the number of workers for you, however.  It is your
responsibility to manage the worker pool for your application&#39;s needs.
Class: Worker
A Worker object contains all public information and method about a worker.
In the master it can be obtained using cluster.workers. In a worker
it can be obtained using cluster.worker.
Event: &#39;disconnect&#39;
Similar to the cluster.on(&#39;disconnect&#39;) event, but specific to this worker.
cluster.fork().on(&#39;disconnect&#39;, () =&gt; {
  // Worker has disconnected
});

Event: &#39;error&#39;
This event is the same as the one provided by child_process.fork().
In a worker you can also use process.on(&#39;error&#39;).
Event: &#39;exit&#39;

code {Number} the exit code, if it exited normally.
signal {String} the name of the signal (eg. &#39;SIGHUP&#39;) that caused
the process to be killed.

Similar to the cluster.on(&#39;exit&#39;) event, but specific to this worker.
const worker = cluster.fork();
worker.on(&#39;exit&#39;, (code, signal) =&gt; {
  if (signal) {
    console.log(`worker was killed by signal: ${signal}`);
  } else if (code !== 0) {
    console.log(`worker exited with error code: ${code}`);
  } else {
    console.log(&#39;worker success!&#39;);
  }
});

Event: &#39;listening&#39;

address {Object}

Similar to the cluster.on(&#39;listening&#39;) event, but specific to this worker.
cluster.fork().on(&#39;listening&#39;, (address) =&gt; {
  // Worker is listening
});

It is not emitted in the worker.
Event: &#39;message&#39;

message {Object}
handle {undefined|Object}

Similar to the cluster.on(&#39;message&#39;) event, but specific to this worker. In a
worker you can also use process.on(&#39;message&#39;).
See process event: &#39;message&#39;.
As an example, here is a cluster that keeps count of the number of requests
in the master process using the message system:
const cluster = require(&#39;cluster&#39;);
const http = require(&#39;http&#39;);

if (cluster.isMaster) {

  // Keep track of http requests
  var numReqs = 0;
  setInterval(() =&gt; {
    console.log(&#39;numReqs =&#39;, numReqs);
  }, 1000);

  // Count requests
  function messageHandler(msg) {
    if (msg.cmd &amp;&amp; msg.cmd == &#39;notifyRequest&#39;) {
      numReqs += 1;
    }
  }

  // Start workers and listen for messages containing notifyRequest
  const numCPUs = require(&#39;os&#39;).cpus().length;
  for (var i = 0; i &lt; numCPUs; i++) {
    cluster.fork();
  }

  Object.keys(cluster.workers).forEach((id) =&gt; {
    cluster.workers[id].on(&#39;message&#39;, messageHandler);
  });

} else {

  // Worker processes have a http server.
  http.Server((req, res) =&gt; {
    res.writeHead(200);
    res.end(&#39;hello world\n&#39;);

    // notify master about the request
    process.send({ cmd: &#39;notifyRequest&#39; });
  }).listen(8000);
}

Event: &#39;online&#39;
Similar to the cluster.on(&#39;online&#39;) event, but specific to this worker.
cluster.fork().on(&#39;online&#39;, () =&gt; {
  // Worker is online
});

It is not emitted in the worker.
worker.disconnect()
In a worker, this function will close all servers, wait for the &#39;close&#39; event on
those servers, and then disconnect the IPC channel.
In the master, an internal message is sent to the worker causing it to call
.disconnect() on itself.
Causes .exitedAfterDisconnect to be set.
Note that after a server is closed, it will no longer accept new connections,
but connections may be accepted by any other listening worker. Existing
connections will be allowed to close as usual. When no more connections exist,
see server.close(), the IPC channel to the worker will close allowing it to
die gracefully.
The above applies only to server connections, client connections are not
automatically closed by workers, and disconnect does not wait for them to close
before exiting.
Note that in a worker, process.disconnect exists, but it is not this function,
it is disconnect.
Because long living server connections may block workers from disconnecting, it
may be useful to send a message, so application specific actions may be taken to
close them. It also may be useful to implement a timeout, killing a worker if
the &#39;disconnect&#39; event has not been emitted after some time.
if (cluster.isMaster) {
  var worker = cluster.fork();
  var timeout;

  worker.on(&#39;listening&#39;, (address) =&gt; {
    worker.send(&#39;shutdown&#39;);
    worker.disconnect();
    timeout = setTimeout(() =&gt; {
      worker.kill();
    }, 2000);
  });

  worker.on(&#39;disconnect&#39;, () =&gt; {
    clearTimeout(timeout);
  });

} else if (cluster.isWorker) {
  const net = require(&#39;net&#39;);
  var server = net.createServer((socket) =&gt; {
    // connections never end
  });

  server.listen(8000);

  process.on(&#39;message&#39;, (msg) =&gt; {
    if (msg === &#39;shutdown&#39;) {
      // initiate graceful close of any connections to server
    }
  });
}

worker.exitedAfterDisconnect

{Boolean}

Set by calling .kill() or .disconnect(). Until then, it is undefined.
The boolean worker.exitedAfterDisconnect lets you distinguish between voluntary
and accidental exit, the master may choose not to respawn a worker based on
this value.
cluster.on(&#39;exit&#39;, (worker, code, signal) =&gt; {
  if (worker.exitedAfterDisconnect === true) {
    console.log(&#39;Oh, it was just voluntary – no need to worry&#39;);
  }
});

// kill worker
worker.kill();

worker.id

{Number}

Each new worker is given its own unique id, this id is stored in the
id.
While a worker is alive, this is the key that indexes it in
cluster.workers
worker.isConnected()
This function returns true if the worker is connected to its master via its IPC
channel, false otherwise. A worker is connected to its master after it&#39;s been
created. It is disconnected after the &#39;disconnect&#39; event is emitted.
worker.isDead()
This function returns true if the worker&#39;s process has terminated (either
because of exiting or being signaled). Otherwise, it returns false.
worker.kill([signal=&#39;SIGTERM&#39;])

signal {String} Name of the kill signal to send to the worker
process.

This function will kill the worker. In the master, it does this by disconnecting
the worker.process, and once disconnected, killing with signal. In the
worker, it does it by disconnecting the channel, and then exiting with code 0.
Causes .exitedAfterDisconnect to be set.
This method is aliased as worker.destroy() for backwards compatibility.
Note that in a worker, process.kill() exists, but it is not this function,
it is kill.
worker.process

{ChildProcess}

All workers are created using child_process.fork(), the returned object
from this function is stored as .process. In a worker, the global process
is stored.
See: Child Process module
Note that workers will call process.exit(0) if the &#39;disconnect&#39; event occurs
on process and .exitedAfterDisconnect is not true. This protects against
accidental disconnection.
worker.send(message[, sendHandle][, callback])

message {Object}
sendHandle {Handle}
callback {Function}
Return: Boolean

Send a message to a worker or master, optionally with a handle.
In the master this sends a message to a specific worker. It is identical to
ChildProcess.send().
In a worker this sends a message to the master. It is identical to
process.send().
This example will echo back all messages from the master:
if (cluster.isMaster) {
  var worker = cluster.fork();
  worker.send(&#39;hi there&#39;);

} else if (cluster.isWorker) {
  process.on(&#39;message&#39;, (msg) =&gt; {
    process.send(msg);
  });
}

worker.suicide
Stability: 0 - Deprecated: Use [`worker.exitedAfterDisconnect`][] instead.
An alias to worker.exitedAfterDisconnect.
Set by calling .kill() or .disconnect(). Until then, it is undefined.
The boolean worker.suicide lets you distinguish between voluntary
and accidental exit, the master may choose not to respawn a worker based on
this value.
cluster.on(&#39;exit&#39;, (worker, code, signal) =&gt; {
  if (worker.suicide === true) {
    console.log(&#39;Oh, it was just voluntary – no need to worry&#39;);
  }
});

// kill worker
worker.kill();

This API only exists for backwards compatibility and will be removed in the
future.
Event: &#39;disconnect&#39;

worker {cluster.Worker}

Emitted after the worker IPC channel has disconnected. This can occur when a
worker exits gracefully, is killed, or is disconnected manually (such as with
worker.disconnect()).
There may be a delay between the &#39;disconnect&#39; and &#39;exit&#39; events.  These events
can be used to detect if the process is stuck in a cleanup or if there are
long-living connections.
cluster.on(&#39;disconnect&#39;, (worker) =&gt; {
  console.log(`The worker #${worker.id} has disconnected`);
});

Event: &#39;exit&#39;

worker {cluster.Worker}
code {Number} the exit code, if it exited normally.
signal {String} the name of the signal (eg. &#39;SIGHUP&#39;) that caused
the process to be killed.

When any of the workers die the cluster module will emit the &#39;exit&#39; event.
This can be used to restart the worker by calling .fork() again.
cluster.on(&#39;exit&#39;, (worker, code, signal) =&gt; {
  console.log(&#39;worker %d died (%s). restarting...&#39;,
    worker.process.pid, signal || code);
  cluster.fork();
});

See child_process event: &#39;exit&#39;.
Event: &#39;fork&#39;

worker {cluster.Worker}

When a new worker is forked the cluster module will emit a &#39;fork&#39; event.
This can be used to log worker activity, and create your own timeout.
var timeouts = [];
function errorMsg() {
  console.error(&#39;Something must be wrong with the connection ...&#39;);
}

cluster.on(&#39;fork&#39;, (worker) =&gt; {
  timeouts[worker.id] = setTimeout(errorMsg, 2000);
});
cluster.on(&#39;listening&#39;, (worker, address) =&gt; {
  clearTimeout(timeouts[worker.id]);
});
cluster.on(&#39;exit&#39;, (worker, code, signal) =&gt; {
  clearTimeout(timeouts[worker.id]);
  errorMsg();
});

Event: &#39;listening&#39;

worker {cluster.Worker}
address {Object}

After calling listen() from a worker, when the &#39;listening&#39; event is emitted on
the server, a &#39;listening&#39; event will also be emitted on cluster in the master.
The event handler is executed with two arguments, the worker contains the worker
object and the address object contains the following connection properties:
address, port and addressType. This is very useful if the worker is listening
on more than one address.
cluster.on(&#39;listening&#39;, (worker, address) =&gt; {
  console.log(
    `A worker is now connected to ${address.address}:${address.port}`);
});

The addressType is one of:

4 (TCPv4)
6 (TCPv6)
-1 (unix domain socket)
&quot;udp4&quot; or &quot;udp6&quot; (UDP v4 or v6)

Event: &#39;message&#39;

worker {cluster.Worker}
message {Object}
handle {undefined|Object}

Emitted when any worker receives a message.
See child_process event: &#39;message&#39;.
Before Node.js v6.0, this event emitted only the message and the handle,
but not the worker object, contrary to what the documentation stated.
If you need to support older versions and don&#39;t need the worker object,
you can work around the discrepancy by checking the number of arguments:
cluster.on(&#39;message&#39;, function(worker, message, handle) {
  if (arguments.length === 2) {
    handle = message;
    message = worker;
    worker = undefined;
  }
  // ...
});

Event: &#39;online&#39;

worker {cluster.Worker}

After forking a new worker, the worker should respond with an online message.
When the master receives an online message it will emit this event.
The difference between &#39;fork&#39; and &#39;online&#39; is that fork is emitted when the
master forks a worker, and &#39;online&#39; is emitted when the worker is running.
cluster.on(&#39;online&#39;, (worker) =&gt; {
  console.log(&#39;Yay, the worker responded after it was forked&#39;);
});

Event: &#39;setup&#39;

settings {Object}

Emitted every time .setupMaster() is called.
The settings object is the cluster.settings object at the time
.setupMaster() was called and is advisory only, since multiple calls to
.setupMaster() can be made in a single tick.
If accuracy is important, use cluster.settings.
cluster.disconnect([callback])

callback {Function} called when all workers are disconnected and handles are
closed

Calls .disconnect() on each worker in cluster.workers.
When they are disconnected all internal handles will be closed, allowing the
master process to die gracefully if no other event is waiting.
The method takes an optional callback argument which will be called when finished.
This can only be called from the master process.
cluster.fork([env])

env {Object} Key/value pairs to add to worker process environment.
return {cluster.Worker}

Spawn a new worker process.
This can only be called from the master process.
cluster.isMaster

{Boolean}

True if the process is a master. This is determined
by the process.env.NODE_UNIQUE_ID. If process.env.NODE_UNIQUE_ID is
undefined, then isMaster is true.
cluster.isWorker

{Boolean}

True if the process is not a master (it is the negation of cluster.isMaster).
cluster.schedulingPolicy
The scheduling policy, either cluster.SCHED_RR for round-robin or
cluster.SCHED_NONE to leave it to the operating system. This is a
global setting and effectively frozen once you spawn the first worker
or call cluster.setupMaster(), whatever comes first.
SCHED_RR is the default on all operating systems except Windows.
Windows will change to SCHED_RR once libuv is able to effectively
distribute IOCP handles without incurring a large performance hit.
cluster.schedulingPolicy can also be set through the
NODE_CLUSTER_SCHED_POLICY environment variable. Valid
values are &quot;rr&quot; and &quot;none&quot;.
cluster.settings

{Object}
execArgv {Array} list of string arguments passed to the Node.js
executable. (Default=process.execArgv)
exec {String} file path to worker file.  (Default=process.argv[1])
args {Array} string arguments passed to worker.
(Default=process.argv.slice(2))
silent {Boolean} whether or not to send output to parent&#39;s stdio.
(Default=false)
stdio {Array} Configures the stdio of forked processes. Because the
cluster module relies on IPC to function, this configuration must contain an
&#39;ipc&#39; entry. When this option is provided, it overrides silent.
uid {Number} Sets the user identity of the process. (See setuid(2).)
gid {Number} Sets the group identity of the process. (See setgid(2).)



After calling .setupMaster() (or .fork()) this settings object will contain
the settings, including the default values.
This object is not supposed to be changed or set manually, by you.
cluster.setupMaster([settings])

settings {Object}
exec {String} file path to worker file.  (Default=process.argv[1])
args {Array} string arguments passed to worker.
(Default=process.argv.slice(2))
silent {Boolean} whether or not to send output to parent&#39;s stdio.
(Default=false)
stdio {Array} Configures the stdio of forked processes. When this option
is provided, it overrides silent.



setupMaster is used to change the default &#39;fork&#39; behavior. Once called,
the settings will be present in cluster.settings.
Note that:

any settings changes only affect future calls to .fork() and have no
effect on workers that are already running
The only attribute of a worker that cannot be set via .setupMaster() is
the env passed to .fork()
the defaults above apply to the first call only, the defaults for later
calls is the current value at the time of cluster.setupMaster() is called

Example:
const cluster = require(&#39;cluster&#39;);
cluster.setupMaster({
  exec: &#39;worker.js&#39;,
  args: [&#39;--use&#39;, &#39;https&#39;],
  silent: true
});
cluster.fork(); // https worker
cluster.setupMaster({
  exec: &#39;worker.js&#39;,
  args: [&#39;--use&#39;, &#39;http&#39;]
});
cluster.fork(); // http worker

This can only be called from the master process.
cluster.worker

{Object}

A reference to the current worker object. Not available in the master process.
const cluster = require(&#39;cluster&#39;);

if (cluster.isMaster) {
  console.log(&#39;I am master&#39;);
  cluster.fork();
  cluster.fork();
} else if (cluster.isWorker) {
  console.log(`I am worker #${cluster.worker.id}`);
}

cluster.workers

{Object}

A hash that stores the active worker objects, keyed by id field. Makes it
easy to loop through all the workers. It is only available in the master
process.
A worker is removed from cluster.workers after the worker has disconnected and
exited. The order between these two events cannot be determined in advance.
However, it is guaranteed that the removal from the cluster.workers list happens
before last &#39;disconnect&#39; or &#39;exit&#39; event is emitted.
// Go through all workers
function eachWorker(callback) {
  for (var id in cluster.workers) {
    callback(cluster.workers[id]);
  }
}
eachWorker((worker) =&gt; {
  worker.send(&#39;big announcement to all workers&#39;);
});

Should you wish to reference a worker over a communication channel, using
the worker&#39;s unique id is the easiest way to find the worker.
socket.on(&#39;data&#39;, (id) =&gt; {
  var worker = cluster.workers[id];
});

console.html.body:
title: console
tags: node
date: 2016-08-11 10:27:51
Console
Stability: 2 - Stable
The console module provides a simple debugging console that is similar to the
JavaScript console mechanism provided by web browsers.
The module exports two specific components:

A Console class with methods such as console.log(), console.error() and
console.warn() that can be used to write to any Node.js stream.
A global console instance configured to write to stdout and stderr.
Because this object is global, it can be used without calling
require(&#39;console&#39;).

Example using the global console:
console.log(&#39;hello world&#39;);
  // Prints: hello world, to stdout
console.log(&#39;hello %s&#39;, &#39;world&#39;);
  // Prints: hello world, to stdout
console.error(new Error(&#39;Whoops, something bad happened&#39;));
  // Prints: [Error: Whoops, something bad happened], to stderr

const name = &#39;Will Robinson&#39;;
console.warn(`Danger ${name}! Danger!`);
  // Prints: Danger Will Robinson! Danger!, to stderr

Example using the Console class:
const out = getStreamSomehow();
const err = getStreamSomehow();
const myConsole = new console.Console(out, err);

myConsole.log(&#39;hello world&#39;);
  // Prints: hello world, to out
myConsole.log(&#39;hello %s&#39;, &#39;world&#39;);
  // Prints: hello world, to out
myConsole.error(new Error(&#39;Whoops, something bad happened&#39;));
  // Prints: [Error: Whoops, something bad happened], to err

const name = &#39;Will Robinson&#39;;
myConsole.warn(`Danger ${name}! Danger!`);
  // Prints: Danger Will Robinson! Danger!, to err

While the API for the Console class is designed fundamentally around the
browser console object, the Console in Node.js is not intended to
duplicate the browser&#39;s functionality exactly.
Asynchronous vs Synchronous Consoles
The console functions are usually asynchronous unless the destination is a file.
Disks are fast and operating systems normally employ write-back caching;
it should be a very rare occurrence indeed that a write blocks, but it
is possible.
Additionally, console functions are blocking when outputting to TTYs
(terminals) on OS X as a workaround for the OS&#39;s very small, 1kb buffer size.
This is to prevent interleaving between stdout and stderr.
Class: Console

The Console class can be used to create a simple logger with configurable
output streams and can be accessed using either require(&#39;console&#39;).Console
or console.Console:
const Console = require(&#39;console&#39;).Console;
const Console = console.Console;

new Console(stdout[, stderr])
Creates a new Console by passing one or two writable stream instances.
stdout is a writable stream to print log or info output. stderr
is used for warning or error output. If stderr isn&#39;t passed, warning and error
output will be sent to stdout.
const output = fs.createWriteStream(&#39;./stdout.log&#39;);
const errorOutput = fs.createWriteStream(&#39;./stderr.log&#39;);
// custom simple logger
const logger = new Console(output, errorOutput);
// use it like console
var count = 5;
logger.log(&#39;count: %d&#39;, count);
// in stdout.log: count 5

The global console is a special Console whose output is sent to
process.stdout and process.stderr. It is equivalent to calling:
new Console(process.stdout, process.stderr);

console.assert(value[, message][, ...])

A simple assertion test that verifies whether value is truthy. If it is not,
an AssertionError is thrown. If provided, the error message is formatted
using util.format() and used as the error message.
console.assert(true, &#39;does nothing&#39;);
  // OK
console.assert(false, &#39;Whoops %s&#39;, &#39;didn\&#39;t work&#39;);
  // AssertionError: Whoops didn&#39;t work

Note: the console.assert() method is implemented differently in Node.js
than the console.assert() method available in browsers.
Specifically, in browsers, calling console.assert() with a falsy
assertion will cause the message to be printed to the console without
interrupting execution of subsequent code. In Node.js, however, a falsy
assertion will cause an AssertionError to be thrown.
Functionality approximating that implemented by browsers can be implemented
by extending Node.js&#39; console and overriding the console.assert() method.
In the following example, a simple module is created that extends and overrides
the default behavior of console in Node.js.
&#39;use strict&#39;;

// Creates a simple extension of console with a
// new impl for assert without monkey-patching.
const myConsole = Object.setPrototypeOf({
  assert(assertion, message, ...args) {
    try {
      console.assert(assertion, message, ...args);
    } catch (err) {
      console.error(err.stack);
    }
  }
}, console);

module.exports = myConsole;

This can then be used as a direct replacement for the built in console:
const console = require(&#39;./myConsole&#39;);
console.assert(false, &#39;this message will print, but no error thrown&#39;);
console.log(&#39;this will also print&#39;);

console.dir(obj[, options])

Uses util.inspect() on obj and prints the resulting string to stdout.
This function bypasses any custom inspect() function defined on obj. An
optional options object may be passed to alter certain aspects of the
formatted string:

showHidden - if true then the object&#39;s non-enumerable and symbol
properties will be shown too. Defaults to false.

depth - tells util.inspect() how many times to recurse while
formatting the object. This is useful for inspecting large complicated objects.
Defaults to 2. To make it recurse indefinitely, pass null.

colors - if true, then the output will be styled with ANSI color codes.
Defaults to false. Colors are customizable; see
customizing util.inspect() colors.


console.error([data][, ...])

Prints to stderr with newline. Multiple arguments can be passed, with the
first used as the primary message and all additional used as substitution
values similar to printf(3) (the arguments are all passed to
util.format()).
const code = 5;
console.error(&#39;error #%d&#39;, code);
  // Prints: error #5, to stderr
console.error(&#39;error&#39;, code);
  // Prints: error 5, to stderr

If formatting elements (e.g. %d) are not found in the first string then
util.inspect() is called on each argument and the resulting string
values are concatenated. See util.format() for more information.
console.info([data][, ...])

The console.info() function is an alias for console.log().
console.log([data][, ...])

Prints to stdout with newline. Multiple arguments can be passed, with the
first used as the primary message and all additional used as substitution
values similar to printf(3) (the arguments are all passed to
util.format()).
var count = 5;
console.log(&#39;count: %d&#39;, count);
  // Prints: count: 5, to stdout
console.log(&#39;count:&#39;, count);
  // Prints: count: 5, to stdout

If formatting elements (e.g. %d) are not found in the first string then
util.inspect() is called on each argument and the resulting string
values are concatenated. See util.format() for more information.
console.time(label)

Starts a timer that can be used to compute the duration of an operation. Timers
are identified by a unique label. Use the same label when you call
console.timeEnd() to stop the timer and output the elapsed time in
milliseconds to stdout. Timer durations are accurate to the sub-millisecond.
console.timeEnd(label)

Stops a timer that was previously started by calling console.time() and
prints the result to stdout:
console.time(&#39;100-elements&#39;);
for (var i = 0; i &lt; 100; i++) {
  ;
}
console.timeEnd(&#39;100-elements&#39;);
// prints 100-elements: 225.438ms

Note: As of Node.js v6.0.0, console.timeEnd() deletes the timer to avoid
leaking it. On older versions, the timer persisted. This allowed
console.timeEnd() to be called multiple times for the same label. This
functionality was unintended and is no longer supported.
console.trace(message[, ...])

Prints to stderr the string &#39;Trace :&#39;, followed by the util.format()
formatted message and stack trace to the current position in the code.
console.trace(&#39;Show me&#39;);
  // Prints: (stack trace will vary based on where trace is called)
  //  Trace: Show me
  //    at repl:2:9
  //    at REPLServer.defaultEval (repl.js:248:27)
  //    at bound (domain.js:287:14)
  //    at REPLServer.runBound [as eval] (domain.js:300:12)
  //    at REPLServer.&lt;anonymous&gt; (repl.js:412:12)
  //    at emitOne (events.js:82:20)
  //    at REPLServer.emit (events.js:169:7)
  //    at REPLServer.Interface._onLine (readline.js:210:10)
  //    at REPLServer.Interface._line (readline.js:549:8)
  //    at REPLServer.Interface._ttyWrite (readline.js:826:14)

console.warn([data][, ...])

The console.warn() function is an alias for console.error().

crypto.html.body:
title: crypto
tags: node
date: 2016-08-11 10:27:51
Crypto
Stability: 2 - Stable
The crypto module provides cryptographic functionality that includes a set of
wrappers for OpenSSL&#39;s hash, HMAC, cipher, decipher, sign and verify functions.
Use require(&#39;crypto&#39;) to access this module.
const crypto = require(&#39;crypto&#39;);

const secret = &#39;abcdefg&#39;;
const hash = crypto.createHmac(&#39;sha256&#39;, secret)
                   .update(&#39;I love cupcakes&#39;)
                   .digest(&#39;hex&#39;);
console.log(hash);
  // Prints:
  //   c0fa1bc00531bd78ef38c628449c5102aeabd49b5dc3a2a516ea6ea959d6658e

Determining if crypto support is unavailable
It is possible for Node.js to be built without including support for the
crypto module. In such cases, calling require(&#39;crypto&#39;) will result in an
error being thrown.
var crypto;
try {
  crypto = require(&#39;crypto&#39;);
} catch (err) {
  console.log(&#39;crypto support is disabled!&#39;);
}

Class: Certificate
SPKAC is a Certificate Signing Request mechanism originally implemented by
Netscape and now specified formally as part of HTML5&#39;s keygen element.
The crypto module provides the Certificate class for working with SPKAC
data. The most common usage is handling output generated by the HTML5
&lt;keygen&gt; element. Node.js uses OpenSSL&#39;s SPKAC implementation internally.
new crypto.Certificate()
Instances of the Certificate class can be created using the new keyword
or by calling crypto.Certificate() as a function:
const crypto = require(&#39;crypto&#39;);

const cert1 = new crypto.Certificate();
const cert2 = crypto.Certificate();

certificate.exportChallenge(spkac)
The spkac data structure includes a public key and a challenge. The
certificate.exportChallenge() returns the challenge component in the
form of a Node.js Buffer. The spkac argument can be either a string
or a Buffer.
const cert = require(&#39;crypto&#39;).Certificate();
const spkac = getSpkacSomehow();
const challenge = cert.exportChallenge(spkac);
console.log(challenge.toString(&#39;utf8&#39;));
  // Prints the challenge as a UTF8 string

certificate.exportPublicKey(spkac)
The spkac data structure includes a public key and a challenge. The
certificate.exportPublicKey() returns the public key component in the
form of a Node.js Buffer. The spkac argument can be either a string
or a Buffer.
const cert = require(&#39;crypto&#39;).Certificate();
const spkac = getSpkacSomehow();
const publicKey = cert.exportPublicKey(spkac);
console.log(publicKey);
  // Prints the public key as &lt;Buffer ...&gt;

certificate.verifySpkac(spkac)
Returns true if the given spkac data structure is valid, false otherwise.
The spkac argument must be a Node.js Buffer.
const cert = require(&#39;crypto&#39;).Certificate();
const spkac = getSpkacSomehow();
console.log(cert.verifySpkac(Buffer.from(spkac)));
  // Prints true or false

Class: Cipher
Instances of the Cipher class are used to encrypt data. The class can be
used in one of two ways:

As a stream that is both readable and writable, where plain unencrypted
data is written to produce encrypted data on the readable side, or
Using the cipher.update() and cipher.final() methods to produce
the encrypted data.

The crypto.createCipher() or crypto.createCipheriv() methods are
used to create Cipher instances. Cipher objects are not to be created
directly using the new keyword.
Example: Using Cipher objects as streams:
const crypto = require(&#39;crypto&#39;);
const cipher = crypto.createCipher(&#39;aes192&#39;, &#39;a password&#39;);

var encrypted = &#39;&#39;;
cipher.on(&#39;readable&#39;, () =&gt; {
  var data = cipher.read();
  if (data)
    encrypted += data.toString(&#39;hex&#39;);
});
cipher.on(&#39;end&#39;, () =&gt; {
  console.log(encrypted);
  // Prints: ca981be48e90867604588e75d04feabb63cc007a8f8ad89b10616ed84d815504
});

cipher.write(&#39;some clear text data&#39;);
cipher.end();

Example: Using Cipher and piped streams:
const crypto = require(&#39;crypto&#39;);
const fs = require(&#39;fs&#39;);
const cipher = crypto.createCipher(&#39;aes192&#39;, &#39;a password&#39;);

const input = fs.createReadStream(&#39;test.js&#39;);
const output = fs.createWriteStream(&#39;test.enc&#39;);

input.pipe(cipher).pipe(output);

Example: Using the cipher.update() and cipher.final() methods:
const crypto = require(&#39;crypto&#39;);
const cipher = crypto.createCipher(&#39;aes192&#39;, &#39;a password&#39;);

var encrypted = cipher.update(&#39;some clear text data&#39;, &#39;utf8&#39;, &#39;hex&#39;);
encrypted += cipher.final(&#39;hex&#39;);
console.log(encrypted);
  // Prints: ca981be48e90867604588e75d04feabb63cc007a8f8ad89b10616ed84d815504

cipher.final([output_encoding])
Returns any remaining enciphered contents. If output_encoding
parameter is one of &#39;latin1&#39;, &#39;base64&#39; or &#39;hex&#39;, a string is returned.
If an output_encoding is not provided, a Buffer is returned.
Once the cipher.final() method has been called, the Cipher object can no
longer be used to encrypt data. Attempts to call cipher.final() more than
once will result in an error being thrown.
cipher.setAAD(buffer)
When using an authenticated encryption mode (only GCM is currently
supported), the cipher.setAAD() method sets the value used for the
additional authenticated data (AAD) input parameter.
cipher.getAuthTag()
When using an authenticated encryption mode (only GCM is currently
supported), the cipher.getAuthTag() method returns a Buffer containing
the authentication tag that has been computed from the given data.
The cipher.getAuthTag() method should only be called after encryption has
been completed using the cipher.final() method.
cipher.setAutoPadding(auto_padding=true)
When using block encryption algorithms, the Cipher class will automatically
add padding to the input data to the appropriate block size. To disable the
default padding call cipher.setAutoPadding(false).
When auto_padding is false, the length of the entire input data must be a
multiple of the cipher&#39;s block size or cipher.final() will throw an Error.
Disabling automatic padding is useful for non-standard padding, for instance
using 0x0 instead of PKCS padding.
The cipher.setAutoPadding() method must be called before cipher.final().
cipher.update(data[, input_encoding][, output_encoding])
Updates the cipher with data. If the input_encoding argument is given,
it&#39;s value must be one of &#39;utf8&#39;, &#39;ascii&#39;, or &#39;latin1&#39; and the data
argument is a string using the specified encoding. If the input_encoding
argument is not given, data must be a Buffer. If data is a
Buffer then input_encoding is ignored.
The output_encoding specifies the output format of the enciphered
data, and can be &#39;latin1&#39;, &#39;base64&#39; or &#39;hex&#39;. If the output_encoding
is specified, a string using the specified encoding is returned. If no
output_encoding is provided, a Buffer is returned.
The cipher.update() method can be called multiple times with new data until
cipher.final() is called. Calling cipher.update() after
cipher.final() will result in an error being thrown.
Class: Decipher
Instances of the Decipher class are used to decrypt data. The class can be
used in one of two ways:

As a stream that is both readable and writable, where plain encrypted
data is written to produce unencrypted data on the readable side, or
Using the decipher.update() and decipher.final() methods to
produce the unencrypted data.

The crypto.createDecipher() or crypto.createDecipheriv() methods are
used to create Decipher instances. Decipher objects are not to be created
directly using the new keyword.
Example: Using Decipher objects as streams:
const crypto = require(&#39;crypto&#39;);
const decipher = crypto.createDecipher(&#39;aes192&#39;, &#39;a password&#39;);

var decrypted = &#39;&#39;;
decipher.on(&#39;readable&#39;, () =&gt; {
  var data = decipher.read();
  if (data)
    decrypted += data.toString(&#39;utf8&#39;);
});
decipher.on(&#39;end&#39;, () =&gt; {
  console.log(decrypted);
  // Prints: some clear text data
});

