crypto.createDiffieHellman(prime[, prime_encoding][, generator][, generator_encoding])
Creates a DiffieHellman key exchange object using the supplied prime and an
optional specific generator.
The generator argument can be a number, string, or Buffer. If
generator is not specified, the value 2 is used.
The prime_encoding and generator_encoding arguments can be &#39;latin1&#39;,
&#39;hex&#39;, or &#39;base64&#39;.
If prime_encoding is specified, prime is expected to be a string; otherwise
a Buffer is expected.
If generator_encoding is specified, generator is expected to be a string;
otherwise either a number or Buffer is expected.
crypto.createDiffieHellman(prime_length[, generator])
Creates a DiffieHellman key exchange object and generates a prime of
prime_length bits using an optional specific numeric generator.
If generator is not specified, the value 2 is used.
crypto.createECDH(curve_name)
Creates an Elliptic Curve Diffie-Hellman (ECDH) key exchange object using a
predefined curve specified by the curve_name string. Use
crypto.getCurves() to obtain a list of available curve names. On recent
OpenSSL releases, openssl ecparam -list_curves will also display the name
and description of each available elliptic curve.
crypto.createHash(algorithm)
Creates and returns a Hash object that can be used to generate hash digests
using the given algorithm.
The algorithm is dependent on the available algorithms supported by the
version of OpenSSL on the platform. Examples are &#39;sha256&#39;, &#39;sha512&#39;, etc.
On recent releases of OpenSSL, openssl list-message-digest-algorithms will
display the available digest algorithms.
Example: generating the sha256 sum of a file
const filename = process.argv[2];
const crypto = require(&#39;crypto&#39;);
const fs = require(&#39;fs&#39;);

const hash = crypto.createHash(&#39;sha256&#39;);

const input = fs.createReadStream(filename);
input.on(&#39;readable&#39;, () =&gt; {
  var data = input.read();
  if (data)
    hash.update(data);
  else {
    console.log(`${hash.digest(&#39;hex&#39;)} ${filename}`);
  }
});

crypto.createHmac(algorithm, key)
Creates and returns an Hmac object that uses the given algorithm and key.
The algorithm is dependent on the available algorithms supported by the
version of OpenSSL on the platform. Examples are &#39;sha256&#39;, &#39;sha512&#39;, etc.
On recent releases of OpenSSL, openssl list-message-digest-algorithms will
display the available digest algorithms.
The key is the HMAC key used to generate the cryptographic HMAC hash.
Example: generating the sha256 HMAC of a file
const filename = process.argv[2];
const crypto = require(&#39;crypto&#39;);
const fs = require(&#39;fs&#39;);

const hmac = crypto.createHmac(&#39;sha256&#39;, &#39;a secret&#39;);

const input = fs.createReadStream(filename);
input.on(&#39;readable&#39;, () =&gt; {
  var data = input.read();
  if (data)
    hmac.update(data);
  else {
    console.log(`${hmac.digest(&#39;hex&#39;)} ${filename}`);
  }
});

crypto.createSign(algorithm)
Creates and returns a Sign object that uses the given algorithm. On
recent OpenSSL releases, openssl list-public-key-algorithms will
display the available signing algorithms. One example is &#39;RSA-SHA256&#39;.
crypto.createVerify(algorithm)
Creates and returns a Verify object that uses the given algorithm. On
recent OpenSSL releases, openssl list-public-key-algorithms will
display the available signing algorithms. One example is &#39;RSA-SHA256&#39;.
crypto.getCiphers()
Returns an array with the names of the supported cipher algorithms.
Example:
const ciphers = crypto.getCiphers();
console.log(ciphers); // [&#39;aes-128-cbc&#39;, &#39;aes-128-ccm&#39;, ...]

crypto.getCurves()
Returns an array with the names of the supported elliptic curves.
Example:
const curves = crypto.getCurves();
console.log(curves); // [&#39;secp256k1&#39;, &#39;secp384r1&#39;, ...]

crypto.getDiffieHellman(group_name)
Creates a predefined DiffieHellman key exchange object. The
supported groups are: &#39;modp1&#39;, &#39;modp2&#39;, &#39;modp5&#39; (defined in
RFC 2412, but see Caveats) and &#39;modp14&#39;, &#39;modp15&#39;,
&#39;modp16&#39;, &#39;modp17&#39;, &#39;modp18&#39; (defined in RFC 3526). The
returned object mimics the interface of objects created by
crypto.createDiffieHellman(), but will not allow changing
the keys (with diffieHellman.setPublicKey() for example). The
advantage of using this method is that the parties do not have to
generate nor exchange a group modulus beforehand, saving both processor
and communication time.
Example (obtaining a shared secret):
const crypto = require(&#39;crypto&#39;);
const alice = crypto.getDiffieHellman(&#39;modp14&#39;);
const bob = crypto.getDiffieHellman(&#39;modp14&#39;);

alice.generateKeys();
bob.generateKeys();

const alice_secret = alice.computeSecret(bob.getPublicKey(), null, &#39;hex&#39;);
const bob_secret = bob.computeSecret(alice.getPublicKey(), null, &#39;hex&#39;);

/* alice_secret and bob_secret should be the same */
console.log(alice_secret == bob_secret);

crypto.getHashes()
Returns an array with the names of the supported hash algorithms.
Example:
const hashes = crypto.getHashes();
console.log(hashes); // [&#39;sha&#39;, &#39;sha1&#39;, &#39;sha1WithRSAEncryption&#39;, ...]

crypto.pbkdf2(password, salt, iterations, keylen, digest, callback)
Provides an asynchronous Password-Based Key Derivation Function 2 (PBKDF2)
implementation. A selected HMAC digest algorithm specified by digest is
applied to derive a key of the requested byte length (keylen) from the
password, salt and iterations.
The supplied callback function is called with two arguments: err and
derivedKey. If an error occurs, err will be set; otherwise err will be
null. The successfully generated derivedKey will be passed as a Buffer.
The iterations argument must be a number set as high as possible. The
higher the number of iterations, the more secure the derived key will be,
but will take a longer amount of time to complete.
The salt should also be as unique as possible. It is recommended that the
salts are random and their lengths are greater than 16 bytes. See
NIST SP 800-132 for details.
Example:
const crypto = require(&#39;crypto&#39;);
crypto.pbkdf2(&#39;secret&#39;, &#39;salt&#39;, 100000, 512, &#39;sha512&#39;, (err, key) =&gt; {
  if (err) throw err;
  console.log(key.toString(&#39;hex&#39;));  // &#39;c5e478d...1469e50&#39;
});

An array of supported digest functions can be retrieved using
crypto.getHashes().
crypto.pbkdf2Sync(password, salt, iterations, keylen, digest)
Provides a synchronous Password-Based Key Derivation Function 2 (PBKDF2)
implementation. A selected HMAC digest algorithm specified by digest is
applied to derive a key of the requested byte length (keylen) from the
password, salt and iterations.
If an error occurs an Error will be thrown, otherwise the derived key will be
returned as a Buffer.
The iterations argument must be a number set as high as possible. The
higher the number of iterations, the more secure the derived key will be,
but will take a longer amount of time to complete.
The salt should also be as unique as possible. It is recommended that the
salts are random and their lengths are greater than 16 bytes. See
NIST SP 800-132 for details.
Example:
const crypto = require(&#39;crypto&#39;);
const key = crypto.pbkdf2Sync(&#39;secret&#39;, &#39;salt&#39;, 100000, 512, &#39;sha512&#39;);
console.log(key.toString(&#39;hex&#39;));  // &#39;c5e478d...1469e50&#39;

An array of supported digest functions can be retrieved using
crypto.getHashes().
crypto.privateDecrypt(private_key, buffer)
Decrypts buffer with private_key.
private_key can be an object or a string. If private_key is a string, it is
treated as the key with no passphrase and will use RSA_PKCS1_OAEP_PADDING.
If private_key is an object, it is interpreted as a hash object with the
keys:

key : {String} - PEM encoded private key
passphrase : {String} - Optional passphrase for the private key
padding : An optional padding value, one of the following:
crypto.constants.RSA_NO_PADDING
crypto.constants.RSA_PKCS1_PADDING
crypto.constants.RSA_PKCS1_OAEP_PADDING



All paddings are defined in crypto.constants.
crypto.privateEncrypt(private_key, buffer)
Encrypts buffer with private_key.
private_key can be an object or a string. If private_key is a string, it is
treated as the key with no passphrase and will use RSA_PKCS1_PADDING.
If private_key is an object, it is interpreted as a hash object with the
keys:

key : {String} - PEM encoded private key
passphrase : {String} - Optional passphrase for the private key
padding : An optional padding value, one of the following:
crypto.constants.RSA_NO_PADDING
crypto.constants.RSA_PKCS1_PADDING
crypto.constants.RSA_PKCS1_OAEP_PADDING



All paddings are defined in crypto.constants.
crypto.publicDecrypt(public_key, buffer)
Decrypts buffer with public_key.
public_key can be an object or a string. If public_key is a string, it is
treated as the key with no passphrase and will use RSA_PKCS1_PADDING.
If public_key is an object, it is interpreted as a hash object with the
keys:

key : {String} - PEM encoded public key
passphrase : {String} - Optional passphrase for the private key
padding : An optional padding value, one of the following:
crypto.constants.RSA_NO_PADDING
crypto.constants.RSA_PKCS1_PADDING
crypto.constants.RSA_PKCS1_OAEP_PADDING



Because RSA public keys can be derived from private keys, a private key may
be passed instead of a public key.
All paddings are defined in crypto.constants.
crypto.publicEncrypt(public_key, buffer)
Encrypts buffer with public_key.
public_key can be an object or a string. If public_key is a string, it is
treated as the key with no passphrase and will use RSA_PKCS1_OAEP_PADDING.
If public_key is an object, it is interpreted as a hash object with the
keys:

key : {String} - PEM encoded public key
passphrase : {String} - Optional passphrase for the private key
padding : An optional padding value, one of the following:
crypto.constants.RSA_NO_PADDING
crypto.constants.RSA_PKCS1_PADDING
crypto.constants.RSA_PKCS1_OAEP_PADDING



Because RSA public keys can be derived from private keys, a private key may
be passed instead of a public key.
All paddings are defined in crypto.constants.
crypto.randomBytes(size[, callback])
Generates cryptographically strong pseudo-random data. The size argument
is a number indicating the number of bytes to generate.
If a callback function is provided, the bytes are generated asynchronously
and the callback function is invoked with two arguments: err and buf.
If an error occurs, err will be an Error object; otherwise it is null. The
buf argument is a Buffer containing the generated bytes.
// Asynchronous
const crypto = require(&#39;crypto&#39;);
crypto.randomBytes(256, (err, buf) =&gt; {
  if (err) throw err;
  console.log(`${buf.length} bytes of random data: ${buf.toString(&#39;hex&#39;)}`);
});

If the callback function is not provided, the random bytes are generated
synchronously and returned as a Buffer. An error will be thrown if
there is a problem generating the bytes.
// Synchronous
const buf = crypto.randomBytes(256);
console.log(
  `${buf.length} bytes of random data: ${buf.toString(&#39;hex&#39;)}`);

The crypto.randomBytes() method will block until there is sufficient entropy.
This should normally never take longer than a few milliseconds. The only time
when generating the random bytes may conceivably block for a longer period of
time is right after boot, when the whole system is still low on entropy.
crypto.setEngine(engine[, flags])
Load and set the engine for some or all OpenSSL functions (selected by flags).
engine could be either an id or a path to the engine&#39;s shared library.
The optional flags argument uses ENGINE_METHOD_ALL by default. The flags
is a bit field taking one of or a mix of the following flags (defined in
crypto.constants):

crypto.constants.ENGINE_METHOD_RSA
crypto.constants.ENGINE_METHOD_DSA
crypto.constants.ENGINE_METHOD_DH
crypto.constants.ENGINE_METHOD_RAND
crypto.constants.ENGINE_METHOD_ECDH
crypto.constants.ENGINE_METHOD_ECDSA
crypto.constants.ENGINE_METHOD_CIPHERS
crypto.constants.ENGINE_METHOD_DIGESTS
crypto.constants.ENGINE_METHOD_STORE
crypto.constants.ENGINE_METHOD_PKEY_METHS
crypto.constants.ENGINE_METHOD_PKEY_ASN1_METHS
crypto.constants.ENGINE_METHOD_ALL
crypto.constants.ENGINE_METHOD_NONE

Notes
Legacy Streams API (pre Node.js v0.10)
The Crypto module was added to Node.js before there was the concept of a
unified Stream API, and before there were Buffer objects for handling
binary data. As such, the many of the crypto defined classes have methods not
typically found on other Node.js classes that implement the streams
API (e.g. update(), final(), or digest()). Also, many methods accepted
and returned &#39;latin1&#39; encoded strings by default rather than Buffers. This
default was changed after Node.js v0.8 to use Buffer objects by default
instead.
Recent ECDH Changes
Usage of ECDH with non-dynamically generated key pairs has been simplified.
Now, ecdh.setPrivateKey() can be called with a preselected private key
and the associated public point (key) will be computed and stored in the object.
This allows code to only store and provide the private part of the EC key pair.
ecdh.setPrivateKey() now also validates that the private key is valid for
the selected curve.
The ecdh.setPublicKey() method is now deprecated as its inclusion in the
API is not useful. Either a previously stored private key should be set, which
automatically generates the associated public key, or ecdh.generateKeys()
should be called. The main drawback of using ecdh.setPublicKey() is that
it can be used to put the ECDH key pair into an inconsistent state.
Support for weak or compromised algorithms
The crypto module still supports some algorithms which are already
compromised and are not currently recommended for use. The API also allows
the use of ciphers and hashes with a small key size that are considered to be
too weak for safe use.
Users should take full responsibility for selecting the crypto
algorithm and key size according to their security requirements.
Based on the recommendations of NIST SP 800-131A:

MD5 and SHA-1 are no longer acceptable where collision resistance is
required such as digital signatures.
The key used with RSA, DSA and DH algorithms is recommended to have
at least 2048 bits and that of the curve of ECDSA and ECDH at least
224 bits, to be safe to use for several years.
The DH groups of modp1, modp2 and modp5 have a key size
smaller than 2048 bits and are not recommended.

See the reference for other recommendations and details.
Crypto Constants
The following constants exported by crypto.constants apply to various uses of 
the crypto, tls, and https modules and are generally specific to OpenSSL.
OpenSSL Options


    Constant
    Description


    SSL_OP_ALL
    Applies multiple bug workarounds within OpenSSL. See
    https://www.openssl.org/docs/manmaster/ssl/SSL_CTX_set_options.html for
    detail.


    SSL_OP_ALLOW_UNSAFE_LEGACY_RENEGOTIATION
    Allows legacy insecure renegotiation between OpenSSL and unpatched
    clients or servers. See 
    https://www.openssl.org/docs/manmaster/ssl/SSL_CTX_set_options.html.


    SSL_OP_CIPHER_SERVER_PREFERENCE
    Uses the server's preferences instead of the clients when selecting a
    cipher. See 
    https://www.openssl.org/docs/manmaster/ssl/SSL_CTX_set_options.html.


    SSL_OP_CISCO_ANYCONNECT
    Instructs OpenSSL to use Cisco's "speshul" version of DTLS_BAD_VER.


    SSL_OP_COOKIE_EXCHANGE
    Instructs OpenSSL to turn on cookie exchange.


    SSL_OP_CRYPTOPRO_TLSEXT_BUG
    Instructs OpenSSL to add server-hello extension from an early version
    of the cryptopro draft.


    SSL_OP_DONT_INSERT_EMPTY_FRAGMENTS
    Instructs OpenSSL to disable a SSL 3.0/TLS 1.0 vulnerability
    workaround added in OpenSSL 0.9.6d.


    SSL_OP_EPHEMERAL_RSA
    Instructs OpenSSL to always use the tmp_rsa key when performing RSA
    operations.


    SSL_OP_LEGACY_SERVER_CONNECT
    Allow initial connection to servers that do not support RI.


    SSL_OP_MICROSOFT_BIG_SSLV3_BUFFER



    SSL_OP_MICROSOFT_SESS_ID_BUG



    SSL_OP_MSIE_SSLV2_RSA_PADDING
    Instructs OpenSSL to disable the workaround for a man-in-the-middle
    protocol-version vulnerability in the SSL 2.0 server implementation.


    SSL_OP_NETSCAPE_CA_DN_BUG



    SSL_OP_NETSCAPE_CHALLENGE_BUG



    SSL_OP_NETSCAPE_DEMO_CIPHER_CHANGE_BUG



    SSL_OP_NETSCAPE_REUSE_CIPHER_CHANGE_BUG



    SSL_OP_NO_COMPRESSION
    Instructs OpenSSL to disable support for SSL/TLS compression.


    SSL_OP_NO_QUERY_MTU



    SSL_OP_NO_SESSION_RESUMPTION_ON_RENEGOTIATION
    Instructs OpenSSL to always start a new session when performing
    renegotiation.


    SSL_OP_NO_SSLv2
    Instructs OpenSSL to turn off SSL v2


    SSL_OP_NO_SSLv3
    Instructs OpenSSL to turn off SSL v3


    SSL_OP_NO_TICKET
    Instructs OpenSSL to disable use of RFC4507bis tickets.


    SSL_OP_NO_TLSv1
    Instructs OpenSSL to turn off TLS v1


    SSL_OP_NO_TLSv1_1
    Instructs OpenSSL to turn off TLS v1.1


    SSL_OP_NO_TLSv1_2
    Instructs OpenSSL to turn off TLS v1.2

    SSL_OP_PKCS1_CHECK_1



    SSL_OP_PKCS1_CHECK_2



    SSL_OP_SINGLE_DH_USE
    Instructs OpenSSL to always create a new key when using
    temporary/ephemeral DH parameters.


    SSL_OP_SINGLE_ECDH_USE
    Instructs OpenSSL to always create a new key when using
    temporary/ephemeral ECDH parameters.

    SSL_OP_SSLEAY_080_CLIENT_DH_BUG



    SSL_OP_SSLREF2_REUSE_CERT_TYPE_BUG



    SSL_OP_TLS_BLOCK_PADDING_BUG



    SSL_OP_TLS_D5_BUG



    SSL_OP_TLS_ROLLBACK_BUG
    Instructs OpenSSL to disable version rollback attack detection.



OpenSSL Engine Constants


    Constant
    Description


    ENGINE_METHOD_RSA
    Limit engine usage to RSA


    ENGINE_METHOD_DSA
    Limit engine usage to DSA


    ENGINE_METHOD_DH
    Limit engine usage to DH


    ENGINE_METHOD_RAND
    Limit engine usage to RAND


    ENGINE_METHOD_ECDH
    Limit engine usage to ECDH


    ENGINE_METHOD_ECDSA
    Limit engine usage to ECDSA


    ENGINE_METHOD_CIPHERS
    Limit engine usage to CIPHERS


    ENGINE_METHOD_DIGESTS
    Limit engine usage to DIGESTS


    ENGINE_METHOD_STORE
    Limit engine usage to STORE


    ENGINE_METHOD_PKEY_METHS
    Limit engine usage to PKEY_METHDS


    ENGINE_METHOD_PKEY_ASN1_METHS
    Limit engine usage to PKEY_ASN1_METHS


    ENGINE_METHOD_ALL



    ENGINE_METHOD_NONE




Other OpenSSL Constants


    Constant
    Description


    DH_CHECK_P_NOT_SAFE_PRIME



    DH_CHECK_P_NOT_PRIME



    DH_UNABLE_TO_CHECK_GENERATOR



    DH_NOT_SUITABLE_GENERATOR



    NPN_ENABLED



    ALPN_ENABLED



    RSA_PKCS1_PADDING



    RSA_SSLV23_PADDING



    RSA_NO_PADDING



    RSA_PKCS1_OAEP_PADDING



    RSA_X931_PADDING



    RSA_PKCS1_PSS_PADDING



    POINT_CONVERSION_COMPRESSED



    POINT_CONVERSION_UNCOMPRESSED



    POINT_CONVERSION_HYBRID




Node.js Crypto Constants


    Constant
    Description


    defaultCoreCipherList
    Specifies the built-in default cipher list used by Node.js.


    defaultCipherList
    Specifies the active default cipher list used by the current Node.js
    process.

domain.html.body:
title: domain
tags: node
date: 2016-08-11 10:27:51
Domain
Stability: 0 - Deprecated
This module is pending deprecation. Once a replacement API has been
finalized, this module will be fully deprecated. Most end users should
not have cause to use this module. Users who absolutely must have
the functionality that domains provide may rely on it for the time being
but should expect to have to migrate to a different solution
in the future.
Domains provide a way to handle multiple different IO operations as a
single group.  If any of the event emitters or callbacks registered to a
domain emit an &#39;error&#39; event, or throw an error, then the domain object
will be notified, rather than losing the context of the error in the
process.on(&#39;uncaughtException&#39;) handler, or causing the program to
exit immediately with an error code.
Warning: Don&#39;t Ignore Errors!

Domain error handlers are not a substitute for closing down your
process when an error occurs.
By the very nature of how throw works in JavaScript, there is almost
never any way to safely &quot;pick up where you left off&quot;, without leaking
references, or creating some other sort of undefined brittle state.
The safest way to respond to a thrown error is to shut down the
process.  Of course, in a normal web server, you might have many
connections open, and it is not reasonable to abruptly shut those down
because an error was triggered by someone else.
The better approach is to send an error response to the request that
triggered the error, while letting the others finish in their normal
time, and stop listening for new requests in that worker.
In this way, domain usage goes hand-in-hand with the cluster module,
since the master process can fork a new worker when a worker
encounters an error.  For Node.js programs that scale to multiple
machines, the terminating proxy or service registry can take note of
the failure, and react accordingly.
For example, this is not a good idea:
// XXX WARNING!  BAD IDEA!

var d = require(&#39;domain&#39;).create();
d.on(&#39;error&#39;, (er) =&gt; {
  // The error won&#39;t crash the process, but what it does is worse!
  // Though we&#39;ve prevented abrupt process restarting, we are leaking
  // resources like crazy if this ever happens.
  // This is no better than process.on(&#39;uncaughtException&#39;)!
  console.log(&#39;error, but oh well&#39;, er.message);
});
d.run(() =&gt; {
  require(&#39;http&#39;).createServer((req, res) =&gt; {
    handleRequest(req, res);
  }).listen(PORT);
});

By using the context of a domain, and the resilience of separating our
program into multiple worker processes, we can react more
appropriately, and handle errors with much greater safety.
// Much better!

const cluster = require(&#39;cluster&#39;);
const PORT = +process.env.PORT || 1337;

if (cluster.isMaster) {
  // In real life, you&#39;d probably use more than just 2 workers,
  // and perhaps not put the master and worker in the same file.
  //
  // You can also of course get a bit fancier about logging, and
  // implement whatever custom logic you need to prevent DoS
  // attacks and other bad behavior.
  //
  // See the options in the cluster documentation.
  //
  // The important thing is that the master does very little,
  // increasing our resilience to unexpected errors.

  cluster.fork();
  cluster.fork();

  cluster.on(&#39;disconnect&#39;, (worker) =&gt; {
    console.error(&#39;disconnect!&#39;);
    cluster.fork();
  });

} else {
  // the worker
  //
  // This is where we put our bugs!

  const domain = require(&#39;domain&#39;);

  // See the cluster documentation for more details about using
  // worker processes to serve requests.  How it works, caveats, etc.

  const server = require(&#39;http&#39;).createServer((req, res) =&gt; {
    var d = domain.create();
    d.on(&#39;error&#39;, (er) =&gt; {
      console.error(&#39;error&#39;, er.stack);

      // Note: we&#39;re in dangerous territory!
      // By definition, something unexpected occurred,
      // which we probably didn&#39;t want.
      // Anything can happen now!  Be very careful!

      try {
        // make sure we close down within 30 seconds
        var killtimer = setTimeout(() =&gt; {
          process.exit(1);
        }, 30000);
        // But don&#39;t keep the process open just for that!
        killtimer.unref();

        // stop taking new requests.
        server.close();

        // Let the master know we&#39;re dead.  This will trigger a
        // &#39;disconnect&#39; in the cluster master, and then it will fork
        // a new worker.
        cluster.worker.disconnect();

        // try to send an error to the request that triggered the problem
        res.statusCode = 500;
        res.setHeader(&#39;content-type&#39;, &#39;text/plain&#39;);
        res.end(&#39;Oops, there was a problem!\n&#39;);
      } catch (er2) {
        // oh well, not much we can do at this point.
        console.error(&#39;Error sending 500!&#39;, er2.stack);
      }
    });

    // Because req and res were created before this domain existed,
    // we need to explicitly add them.
    // See the explanation of implicit vs explicit binding below.
    d.add(req);
    d.add(res);

    // Now run the handler function in the domain.
    d.run(() =&gt; {
      handleRequest(req, res);
    });
  });
  server.listen(PORT);
}

// This part isn&#39;t important.  Just an example routing thing.
// You&#39;d put your fancy application logic here.
function handleRequest(req, res) {
  switch(req.url) {
    case &#39;/error&#39;:
      // We do some async stuff, and then...
      setTimeout(() =&gt; {
        // Whoops!
        flerb.bark();
      });
      break;
    default:
      res.end(&#39;ok&#39;);
  }
}

Additions to Error objects

Any time an Error object is routed through a domain, a few extra fields
are added to it.

error.domain The domain that first handled the error.
error.domainEmitter The event emitter that emitted an &#39;error&#39; event
with the error object.
error.domainBound The callback function which was bound to the
domain, and passed an error as its first argument.
error.domainThrown A boolean indicating whether the error was
thrown, emitted, or passed to a bound callback function.

Implicit Binding

If domains are in use, then all new EventEmitter objects (including
Stream objects, requests, responses, etc.) will be implicitly bound to
the active domain at the time of their creation.
Additionally, callbacks passed to lowlevel event loop requests (such as
to fs.open, or other callback-taking methods) will automatically be
bound to the active domain.  If they throw, then the domain will catch
the error.
In order to prevent excessive memory usage, Domain objects themselves
are not implicitly added as children of the active domain.  If they
were, then it would be too easy to prevent request and response objects
from being properly garbage collected.
If you want to nest Domain objects as children of a parent Domain,
then you must explicitly add them.
Implicit binding routes thrown errors and &#39;error&#39; events to the
Domain&#39;s &#39;error&#39; event, but does not register the EventEmitter on the
Domain, so domain.dispose() will not shut down the EventEmitter.
Implicit binding only takes care of thrown errors and &#39;error&#39; events.
Explicit Binding

Sometimes, the domain in use is not the one that ought to be used for a
specific event emitter.  Or, the event emitter could have been created
in the context of one domain, but ought to instead be bound to some
other domain.
For example, there could be one domain in use for an HTTP server, but
perhaps we would like to have a separate domain to use for each request.
That is possible via explicit binding.
For example:
// create a top-level domain for the server
const domain = require(&#39;domain&#39;);
const http = require(&#39;http&#39;);
const serverDomain = domain.create();

serverDomain.run(() =&gt; {
  // server is created in the scope of serverDomain
  http.createServer((req, res) =&gt; {
    // req and res are also created in the scope of serverDomain
    // however, we&#39;d prefer to have a separate domain for each request.
    // create it first thing, and add req and res to it.
    var reqd = domain.create();
    reqd.add(req);
    reqd.add(res);
    reqd.on(&#39;error&#39;, (er) =&gt; {
      console.error(&#39;Error&#39;, er, req.url);
      try {
        res.writeHead(500);
        res.end(&#39;Error occurred, sorry.&#39;);
      } catch (er) {
        console.error(&#39;Error sending 500&#39;, er, req.url);
      }
    });
  }).listen(1337);
});

domain.create()

return: {Domain}

Returns a new Domain object.
Class: Domain
The Domain class encapsulates the functionality of routing errors and
uncaught exceptions to the active Domain object.
Domain is a child class of EventEmitter.  To handle the errors that it
catches, listen to its &#39;error&#39; event.
domain.run(fn[, arg][, ...])

fn {Function}

Run the supplied function in the context of the domain, implicitly
binding all event emitters, timers, and lowlevel requests that are
created in that context. Optionally, arguments can be passed to
the function.
This is the most basic way to use a domain.
Example:
const domain = require(&#39;domain&#39;);
const fs = require(&#39;fs&#39;);
const d = domain.create();
d.on(&#39;error&#39;, (er) =&gt; {
  console.error(&#39;Caught error!&#39;, er);
});
d.run(() =&gt; {
  process.nextTick(() =&gt; {
    setTimeout(() =&gt; { // simulating some various async stuff
      fs.open(&#39;non-existent file&#39;, &#39;r&#39;, (er, fd) =&gt; {
        if (er) throw er;
        // proceed...
      });
    }, 100);
  });
});

In this example, the d.on(&#39;error&#39;) handler will be triggered, rather
than crashing the program.
domain.members

{Array}

An array of timers and event emitters that have been explicitly added
to the domain.
domain.add(emitter)

emitter {EventEmitter|Timer} emitter or timer to be added to the domain

Explicitly adds an emitter to the domain.  If any event handlers called by
the emitter throw an error, or if the emitter emits an &#39;error&#39; event, it
will be routed to the domain&#39;s &#39;error&#39; event, just like with implicit
binding.
This also works with timers that are returned from setInterval() and
setTimeout().  If their callback function throws, it will be caught by
the domain &#39;error&#39; handler.
If the Timer or EventEmitter was already bound to a domain, it is removed
from that one, and bound to this one instead.
domain.remove(emitter)

emitter {EventEmitter|Timer} emitter or timer to be removed from the domain

The opposite of domain.add(emitter).  Removes domain handling from the
specified emitter.
domain.bind(callback)

callback {Function} The callback function
return: {Function} The bound function

The returned function will be a wrapper around the supplied callback
function.  When the returned function is called, any errors that are
thrown will be routed to the domain&#39;s &#39;error&#39; event.
Example
const d = domain.create();

function readSomeFile(filename, cb) {
  fs.readFile(filename, &#39;utf8&#39;, d.bind((er, data) =&gt; {
    // if this throws, it will also be passed to the domain
    return cb(er, data ? JSON.parse(data) : null);
  }));
}

d.on(&#39;error&#39;, (er) =&gt; {
  // an error occurred somewhere.
  // if we throw it now, it will crash the program
  // with the normal line number and stack message.
});

domain.intercept(callback)

callback {Function} The callback function
return: {Function} The intercepted function

This method is almost identical to domain.bind(callback).  However, in
addition to catching thrown errors, it will also intercept Error
objects sent as the first argument to the function.
In this way, the common if (err) return callback(err); pattern can be replaced
with a single error handler in a single place.
Example
const d = domain.create();

function readSomeFile(filename, cb) {
  fs.readFile(filename, &#39;utf8&#39;, d.intercept((data) =&gt; {
    // note, the first argument is never passed to the
    // callback since it is assumed to be the &#39;Error&#39; argument
    // and thus intercepted by the domain.

    // if this throws, it will also be passed to the domain
    // so the error-handling logic can be moved to the &#39;error&#39;
    // event on the domain instead of being repeated throughout
    // the program.
    return cb(null, JSON.parse(data));
  }));
}

d.on(&#39;error&#39;, (er) =&gt; {
  // an error occurred somewhere.
  // if we throw it now, it will crash the program
  // with the normal line number and stack message.
});

domain.enter()
The enter method is plumbing used by the run, bind, and intercept
methods to set the active domain. It sets domain.active and process.domain
to the domain, and implicitly pushes the domain onto the domain stack managed
by the domain module (see domain.exit() for details on the domain stack). The
call to enter delimits the beginning of a chain of asynchronous calls and I/O
operations bound to a domain.
Calling enter changes only the active domain, and does not alter the domain
itself. enter and exit can be called an arbitrary number of times on a
single domain.
If the domain on which enter is called has been disposed, enter will return
without setting the domain.
domain.exit()
The exit method exits the current domain, popping it off the domain stack.
Any time execution is going to switch to the context of a different chain of
asynchronous calls, it&#39;s important to ensure that the current domain is exited.
The call to exit delimits either the end of or an interruption to the chain
of asynchronous calls and I/O operations bound to a domain.
If there are multiple, nested domains bound to the current execution context,
exit will exit any domains nested within this domain.
Calling exit changes only the active domain, and does not alter the domain
itself. enter and exit can be called an arbitrary number of times on a
single domain.
If the domain on which exit is called has been disposed, exit will return
without exiting the domain.
domain.dispose()
Stability: 0 - Deprecated.  Please recover from failed IO actions
explicitly via error event handlers set on the domain.
Once dispose has been called, the domain will no longer be used by callbacks
bound into the domain via run, bind, or intercept, and a &#39;dispose&#39; event
is emitted.

errors.html.body:
title: errors
tags: node
date: 2016-08-11 10:27:51
Errors

Applications running in Node.js will generally experience four categories of
errors:

Standard JavaScript errors such as:
{EvalError} : thrown when a call to eval() fails.
{SyntaxError} : thrown in response to improper JavaScript language
syntax.
{RangeError} : thrown when a value is not within an expected range
{ReferenceError} : thrown when using undefined variables
{TypeError} : thrown when passing arguments of the wrong type
{URIError} : thrown when a global URI handling function is misused.


System errors triggered by underlying operating system constraints such
as attempting to open a file that does not exist, attempting to send data
over a closed socket, etc;
And User-specified errors triggered by application code.
Assertion Errors are a special class of error that can be triggered whenever
Node.js detects an exceptional logic violation that should never occur. These
are raised typically by the assert module.

All JavaScript and System errors raised by Node.js inherit from, or are
instances of, the standard JavaScript {Error} class and are guaranteed
to provide at least the properties available on that class.
Error Propagation and Interception

Node.js supports several mechanisms for propagating and handling errors that
occur while an application is running. How these errors are reported and
handled depends entirely on the type of Error and the style of the API that is
called.
All JavaScript errors are handled as exceptions that immediately generate
and throw an error using the standard JavaScript throw mechanism. These
are handled using the try / catch construct provided by the JavaScript
language.
// Throws with a ReferenceError because z is undefined
try {
  const m = 1;
  const n = m + z;
} catch (err) {
  // Handle the error here.
}

Any use of the JavaScript throw mechanism will raise an exception that
must be handled using try / catch or the Node.js process will exit
immediately.
With few exceptions, Synchronous APIs (any blocking method that does not
accept a callback function, such as fs.readFileSync), will use throw
to report errors.
Errors that occur within Asynchronous APIs may be reported in multiple ways:

Most asynchronous methods that accept a callback function will accept an
Error object passed as the first argument to that function. If that first
argument is not null and is an instance of Error, then an error occurred
that should be handled.
const fs = require(&#39;fs&#39;);
fs.readFile(&#39;a file that does not exist&#39;, (err, data) =&gt; {
  if (err) {
    console.error(&#39;There was an error reading the file!&#39;, err);
    return;
  }
  // Otherwise handle the data
});


When an asynchronous method is called on an object that is an EventEmitter,
errors can be routed to that object&#39;s &#39;error&#39; event.
const net = require(&#39;net&#39;);
const connection = net.connect(&#39;localhost&#39;);

// Adding an &#39;error&#39; event handler to a stream:
connection.on(&#39;error&#39;, (err) =&gt; {
  // If the connection is reset by the server, or if it can&#39;t
  // connect at all, or on any sort of error encountered by
  // the connection, the error will be sent here.
  console.error(err);
});

connection.pipe(process.stdout);


A handful of typically asynchronous methods in the Node.js API may still
use the throw mechanism to raise exceptions that must be handled using
try / catch. There is no comprehensive list of such methods; please
refer to the documentation of each method to determine the appropriate
error handling mechanism required.


The use of the &#39;error&#39; event mechanism is most common for stream-based
and event emitter-based APIs, which themselves represent a series of
asynchronous operations over time (as opposed to a single operation that may
pass or fail).
For all EventEmitter objects, if an &#39;error&#39; event handler is not
provided, the error will be thrown, causing the Node.js process to report an
unhandled exception and  crash unless either: The domain module is used
appropriately or a handler has been registered for the
process.on(&#39;uncaughtException&#39;) event.
const EventEmitter = require(&#39;events&#39;);
const ee = new EventEmitter();

setImmediate(() =&gt; {
  // This will crash the process because no &#39;error&#39; event
  // handler has been added.
  ee.emit(&#39;error&#39;, new Error(&#39;This will crash&#39;));
});

Errors generated in this way cannot be intercepted using try / catch as
they are thrown after the calling code has already exited.
Developers must refer to the documentation for each method to determine
exactly how errors raised by those methods are propagated.
Node.js style callbacks

Most asynchronous methods exposed by the Node.js core API follow an idiomatic
pattern  referred to as a &quot;Node.js style callback&quot;. With this pattern, a
callback function is passed to the method as an argument. When the operation
either completes or an error is raised, the callback function is called with
the Error object (if any) passed as the first argument. If no error was raised,
the first argument will be passed as null.
const fs = require(&#39;fs&#39;);

function nodeStyleCallback(err, data) {
 if (err) {
   console.error(&#39;There was an error&#39;, err);
   return;
 }
 console.log(data);
}

fs.readFile(&#39;/some/file/that/does-not-exist&#39;, nodeStyleCallback);
fs.readFile(&#39;/some/file/that/does-exist&#39;, nodeStyleCallback)

The JavaScript try / catch mechanism cannot be used to intercept errors
generated by asynchronous APIs.  A common mistake for beginners is to try to
use throw inside a Node.js style callback:
// THIS WILL NOT WORK:
const fs = require(&#39;fs&#39;);

try {
  fs.readFile(&#39;/some/file/that/does-not-exist&#39;, (err, data) =&gt; {
    // mistaken assumption: throwing here...
    if (err) {
      throw err;
    }
  });
} catch(err) {
  // This will not catch the throw!
  console.log(err);
}

This will not work because the callback function passed to fs.readFile() is
called asynchronously. By the time the callback has been called, the
surrounding code (including the try { } catch(err) { } block will have
already exited. Throwing an error inside the callback can crash the Node.js
process in most cases. If domains are enabled, or a handler has been
registered with process.on(&#39;uncaughtException&#39;), such errors can be
intercepted.
Class: Error

A generic JavaScript Error object that does not denote any specific
circumstance of why the error occurred. Error objects capture a &quot;stack trace&quot;
detailing the point in the code at which the Error was instantiated, and may
provide a text description of the error.
All errors generated by Node.js, including all System and JavaScript errors,
will either be instances of, or inherit from, the Error class.
new Error(message)
Creates a new Error object and sets the error.message property to the
provided text message. If an object is passed as message, the text message
is generated by calling message.toString(). The error.stack property will
represent the point in the code at which new Error() was called. Stack traces
are dependent on V8&#39;s stack trace API. Stack traces extend only to either
(a) the beginning of  synchronous code execution, or (b) the number of frames
given by the property Error.stackTraceLimit, whichever is smaller.
Error.captureStackTrace(targetObject[, constructorOpt])
Creates a .stack property on targetObject, which when accessed returns
a string representing the location in the code at which
Error.captureStackTrace() was called.
const myObject = {};
Error.captureStackTrace(myObject);
myObject.stack  // similar to `new Error().stack`

The first line of the trace, instead of being prefixed with ErrorType:
message, will be the result of calling targetObject.toString().
The optional constructorOpt argument accepts a function. If given, all frames
above constructorOpt, including constructorOpt, will be omitted from the
generated stack trace.
The constructorOpt argument is useful for hiding implementation
details of error generation from an end user. For instance:
function MyError() {
  Error.captureStackTrace(this, MyError);
}

// Without passing MyError to captureStackTrace, the MyError
// frame would show up in the .stack property. By passing
// the constructor, we omit that frame and all frames above it.
new MyError().stack

Error.stackTraceLimit
The Error.stackTraceLimit property specifies the number of stack frames
collected by a stack trace (whether generated by new Error().stack or
Error.captureStackTrace(obj)).
The default value is 10 but may be set to any valid JavaScript number. Changes
will affect any stack trace captured after the value has been changed.
If set to a non-number value, or set to a negative number, stack traces will
not capture any frames.
error.message
Returns the string description of error as set by calling new Error(message).
The message passed to the constructor will also appear in the first line of
the stack trace of the Error, however changing this property after the
Error object is created may not change the first line of the stack trace.
const err = new Error(&#39;The message&#39;);
console.log(err.message);
  // Prints: The message

error.stack
Returns a string describing the point in the code at which the Error was
instantiated.
For example:
Error: Things keep happening!
   at /home/gbusey/file.js:525:2
   at Frobnicator.refrobulate (/home/gbusey/business-logic.js:424:21)
   at Actor.&lt;anonymous&gt; (/home/gbusey/actors.js:400:8)
   at increaseSynergy (/home/gbusey/actors.js:701:6)

The first line is formatted as &lt;error class name&gt;: &lt;error message&gt;, and
is followed by a series of stack frames (each line beginning with &quot;at &quot;).
Each frame describes a call site within the code that lead to the error being
generated. V8 attempts to display a name for each function (by variable name,
function name, or object method name), but occasionally it will not be able to
find a suitable name. If V8 cannot determine a name for the function, only
location information will be displayed for that frame. Otherwise, the
determined function name will be displayed with location information appended
in parentheses.
It is important to note that frames are only generated for JavaScript
functions. If, for example, execution synchronously passes through a C++ addon
function called cheetahify, which itself calls a JavaScript function, the
frame representing the cheetahify call will not be present in the stack
traces:
const cheetahify = require(&#39;./native-binding.node&#39;);

function makeFaster() {
  // cheetahify *synchronously* calls speedy.
  cheetahify(function speedy() {
    throw new Error(&#39;oh no!&#39;);
  });
}

makeFaster(); // will throw:
  // /home/gbusey/file.js:6
  //     throw new Error(&#39;oh no!&#39;);
  //           ^
  // Error: oh no!
  //     at speedy (/home/gbusey/file.js:6:11)
  //     at makeFaster (/home/gbusey/file.js:5:3)
  //     at Object.&lt;anonymous&gt; (/home/gbusey/file.js:10:1)
  //     at Module._compile (module.js:456:26)
  //     at Object.Module._extensions..js (module.js:474:10)
  //     at Module.load (module.js:356:32)
  //     at Function.Module._load (module.js:312:12)
  //     at Function.Module.runMain (module.js:497:10)
  //     at startup (node.js:119:16)
  //     at node.js:906:3

The location information will be one of:

native, if the frame represents a call internal to V8 (as in [].forEach).
plain-filename.js:line:column, if the frame represents a call internal
 to Node.js.
/absolute/path/to/file.js:line:column, if the frame represents a call in
a user program, or its dependencies.

The string representing the stack trace is lazily generated when the
error.stack property is accessed.
The number of frames captured by the stack trace is bounded by the smaller of
Error.stackTraceLimit or the number of available frames on the current event
loop tick.
System-level errors are generated as augmented Error instances, which are
detailed here.
Class: RangeError
A subclass of Error that indicates that a provided argument was not within the
set or range of acceptable values for a function; whether that is a numeric
range, or outside the set of options for a given function parameter.
For example:
require(&#39;net&#39;).connect(-1);
  // throws RangeError, port should be &gt; 0 &amp;&amp; &lt; 65536

Node.js will generate and throw RangeError instances immediately as a form
of argument validation.
Class: ReferenceError
A subclass of Error that indicates that an attempt is being made to access a
variable that is not defined. Such errors commonly indicate typos in code, or
an otherwise broken program.
While client code may generate and propagate these errors, in practice, only V8
will do so.
doesNotExist;
  // throws ReferenceError, doesNotExist is not a variable in this program.

ReferenceError instances will have an error.arguments property whose value
is an array containing a single element: a string representing the variable
that was not defined.
const assert = require(&#39;assert&#39;);
try {
  doesNotExist;
} catch(err) {
  assert(err.arguments[0], &#39;doesNotExist&#39;);
}

Unless an application is dynamically generating and running code,
ReferenceError instances should always be considered a bug in the code
or its dependencies.
Class: SyntaxError
A subclass of Error that indicates that a program is not valid JavaScript.
These errors may only be generated and propagated as a result of code
evaluation. Code evaluation may happen as a result of eval, Function,
require, or vm. These errors are almost always indicative of a broken
program.
try {
  require(&#39;vm&#39;).runInThisContext(&#39;binary ! isNotOk&#39;);
} catch(err) {
  // err will be a SyntaxError
}

SyntaxError instances are unrecoverable in the context that created them –
they may only be caught by other contexts.
Class: TypeError
A subclass of Error that indicates that a provided argument is not an
allowable type. For example, passing a function to a parameter which expects a
string would be considered a TypeError.
require(&#39;url&#39;).parse(() =&gt; { });
  // throws TypeError, since it expected a string

Node.js will generate and throw TypeError instances immediately as a form
of argument validation.
Exceptions vs. Errors

A JavaScript exception is a value that is thrown as a result of an invalid
operation or as the target of a throw statement. While it is not required
that these values are instances of Error or classes which inherit from
Error, all exceptions thrown by Node.js or the JavaScript runtime will be
instances of Error.
Some exceptions are unrecoverable at the JavaScript layer. Such exceptions
will always cause the Node.js process to crash. Examples include assert()
checks or abort() calls in the C++ layer.
System Errors
System errors are generated when exceptions occur within the program&#39;s
runtime environment. Typically, these are operational errors that occur
when an application violates an operating system constraint such as attempting
to read a file that does not exist or when the user does not have sufficient
permissions.
System errors are typically generated at the syscall level: an exhaustive list
of error codes and their meanings is available by running man 2 intro or
man 3 errno on most Unices; or online.
In Node.js, system errors are represented as augmented Error objects with
added properties.
Class: System Error
error.code
error.errno
Returns a string representing the error code, which is always E followed by
a sequence of capital letters, and may be referenced in man 2 intro.
The properties error.code and error.errno are aliases of one another and
return the same value.
error.syscall
Returns a string describing the syscall that failed.
Common System Errors
This list is not exhaustive, but enumerates many of the common system
errors encountered when writing a Node.js program. An exhaustive list may be
found here.

EACCES (Permission denied): An attempt was made to access a file in a way
forbidden by its file access permissions.

EADDRINUSE (Address already in use):  An attempt to bind a server
(net, http, or https) to a local address failed due to
another server on the local system already occupying that address.

ECONNREFUSED (Connection refused): No connection could be made because the
target machine actively refused it. This usually results from trying to
connect to a service that is inactive on the foreign host.

ECONNRESET (Connection reset by peer): A connection was forcibly closed by
a peer. This normally results from a loss of the connection on the remote
socket due to a timeout or reboot. Commonly encountered via the http
and net modules.

EEXIST (File exists): An existing file was the target of an operation that
required that the target not exist.

EISDIR (Is a directory): An operation expected a file, but the given
pathname was a directory.

EMFILE (Too many open files in system): Maximum number of
file descriptors allowable on the system has been reached, and
requests for another descriptor cannot be fulfilled until at least one
has been closed. This is encountered when opening many files at once in
parallel, especially on systems (in particular, OS X) where there is a low
file descriptor limit for processes. To remedy a low limit, run
ulimit -n 2048 in the same shell that will run the Node.js process.

ENOENT (No such file or directory): Commonly raised by fs operations
to indicate that a component of the specified pathname does not exist -- no
entity (file or directory) could be found by the given path.

ENOTDIR (Not a directory): A component of the given pathname existed, but
was not a directory as expected. Commonly raised by fs.readdir.

ENOTEMPTY (Directory not empty): A directory with entries was the target
of an operation that requires an empty directory -- usually fs.unlink.

EPERM (Operation not permitted): An attempt was made to perform an
operation that requires elevated privileges.

EPIPE (Broken pipe): A write on a pipe, socket, or FIFO for which there is
no process to read the data. Commonly encountered at the net and
http layers, indicative that the remote side of the stream being
written to has been closed.

ETIMEDOUT (Operation timed out): A connect or send request failed because
the connected party did not properly respond after a period of time. Usually
encountered by http or net -- often a sign that a socket.end()
was not properly called.

events.html.body:
title: events
tags: node
date: 2016-08-11 10:27:51
Events
Stability: 2 - Stable

Much of the Node.js core API is built around an idiomatic asynchronous
event-driven architecture in which certain kinds of objects (called &quot;emitters&quot;)
periodically emit named events that cause Function objects (&quot;listeners&quot;) to be
called.
For instance: a net.Server object emits an event each time a peer
connects to it; a fs.ReadStream emits an event when the file is opened;
a stream emits an event whenever data is available to be read.
All objects that emit events are instances of the EventEmitter class. These
objects expose an eventEmitter.on() function that allows one or more
functions to be attached to named events emitted by the object. Typically,
event names are camel-cased strings but any valid JavaScript property key
can be used.
When the EventEmitter object emits an event, all of the functions attached
to that specific event are called synchronously. Any values returned by the
called listeners are ignored and will be discarded.
The following example shows a simple EventEmitter instance with a single
listener. The eventEmitter.on() method is used to register listeners, while
the eventEmitter.emit() method is used to trigger the event.
const EventEmitter = require(&#39;events&#39;);

class MyEmitter extends EventEmitter {}

const myEmitter = new MyEmitter();
myEmitter.on(&#39;event&#39;, () =&gt; {
  console.log(&#39;an event occurred!&#39;);
});
myEmitter.emit(&#39;event&#39;);

Passing arguments and this to listeners
The eventEmitter.emit() method allows an arbitrary set of arguments to be
passed to the listener functions. It is important to keep in mind that when an
ordinary listener function is called by the EventEmitter, the standard this
keyword is intentionally set to reference the EventEmitter to which the
listener is attached.
const myEmitter = new MyEmitter();
myEmitter.on(&#39;event&#39;, function(a, b) {
  console.log(a, b, this);
    // Prints:
    //   a b MyEmitter {
    //     domain: null,
    //     _events: { event: [Function] },
    //     _eventsCount: 1,
    //     _maxListeners: undefined }
});
myEmitter.emit(&#39;event&#39;, &#39;a&#39;, &#39;b&#39;);

It is possible to use ES6 Arrow Functions as listeners, however, when doing so,
the this keyword will no longer reference the EventEmitter instance:
const myEmitter = new MyEmitter();
myEmitter.on(&#39;event&#39;, (a, b) =&gt; {
  console.log(a, b, this);
    // Prints: a b {}
});
myEmitter.emit(&#39;event&#39;, &#39;a&#39;, &#39;b&#39;);

Asynchronous vs. Synchronous
The EventListener calls all listeners synchronously in the order in which
they were registered. This is important to ensure the proper sequencing of
events and to avoid race conditions or logic errors. When appropriate,
listener functions can switch to an asynchronous mode of operation using
the setImmediate() or process.nextTick() methods:
const myEmitter = new MyEmitter();
myEmitter.on(&#39;event&#39;, (a, b) =&gt; {
  setImmediate(() =&gt; {
    console.log(&#39;this happens asynchronously&#39;);
  });
});
myEmitter.emit(&#39;event&#39;, &#39;a&#39;, &#39;b&#39;);

Handling events only once
When a listener is registered using the eventEmitter.on() method, that
listener will be invoked every time the named event is emitted.
const myEmitter = new MyEmitter();
var m = 0;
myEmitter.on(&#39;event&#39;, () =&gt; {
  console.log(++m);
});
myEmitter.emit(&#39;event&#39;);
  // Prints: 1
myEmitter.emit(&#39;event&#39;);
  // Prints: 2

Using the eventEmitter.once() method, it is possible to register a listener
that is called at most once for a particular event. Once the event is emitted,
the listener is unregistered and then called.
const myEmitter = new MyEmitter();
var m = 0;
myEmitter.once(&#39;event&#39;, () =&gt; {
  console.log(++m);
});
myEmitter.emit(&#39;event&#39;);
  // Prints: 1
myEmitter.emit(&#39;event&#39;);
  // Ignored

Error events
When an error occurs within an EventEmitter instance, the typical action is
for an &#39;error&#39; event to be emitted. These are treated as special cases
within Node.js.
If an EventEmitter does not have at least one listener registered for the
&#39;error&#39; event, and an &#39;error&#39; event is emitted, the error is thrown, a
stack trace is printed, and the Node.js process exits.
const myEmitter = new MyEmitter();
myEmitter.emit(&#39;error&#39;, new Error(&#39;whoops!&#39;));
  // Throws and crashes Node.js

To guard against crashing the Node.js process, a listener can be registered
on the process object&#39;s uncaughtException event or the domain module
can be used. (Note, however, that the domain module has been deprecated)
const myEmitter = new MyEmitter();

process.on(&#39;uncaughtException&#39;, (err) =&gt; {
  console.log(&#39;whoops! there was an error&#39;);
});

myEmitter.emit(&#39;error&#39;, new Error(&#39;whoops!&#39;));
  // Prints: whoops! there was an error

As a best practice, listeners should always be added for the &#39;error&#39; events.
const myEmitter = new MyEmitter();
myEmitter.on(&#39;error&#39;, (err) =&gt; {
  console.log(&#39;whoops! there was an error&#39;);
});
myEmitter.emit(&#39;error&#39;, new Error(&#39;whoops!&#39;));
  // Prints: whoops! there was an error

Class: EventEmitter
The EventEmitter class is defined and exposed by the events module:
const EventEmitter = require(&#39;events&#39;);

All EventEmitters emit the event &#39;newListener&#39; when new listeners are
added and &#39;removeListener&#39; when existing listeners are removed.
Event: &#39;newListener&#39;

eventName {String|Symbol} The name of the event being listened for
listener {Function} The event handler function

The EventEmitter instance will emit its own &#39;newListener&#39; event before
a listener is added to its internal array of listeners.
Listeners registered for the &#39;newListener&#39; event will be passed the event
name and a reference to the listener being added.
The fact that the event is triggered before adding the listener has a subtle
but important side effect: any additional listeners registered to the same
name within the &#39;newListener&#39; callback will be inserted before the
listener that is in the process of being added.
const myEmitter = new MyEmitter();
// Only do this once so we don&#39;t loop forever
myEmitter.once(&#39;newListener&#39;, (event, listener) =&gt; {
  if (event === &#39;event&#39;) {
    // Insert a new listener in front
    myEmitter.on(&#39;event&#39;, () =&gt; {
      console.log(&#39;B&#39;);
    });
  }
});
myEmitter.on(&#39;event&#39;, () =&gt; {
  console.log(&#39;A&#39;);
});
myEmitter.emit(&#39;event&#39;);
  // Prints:
  //   B
  //   A

Event: &#39;removeListener&#39;

eventName {String|Symbol} The event name
listener {Function} The event handler function

The &#39;removeListener&#39; event is emitted after the listener is removed.
EventEmitter.listenerCount(emitter, eventName)
Stability: 0 - Deprecated: Use [`emitter.listenerCount()`][] instead.
A class method that returns the number of listeners for the given eventName
registered on the given emitter.
const myEmitter = new MyEmitter();
myEmitter.on(&#39;event&#39;, () =&gt; {});
myEmitter.on(&#39;event&#39;, () =&gt; {});
console.log(EventEmitter.listenerCount(myEmitter, &#39;event&#39;));
  // Prints: 2

EventEmitter.defaultMaxListeners
By default, a maximum of 10 listeners can be registered for any single
event. This limit can be changed for individual EventEmitter instances
using the emitter.setMaxListeners(n) method. To change the default
for all EventEmitter instances, the EventEmitter.defaultMaxListeners
property can be used.
Take caution when setting the EventEmitter.defaultMaxListeners because the
change effects all EventEmitter instances, including those created before
the change is made. However, calling emitter.setMaxListeners(n) still has
precedence over EventEmitter.defaultMaxListeners.
Note that this is not a hard limit. The EventEmitter instance will allow
more listeners to be added but will output a trace warning to stderr indicating
that a &quot;possible EventEmitter memory leak&quot; has been detected. For any single
EventEmitter, the emitter.getMaxListeners() and emitter.setMaxListeners()
methods can be used to temporarily avoid this warning:
emitter.setMaxListeners(emitter.getMaxListeners() + 1);
emitter.once(&#39;event&#39;, () =&gt; {
  // do stuff
  emitter.setMaxListeners(Math.max(emitter.getMaxListeners() - 1, 0));
});

emitter.addListener(eventName, listener)
Alias for emitter.on(eventName, listener).
emitter.emit(eventName[, arg1][, arg2][, ...])
Synchronously calls each of the listeners registered for the event named
eventName, in the order they were registered, passing the supplied arguments
to each.
Returns true if the event had listeners, false otherwise.
emitter.eventNames()
Returns an array listing the events for which the emitter has registered
listeners. The values in the array will be strings or Symbols.
const EventEmitter = require(&#39;events&#39;);
const myEE = new EventEmitter();
myEE.on(&#39;foo&#39;, () =&gt; {});
myEE.on(&#39;bar&#39;, () =&gt; {});

const sym = Symbol(&#39;symbol&#39;);
myEE.on(sym, () =&gt; {});

console.log(myEE.eventNames());
  // Prints [ &#39;foo&#39;, &#39;bar&#39;, Symbol(symbol) ]

emitter.getMaxListeners()
Returns the current max listener value for the EventEmitter which is either
set by emitter.setMaxListeners(n) or defaults to
EventEmitter.defaultMaxListeners.
emitter.listenerCount(eventName)

eventName {String|Symbol} The name of the event being listened for

Returns the number of listeners listening to the event named eventName.
emitter.listeners(eventName)
Returns a copy of the array of listeners for the event named eventName.
server.on(&#39;connection&#39;, (stream) =&gt; {
  console.log(&#39;someone connected!&#39;);
});
console.log(util.inspect(server.listeners(&#39;connection&#39;)));
  // Prints: [ [Function] ]

emitter.on(eventName, listener)

eventName {String|Symbol} The name of the event.
listener {Function} The callback function

Adds the listener function to the end of the listeners array for the
event named eventName. No checks are made to see if the listener has
already been added. Multiple calls passing the same combination of eventName
and listener will result in the listener being added, and called, multiple
times.
server.on(&#39;connection&#39;, (stream) =&gt; {
  console.log(&#39;someone connected!&#39;);
});

Returns a reference to the EventEmitter, so that calls can be chained.
By default, event listeners are invoked in the order they are added. The
emitter.prependListener() method can be used as an alternative to add the
event listener to the beginning of the listeners array.
const myEE = new EventEmitter();
myEE.on(&#39;foo&#39;, () =&gt; console.log(&#39;a&#39;));
myEE.prependListener(&#39;foo&#39;, () =&gt; console.log(&#39;b&#39;));
myEE.emit(&#39;foo&#39;);
  // Prints:
  //   b
  //   a

emitter.once(eventName, listener)

eventName {String|Symbol} The name of the event.
listener {Function} The callback function

Adds a one time listener function for the event named eventName. The
next time eventName is triggered, this listener is removed and then invoked.
server.once(&#39;connection&#39;, (stream) =&gt; {
  console.log(&#39;Ah, we have our first user!&#39;);
});

Returns a reference to the EventEmitter, so that calls can be chained.
By default, event listeners are invoked in the order they are added. The
emitter.prependOnceListener() method can be used as an alternative to add the
event listener to the beginning of the listeners array.
const myEE = new EventEmitter();
myEE.once(&#39;foo&#39;, () =&gt; console.log(&#39;a&#39;));
myEE.prependOnceListener(&#39;foo&#39;, () =&gt; console.log(&#39;b&#39;));
myEE.emit(&#39;foo&#39;);
  // Prints:
  //   b
  //   a

emitter.prependListener(eventName, listener)

eventName {String|Symbol} The name of the event.
listener {Function} The callback function

Adds the listener function to the beginning of the listeners array for the
event named eventName. No checks are made to see if the listener has
already been added. Multiple calls passing the same combination of eventName
and listener will result in the listener being added, and called, multiple
times.
server.prependListener(&#39;connection&#39;, (stream) =&gt; {
  console.log(&#39;someone connected!&#39;);
});

Returns a reference to the EventEmitter, so that calls can be chained.
emitter.prependOnceListener(eventName, listener)

eventName {String|Symbol} The name of the event.
listener {Function} The callback function

Adds a one time listener function for the event named eventName to the
beginning of the listeners array. The next time eventName is triggered, this
listener is removed, and then invoked.
server.prependOnceListener(&#39;connection&#39;, (stream) =&gt; {
  console.log(&#39;Ah, we have our first user!&#39;);
});

Returns a reference to the EventEmitter, so that calls can be chained.
emitter.removeAllListeners([eventName])
Removes all listeners, or those of the specified eventName.
Note that it is bad practice to remove listeners added elsewhere in the code,
particularly when the EventEmitter instance was created by some other
component or module (e.g. sockets or file streams).
Returns a reference to the EventEmitter, so that calls can be chained.
emitter.removeListener(eventName, listener)
Removes the specified listener from the listener array for the event named
eventName.
var callback = (stream) =&gt; {
  console.log(&#39;someone connected!&#39;);
};
server.on(&#39;connection&#39;, callback);
// ...
server.removeListener(&#39;connection&#39;, callback);

removeListener will remove, at most, one instance of a listener from the
listener array. If any single listener has been added multiple times to the
listener array for the specified eventName, then removeListener must be
called multiple times to remove each instance.
Note that once an event has been emitted, all listeners attached to it at the
time of emitting will be called in order. This implies that any removeListener()
or removeAllListeners() calls after emitting and before the last listener
finishes execution will not remove them from emit() in progress. Subsequent
events will behave as expected.
const myEmitter = new MyEmitter();

var callbackA = () =&gt; {
  console.log(&#39;A&#39;);
  myEmitter.removeListener(&#39;event&#39;, callbackB);
};

var callbackB = () =&gt; {
  console.log(&#39;B&#39;);
};

myEmitter.on(&#39;event&#39;, callbackA);

myEmitter.on(&#39;event&#39;, callbackB);

// callbackA removes listener callbackB but it will still be called.
// Internal listener array at time of emit [callbackA, callbackB]
myEmitter.emit(&#39;event&#39;);
  // Prints:
  //   A
  //   B

// callbackB is now removed.
// Internal listener array [callbackA]
myEmitter.emit(&#39;event&#39;);
  // Prints:
  //   A

Because listeners are managed using an internal array, calling this will
change the position indices of any listener registered after the listener
being removed. This will not impact the order in which listeners are called,
but it means that any copies of the listener array as returned by
the emitter.listeners() method will need to be recreated.
Returns a reference to the EventEmitter, so that calls can be chained.
emitter.setMaxListeners(n)
By default EventEmitters will print a warning if more than 10 listeners are
added for a particular event. This is a useful default that helps finding
memory leaks. Obviously, not all events should be limited to just 10 listeners.
The emitter.setMaxListeners() method allows the limit to be modified for this
specific EventEmitter instance. The value can be set to Infinity (or 0)
to indicate an unlimited number of listeners.
Returns a reference to the EventEmitter, so that calls can be chained.

fs.html.body:
title: fs
tags: node
date: 2016-08-11 10:27:51
File System
Stability: 2 - Stable

File I/O is provided by simple wrappers around standard POSIX functions.  To
use this module do require(&#39;fs&#39;). All the methods have asynchronous and
synchronous forms.
The asynchronous form always takes a completion callback as its last argument.
The arguments passed to the completion callback depend on the method, but the
first argument is always reserved for an exception. If the operation was
completed successfully, then the first argument will be null or undefined.
When using the synchronous form any exceptions are immediately thrown.
You can use try/catch to handle exceptions or allow them to bubble up.
Here is an example of the asynchronous version:
const fs = require(&#39;fs&#39;);

fs.unlink(&#39;/tmp/hello&#39;, (err) =&gt; {
  if (err) throw err;
  console.log(&#39;successfully deleted /tmp/hello&#39;);
});

Here is the synchronous version:
const fs = require(&#39;fs&#39;);

fs.unlinkSync(&#39;/tmp/hello&#39;);
console.log(&#39;successfully deleted /tmp/hello&#39;);

With the asynchronous methods there is no guaranteed ordering. So the
following is prone to error:
fs.rename(&#39;/tmp/hello&#39;, &#39;/tmp/world&#39;, (err) =&gt; {
  if (err) throw err;
  console.log(&#39;renamed complete&#39;);
});
fs.stat(&#39;/tmp/world&#39;, (err, stats) =&gt; {
  if (err) throw err;
  console.log(`stats: ${JSON.stringify(stats)}`);
});

It could be that fs.stat is executed before fs.rename.
The correct way to do this is to chain the callbacks.
fs.rename(&#39;/tmp/hello&#39;, &#39;/tmp/world&#39;, (err) =&gt; {
  if (err) throw err;
  fs.stat(&#39;/tmp/world&#39;, (err, stats) =&gt; {
    if (err) throw err;
    console.log(`stats: ${JSON.stringify(stats)}`);
  });
});

In busy processes, the programmer is strongly encouraged to use the
asynchronous versions of these calls. The synchronous versions will block
the entire process until they complete--halting all connections.
The relative path to a filename can be used. Remember, however, that this path
will be relative to process.cwd().
Most fs functions let you omit the callback argument. If you do, a default
callback is used that rethrows errors. To get a trace to the original call
site, set the NODE_DEBUG environment variable:
$ cat script.js
function bad() {
  require(&#39;fs&#39;).readFile(&#39;/&#39;);
}
bad();

$ env NODE_DEBUG=fs node script.js
fs.js:88
        throw backtrace;
        ^
Error: EISDIR: illegal operation on a directory, read
    &lt;stack trace.&gt;

Buffer API

fs functions support passing and receiving paths as both strings
and Buffers. The latter is intended to make it possible to work with
filesystems that allow for non-UTF-8 filenames. For most typical
uses, working with paths as Buffers will be unnecessary, as the string
API converts to and from UTF-8 automatically.
Note that on certain file systems (such as NTFS and HFS+) filenames
will always be encoded as UTF-8. On such file systems, passing
non-UTF-8 encoded Buffers to fs functions will not work as expected.
Class: fs.FSWatcher

Objects returned from fs.watch() are of this type.
The listener callback provided to fs.watch() receives the returned FSWatcher&#39;s
change events.
The object itself emits these events:
Event: &#39;change&#39;


eventType {String} The type of fs change
filename {String | Buffer} The filename that changed (if relevant/available)

Emitted when something changes in a watched directory or file.
See more details in fs.watch().
The filename argument may not be provided depending on operating system
support. If filename is provided, it will be provided as a Buffer if
fs.watch() is called with it&#39;s encoding option set to &#39;buffer&#39;, otherwise
filename will be a string.
// Example when handled through fs.watch listener
fs.watch(&#39;./tmp&#39;, {encoding: &#39;buffer&#39;}, (eventType, filename) =&gt; {
  if (filename)
    console.log(filename);
    // Prints: &lt;Buffer ...&gt;
});

Event: &#39;error&#39;


error {Error}

Emitted when an error occurs.
watcher.close()

Stop watching for changes on the given fs.FSWatcher.
Class: fs.ReadStream

ReadStream is a Readable Stream.
Event: &#39;open&#39;


fd {Integer} Integer file descriptor used by the ReadStream.

Emitted when the ReadStream&#39;s file is opened.
Event: &#39;close&#39;

Emitted when the ReadStream&#39;s underlying file descriptor has been closed
using the fs.close() method.
readStream.path

The path to the file the stream is reading from as specified in the first
argument to fs.createReadStream(). If path is passed as a string, then
readStream.path will be a string. If path is passed as a Buffer, then
readStream.path will be a Buffer.
Class: fs.Stats

Objects returned from fs.stat(), fs.lstat() and fs.fstat() and their
synchronous counterparts are of this type.

stats.isFile()
stats.isDirectory()
stats.isBlockDevice()
stats.isCharacterDevice()
stats.isSymbolicLink() (only valid with fs.lstat())
stats.isFIFO()
stats.isSocket()

For a regular file util.inspect(stats) would return a string very
similar to this:
{
  dev: 2114,
  ino: 48064969,
  mode: 33188,
  nlink: 1,
  uid: 85,
  gid: 100,
  rdev: 0,
  size: 527,
  blksize: 4096,
  blocks: 8,
  atime: Mon, 10 Oct 2011 23:24:11 GMT,
  mtime: Mon, 10 Oct 2011 23:24:11 GMT,
  ctime: Mon, 10 Oct 2011 23:24:11 GMT,
  birthtime: Mon, 10 Oct 2011 23:24:11 GMT
}

Please note that atime, mtime, birthtime, and ctime are
instances of Date object and to compare the values of
these objects you should use appropriate methods. For most general
uses getTime() will return the number of
milliseconds elapsed since 1 January 1970 00:00:00 UTC and this
integer should be sufficient for any comparison, however there are
additional methods which can be used for displaying fuzzy information.
More details can be found in the MDN JavaScript Reference
page.
Stat Time Values
The times in the stat object have the following semantics:

atime &quot;Access Time&quot; - Time when file data last accessed.  Changed
by the mknod(2), utimes(2), and read(2) system calls.
mtime &quot;Modified Time&quot; - Time when file data last modified.
Changed by the mknod(2), utimes(2), and write(2) system calls.
ctime &quot;Change Time&quot; - Time when file status was last changed
(inode data modification).  Changed by the chmod(2), chown(2),
link(2), mknod(2), rename(2), unlink(2), utimes(2),
read(2), and write(2) system calls.
birthtime &quot;Birth Time&quot; -  Time of file creation. Set once when the
file is created.  On filesystems where birthtime is not available,
this field may instead hold either the ctime or
1970-01-01T00:00Z (ie, unix epoch timestamp 0). Note that this
value may be greater than atime or mtime in this case. On Darwin
and other FreeBSD variants, also set if the atime is explicitly
set to an earlier value than the current birthtime using the
utimes(2) system call.

Prior to Node v0.12, the ctime held the birthtime on Windows
systems.  Note that as of v0.12, ctime is not &quot;creation time&quot;, and
on Unix systems, it never was.
Class: fs.WriteStream

WriteStream is a Writable Stream.
Event: &#39;open&#39;


fd {Integer} Integer file descriptor used by the WriteStream.

Emitted when the WriteStream&#39;s file is opened.
Event: &#39;close&#39;

Emitted when the WriteStream&#39;s underlying file descriptor has been closed
using the fs.close() method.
writeStream.bytesWritten

The number of bytes written so far. Does not include data that is still queued
for writing.
writeStream.path

The path to the file the stream is writing to as specified in the first
argument to fs.createWriteStream(). If path is passed as a string, then
writeStream.path will be a string. If path is passed as a Buffer, then
writeStream.path will be a Buffer.
fs.access(path[, mode], callback)


path {String | Buffer}
mode {Integer}
callback {Function}

Tests a user&#39;s permissions for the file or directory specified by path.
The mode argument is an optional integer that specifies the accessibility
checks to be performed. The following constants define the possible values of
mode. It is possible to create a mask consisting of the bitwise OR of two or
more values.

fs.constants.F_OK - path is visible to the calling process. This is useful
for determining if a file exists, but says nothing about rwx permissions.
Default if no mode is specified.
fs.constants.R_OK - path can be read by the calling process.
fs.constants.W_OK - path can be written by the calling process.
fs.constants.X_OK - path can be executed by the calling process. This has
no effect on Windows (will behave like fs.constants.F_OK).

The final argument, callback, is a callback function that is invoked with
a possible error argument. If any of the accessibility checks fail, the error
argument will be populated. The following example checks if the file
/etc/passwd can be read and written by the current process.
fs.access(&#39;/etc/passwd&#39;, fs.constants.R_OK | fs.constants.W_OK, (err) =&gt; {
  console.log(err ? &#39;no access!&#39; : &#39;can read/write&#39;);
});

fs.accessSync(path[, mode])


path {String | Buffer}
mode {Integer}

Synchronous version of fs.access(). This throws if any accessibility
checks fail, and does nothing otherwise.
fs.appendFile(file, data[, options], callback)


file {String | Buffer | Number} filename or file descriptor
data {String | Buffer}
options {Object | String}
encoding {String | Null} default = &#39;utf8&#39;
mode {Integer} default = 0o666
flag {String} default = &#39;a&#39;


callback {Function}

Asynchronously append data to a file, creating the file if it does not yet exist.
data can be a string or a buffer.
Example:
fs.appendFile(&#39;message.txt&#39;, &#39;data to append&#39;, (err) =&gt; {
  if (err) throw err;
  console.log(&#39;The &quot;data to append&quot; was appended to file!&#39;);
});

If options is a string, then it specifies the encoding. Example:
fs.appendFile(&#39;message.txt&#39;, &#39;data to append&#39;, &#39;utf8&#39;, callback);

Any specified file descriptor has to have been opened for appending.
Note: Specified file descriptors will not be closed automatically.
fs.appendFileSync(file, data[, options])


file {String | Buffer | Number} filename or file descriptor
data {String | Buffer}
options {Object | String}
encoding {String | Null} default = &#39;utf8&#39;
mode {Integer} default = 0o666
flag {String} default = &#39;a&#39;



The synchronous version of fs.appendFile(). Returns undefined.
fs.chmod(path, mode, callback)


path {String | Buffer}
mode {Integer}
callback {Function}

Asynchronous chmod(2). No arguments other than a possible exception are given
to the completion callback.
fs.chmodSync(path, mode)


path {String | Buffer}
mode {Integer}

Synchronous chmod(2). Returns undefined.
fs.chown(path, uid, gid, callback)


path {String | Buffer}
uid {Integer}
gid {Integer}
callback {Function}

Asynchronous chown(2). No arguments other than a possible exception are given
to the completion callback.
fs.chownSync(path, uid, gid)


path {String | Buffer}
uid {Integer}
gid {Integer}

Synchronous chown(2). Returns undefined.
fs.close(fd, callback)


fd {Integer}
callback {Function}

Asynchronous close(2).  No arguments other than a possible exception are given
to the completion callback.
fs.closeSync(fd)


fd {Integer}

Synchronous close(2). Returns undefined.
fs.constants
Returns an object containing commonly used constants for file system
operations. The specific constants currently defined are described in
FS Constants.
fs.createReadStream(path[, options])


path {String | Buffer}
options {String | Object}
flags {String}
encoding {String}
fd {Integer}
mode {Integer}
autoClose {Boolean}
start {Integer}
end {Integer}



Returns a new ReadStream object. (See Readable Stream).
Be aware that, unlike the default value set for highWaterMark on a
readable stream (16 kb), the stream returned by this method has a
default value of 64 kb for the same parameter.
options is an object or string with the following defaults:
{
  flags: &#39;r&#39;,
  encoding: null,
  fd: null,
  mode: 0o666,
  autoClose: true
}

options can include start and end values to read a range of bytes from
the file instead of the entire file.  Both start and end are inclusive and
start at 0. The encoding can be any one of those accepted by Buffer.
If fd is specified, ReadStream will ignore the path argument and will use
the specified file descriptor. This means that no &#39;open&#39; event will be
emitted. Note that fd should be blocking; non-blocking fds should be passed
to net.Socket.
If autoClose is false, then the file descriptor won&#39;t be closed, even if
there&#39;s an error.  It is your responsibility to close it and make sure
there&#39;s no file descriptor leak.  If autoClose is set to true (default
behavior), on error or end the file descriptor will be closed
automatically.
mode sets the file mode (permission and sticky bits), but only if the
file was created.
An example to read the last 10 bytes of a file which is 100 bytes long:
fs.createReadStream(&#39;sample.txt&#39;, {start: 90, end: 99});

If options is a string, then it specifies the encoding.
fs.createWriteStream(path[, options])


path {String | Buffer}
options {String | Object}
flags {String}
defaultEncoding {String}
fd {Integer}
mode {Integer}
autoClose {Boolean}
start {Integer}



Returns a new WriteStream object. (See Writable Stream).
options is an object or string with the following defaults:
{
  flags: &#39;w&#39;,
  defaultEncoding: &#39;utf8&#39;,
  fd: null,
  mode: 0o666,
  autoClose: true
}

options may also include a start option to allow writing data at
some position past the beginning of the file.  Modifying a file rather
than replacing it may require a flags mode of r+ rather than the
default mode w. The defaultEncoding can be any one of those accepted by
Buffer.
If autoClose is set to true (default behavior) on error or end
the file descriptor will be closed automatically. If autoClose is false,
then the file descriptor won&#39;t be closed, even if there&#39;s an error.
It is your responsibility to close it and make sure
there&#39;s no file descriptor leak.
Like ReadStream, if fd is specified, WriteStream will ignore the
