    R_OK
    Flag indicating that the file can be read by the calling process.


    W_OK
    Flag indicating that the file can be written by the calling
    process.


    X_OK
    Flag indicating that the file can be executed by the calling
    process.



File Open Constants
The following constants are meant for use with fs.open().


    Constant
    Description


    O_RDONLY
    Flag indicating to open a file for read-only access.


    O_WRONLY
    Flag indicating to open a file for write-only access.


    O_RDWR
    Flag indicating to open a file for read-write access.


    O_CREAT
    Flag indicating to create the file if it does not already exist.


    O_EXCL
    Flag indicating that opening a file should fail if the
    O_CREAT flag is set and the file already exists.


    O_NOCTTY
    Flag indicating that if path identifies a terminal device, opening the
    path shall not cause that terminal to become the controlling terminal for
    the process (if the process does not already have one).


    O_TRUNC
    Flag indicating that if the file exists and is a regular file, and the
    file is opened successfully for write access, its length shall be truncated
    to zero.


    O_APPEND
    Flag indicating that data will be appended to the end of the file.


    O_DIRECTORY
    Flag indicating that the open should fail if the path is not a
    directory.


  O_NOATIME
    Flag indicating reading accesses to the file system will no longer
    result in an update to the `atime` information associated with the file.
    This flag is available on Linux operating systems only.


    O_NOFOLLOW
    Flag indicating that the open should fail if the path is a symbolic
    link.


    O_SYNC
    Flag indicating that the file is opened for synchronous I/O.


    O_SYMLINK
    Flag indicating to open the symbolic link itself rather than the
    resource it is pointing to.


    O_DIRECT
    When set, an attempt will be made to minimize caching effects of file
    I/O.


    O_NONBLOCK
    Flag indicating to open the file in nonblocking mode when possible.



File Type Constants
The following constants are meant for use with the fs.Stats object&#39;s
mode property for determining a file&#39;s type.


    Constant
    Description


    S_IFMT
    Bit mask used to extract the file type code.


    S_IFREG
    File type constant for a regular file.


    S_IFDIR
    File type constant for a directory.


    S_IFCHR
    File type constant for a character-oriented device file.


    S_IFBLK
    File type constant for a block-oriented device file.


    S_IFIFO
    File type constant for a FIFO/pipe.


    S_IFLNK
    File type constant for a symbolic link.


    S_IFSOCK
    File type constant for a socket.



File Mode Constants
The following constants are meant for use with the fs.Stats object&#39;s
mode property for determining the access permissions for a file.


    Constant
    Description


    S_IRWXU
    File mode indicating readable, writable and executable by owner.


    S_IRUSR
    File mode indicating readable by owner.


    S_IWUSR
    File mode indicating writable by owner.


    S_IXUSR
    File mode indicating executable by owner.


    S_IRWXG
    File mode indicating readable, writable and executable by group.


    S_IRGRP
    File mode indicating readable by group.


    S_IWGRP
    File mode indicating writable by group.


    S_IXGRP
    File mode indicating executable by group.


    S_IRWXO
    File mode indicating readable, writable and executable by others.


    S_IROTH
    File mode indicating readable by others.


    S_IWOTH
    File mode indicating writable by others.


    S_IXOTH
    File mode indicating executable by others.

http.html.body:
title: http
tags: node
date: 2016-08-11 10:27:51
HTTP
Stability: 2 - Stable
To use the HTTP server and client one must require(&#39;http&#39;).
The HTTP interfaces in Node.js are designed to support many features
of the protocol which have been traditionally difficult to use.
In particular, large, possibly chunk-encoded, messages. The interface is
careful to never buffer entire requests or responses--the
user is able to stream data.
HTTP message headers are represented by an object like this:
{ &#39;content-length&#39;: &#39;123&#39;,
  &#39;content-type&#39;: &#39;text/plain&#39;,
  &#39;connection&#39;: &#39;keep-alive&#39;,
  &#39;host&#39;: &#39;mysite.com&#39;,
  &#39;accept&#39;: &#39;*/*&#39; }

Keys are lowercased. Values are not modified.
In order to support the full spectrum of possible HTTP applications, Node.js&#39;s
HTTP API is very low-level. It deals with stream handling and message
parsing only. It parses a message into headers and body but it does not
parse the actual headers or the body.
See message.headers for details on how duplicate headers are handled.
The raw headers as they were received are retained in the rawHeaders
property, which is an array of [key, value, key2, value2, ...].  For
example, the previous message header object might have a rawHeaders
list like the following:
[ &#39;ConTent-Length&#39;, &#39;123456&#39;,
  &#39;content-LENGTH&#39;, &#39;123&#39;,
  &#39;content-type&#39;, &#39;text/plain&#39;,
  &#39;CONNECTION&#39;, &#39;keep-alive&#39;,
  &#39;Host&#39;, &#39;mysite.com&#39;,
  &#39;accepT&#39;, &#39;*/*&#39; ]

Class: http.Agent

The HTTP Agent is used for pooling sockets used in HTTP client
requests.
The HTTP Agent also defaults client requests to using
Connection:keep-alive. If no pending HTTP requests are waiting on a
socket to become free the socket is closed. This means that Node.js&#39;s
pool has the benefit of keep-alive when under load but still does not
require developers to manually close the HTTP clients using
KeepAlive.
If you opt into using HTTP KeepAlive, you can create an Agent object
with that flag set to true.  (See the constructor options.)
Then, the Agent will keep unused sockets in a pool for later use.  They
will be explicitly marked so as to not keep the Node.js process running.
However, it is still a good idea to explicitly destroy() KeepAlive
agents when they are no longer in use, so that the Sockets will be shut
down.
Sockets are removed from the agent&#39;s pool when the socket emits either
a &#39;close&#39; event or a special &#39;agentRemove&#39; event. This means that if
you intend to keep one HTTP request open for a long time and don&#39;t
want it to stay in the pool you can do something along the lines of:
http.get(options, (res) =&gt; {
  // Do stuff
}).on(&#39;socket&#39;, (socket) =&gt; {
  socket.emit(&#39;agentRemove&#39;);
});

Alternatively, you could just opt out of pooling entirely using
agent:false:
http.get({
  hostname: &#39;localhost&#39;,
  port: 80,
  path: &#39;/&#39;,
  agent: false  // create a new agent just for this one request
}, (res) =&gt; {
  // Do stuff with response
});

new Agent([options])


options {Object} Set of configurable options to set on the agent.
Can have the following fields:
keepAlive {Boolean} Keep sockets around in a pool to be used by
other requests in the future. Default = false
keepAliveMsecs {Integer} When using HTTP KeepAlive, how often
to send TCP KeepAlive packets over sockets being kept alive.
Default = 1000.  Only relevant if keepAlive is set to true.
maxSockets {Number} Maximum number of sockets to allow per
host.  Default = Infinity.
maxFreeSockets {Number} Maximum number of sockets to leave open
in a free state.  Only relevant if keepAlive is set to true.
Default = 256.



The default http.globalAgent that is used by http.request() has all
of these values set to their respective defaults.
To configure any of them, you must create your own http.Agent object.
const http = require(&#39;http&#39;);
var keepAliveAgent = new http.Agent({ keepAlive: true });
options.agent = keepAliveAgent;
http.request(options, onResponseCallback);

agent.createConnection(options[, callback])

Produces a socket/stream to be used for HTTP requests.
By default, this function is the same as net.createConnection(). However,
custom Agents may override this method in case greater flexibility is desired.
A socket/stream can be supplied in one of two ways: by returning the
socket/stream from this function, or by passing the socket/stream to callback.
callback has a signature of (err, stream).
agent.destroy()

Destroy any sockets that are currently in use by the agent.
It is usually not necessary to do this.  However, if you are using an
agent with KeepAlive enabled, then it is best to explicitly shut down
the agent when you know that it will no longer be used.  Otherwise,
sockets may hang open for quite a long time before the server
terminates them.
agent.freeSockets

An object which contains arrays of sockets currently awaiting use by
the Agent when HTTP KeepAlive is used.  Do not modify.
agent.getName(options)

Get a unique name for a set of request options, to determine whether a
connection can be reused.  In the http agent, this returns
host:port:localAddress.  In the https agent, the name includes the
CA, cert, ciphers, and other HTTPS/TLS-specific options that determine
socket reusability.
Options:

host: A domain name or IP address of the server to issue the request to.
port: Port of remote server.
localAddress: Local interface to bind for network connections when issuing
the request.

agent.maxFreeSockets

By default set to 256.  For Agents supporting HTTP KeepAlive, this
sets the maximum number of sockets that will be left open in the free
state.
agent.maxSockets

By default set to Infinity. Determines how many concurrent sockets the agent
can have open per origin. Origin is either a &#39;host:port&#39; or
&#39;host:port:localAddress&#39; combination.
agent.requests

An object which contains queues of requests that have not yet been assigned to
sockets. Do not modify.
agent.sockets

An object which contains arrays of sockets currently in use by the
Agent.  Do not modify.
Class: http.ClientRequest

This object is created internally and returned from http.request().  It
represents an in-progress request whose header has already been queued.  The
header is still mutable using the setHeader(name, value), getHeader(name),
removeHeader(name) API.  The actual header will be sent along with the first
data chunk or when closing the connection.
To get the response, add a listener for &#39;response&#39; to the request object.
&#39;response&#39; will be emitted from the request object when the response
headers have been received.  The &#39;response&#39; event is executed with one
argument which is an instance of http.IncomingMessage.
During the &#39;response&#39; event, one can add listeners to the
response object; particularly to listen for the &#39;data&#39; event.
If no &#39;response&#39; handler is added, then the response will be
entirely discarded.  However, if you add a &#39;response&#39; event handler,
then you must consume the data from the response object, either by
calling response.read() whenever there is a &#39;readable&#39; event, or
by adding a &#39;data&#39; handler, or by calling the .resume() method.
Until the data is consumed, the &#39;end&#39; event will not fire.  Also, until
the data is read it will consume memory that can eventually lead to a
&#39;process out of memory&#39; error.
Note: Node.js does not check whether Content-Length and the length of the body
which has been transmitted are equal or not.
The request implements the Writable Stream interface. This is an
EventEmitter with the following events:
Event: &#39;abort&#39;

function () { }
Emitted when the request has been aborted by the client. This event is only
emitted on the first call to abort().
Event: &#39;aborted&#39;

function () { }
Emitted when the request has been aborted by the server and the network
socket has closed.
Event: &#39;checkExpectation&#39;

function (request, response) { }
Emitted each time a request with an http Expect header is received, where the
value is not 100-continue. If this event isn&#39;t listened for, the server will
automatically respond with a 417 Expectation Failed as appropriate.
Note that when this event is emitted and handled, the request event will
not be emitted.
Event: &#39;connect&#39;

function (response, socket, head) { }
Emitted each time a server responds to a request with a CONNECT method. If this
event isn&#39;t being listened for, clients receiving a CONNECT method will have
their connections closed.
A client server pair that show you how to listen for the &#39;connect&#39; event.
const http = require(&#39;http&#39;);
const net = require(&#39;net&#39;);
const url = require(&#39;url&#39;);

// Create an HTTP tunneling proxy
var proxy = http.createServer( (req, res) =&gt; {
  res.writeHead(200, {&#39;Content-Type&#39;: &#39;text/plain&#39;});
  res.end(&#39;okay&#39;);
});
proxy.on(&#39;connect&#39;, (req, cltSocket, head) =&gt; {
  // connect to an origin server
  var srvUrl = url.parse(`http://${req.url}`);
  var srvSocket = net.connect(srvUrl.port, srvUrl.hostname, () =&gt; {
    cltSocket.write(&#39;HTTP/1.1 200 Connection Established\r\n&#39; +
                    &#39;Proxy-agent: Node.js-Proxy\r\n&#39; +
                    &#39;\r\n&#39;);
    srvSocket.write(head);
    srvSocket.pipe(cltSocket);
    cltSocket.pipe(srvSocket);
  });
});

// now that proxy is running
proxy.listen(1337, &#39;127.0.0.1&#39;, () =&gt; {

  // make a request to a tunneling proxy
  var options = {
    port: 1337,
    hostname: &#39;127.0.0.1&#39;,
    method: &#39;CONNECT&#39;,
    path: &#39;www.google.com:80&#39;
  };

  var req = http.request(options);
  req.end();

  req.on(&#39;connect&#39;, (res, socket, head) =&gt; {
    console.log(&#39;got connected!&#39;);

    // make a request over an HTTP tunnel
    socket.write(&#39;GET / HTTP/1.1\r\n&#39; +
                 &#39;Host: www.google.com:80\r\n&#39; +
                 &#39;Connection: close\r\n&#39; +
                 &#39;\r\n&#39;);
    socket.on(&#39;data&#39;, (chunk) =&gt; {
      console.log(chunk.toString());
    });
    socket.on(&#39;end&#39;, () =&gt; {
      proxy.close();
    });
  });
});

Event: &#39;continue&#39;

function () { }
Emitted when the server sends a &#39;100 Continue&#39; HTTP response, usually because
the request contained &#39;Expect: 100-continue&#39;. This is an instruction that
the client should send the request body.
Event: &#39;response&#39;

function (response) { }
Emitted when a response is received to this request. This event is emitted only
once. The response argument will be an instance of http.IncomingMessage.
Event: &#39;socket&#39;

function (socket) { }
Emitted after a socket is assigned to this request.
Event: &#39;upgrade&#39;

function (response, socket, head) { }
Emitted each time a server responds to a request with an upgrade. If this
event isn&#39;t being listened for, clients receiving an upgrade header will have
their connections closed.
A client server pair that show you how to listen for the &#39;upgrade&#39; event.
const http = require(&#39;http&#39;);

// Create an HTTP server
var srv = http.createServer( (req, res) =&gt; {
  res.writeHead(200, {&#39;Content-Type&#39;: &#39;text/plain&#39;});
  res.end(&#39;okay&#39;);
});
srv.on(&#39;upgrade&#39;, (req, socket, head) =&gt; {
  socket.write(&#39;HTTP/1.1 101 Web Socket Protocol Handshake\r\n&#39; +
               &#39;Upgrade: WebSocket\r\n&#39; +
               &#39;Connection: Upgrade\r\n&#39; +
               &#39;\r\n&#39;);

  socket.pipe(socket); // echo back
});

// now that server is running
srv.listen(1337, &#39;127.0.0.1&#39;, () =&gt; {

  // make a request
  var options = {
    port: 1337,
    hostname: &#39;127.0.0.1&#39;,
    headers: {
      &#39;Connection&#39;: &#39;Upgrade&#39;,
      &#39;Upgrade&#39;: &#39;websocket&#39;
    }
  };

  var req = http.request(options);
  req.end();

  req.on(&#39;upgrade&#39;, (res, socket, upgradeHead) =&gt; {
    console.log(&#39;got upgraded!&#39;);
    socket.end();
    process.exit(0);
  });
});

request.abort()

Marks the request as aborting. Calling this will cause remaining data
in the response to be dropped and the socket to be destroyed.
request.end([data][, encoding][, callback])

Finishes sending the request. If any parts of the body are
unsent, it will flush them to the stream. If the request is
chunked, this will send the terminating &#39;0\r\n\r\n&#39;.
If data is specified, it is equivalent to calling
response.write(data, encoding) followed by request.end(callback).
If callback is specified, it will be called when the request stream
is finished.
request.flushHeaders()

Flush the request headers.
For efficiency reasons, Node.js normally buffers the request headers until you
call request.end() or write the first chunk of request data.  It then tries
hard to pack the request headers and data into a single TCP packet.
That&#39;s usually what you want (it saves a TCP round-trip) but not when the first
data isn&#39;t sent until possibly much later.  request.flushHeaders() lets you bypass
the optimization and kickstart the request.
request.setNoDelay([noDelay])

Once a socket is assigned to this request and is connected
socket.setNoDelay() will be called.
request.setSocketKeepAlive([enable][, initialDelay])

Once a socket is assigned to this request and is connected
socket.setKeepAlive() will be called.
request.setTimeout(timeout[, callback])

Once a socket is assigned to this request and is connected
socket.setTimeout() will be called.

timeout {Number} Milliseconds before a request is considered to be timed out.
callback {Function} Optional function to be called when a timeout occurs. Same as binding to the timeout event.

request.write(chunk[, encoding][, callback])

Sends a chunk of the body.  By calling this method
many times, the user can stream a request body to a
server--in that case it is suggested to use the
[&#39;Transfer-Encoding&#39;, &#39;chunked&#39;] header line when
creating the request.
The chunk argument should be a Buffer or a string.
The encoding argument is optional and only applies when chunk is a string.
Defaults to &#39;utf8&#39;.
The callback argument is optional and will be called when this chunk of data
is flushed.
Returns request.
Class: http.Server

This class inherits from net.Server and has the following additional events:
Event: &#39;checkContinue&#39;

function (request, response) { }
Emitted each time a request with an http Expect: 100-continue is received.
If this event isn&#39;t listened for, the server will automatically respond
with a 100 Continue as appropriate.
Handling this event involves calling response.writeContinue() if the client
should continue to send the request body, or generating an appropriate HTTP
response (e.g., 400 Bad Request) if the client should not continue to send the
request body.
Note that when this event is emitted and handled, the &#39;request&#39; event will
not be emitted.
Event: &#39;clientError&#39;

function (exception, socket) { }
If a client connection emits an &#39;error&#39; event, it will be forwarded here.
Listener of this event is responsible for closing/destroying the underlying
socket. For example, one may wish to more gracefully close the socket with an
HTTP &#39;400 Bad Request&#39; response instead of abruptly severing the connection.
Default behavior is to destroy the socket immediately on malformed request.
socket is the net.Socket object that the error originated from.
const http = require(&#39;http&#39;);

const server = http.createServer((req, res) =&gt; {
  res.end();
});
server.on(&#39;clientError&#39;, (err, socket) =&gt; {
  socket.end(&#39;HTTP/1.1 400 Bad Request\r\n\r\n&#39;);
});
server.listen(8000);

When the &#39;clientError&#39; event occurs, there is no request or response
object, so any HTTP response sent, including response headers and payload,
must be written directly to the socket object. Care must be taken to
ensure the response is a properly formatted HTTP response message.
Event: &#39;close&#39;

function () { }
Emitted when the server closes.
Event: &#39;connect&#39;

function (request, socket, head) { }
Emitted each time a client requests a http CONNECT method. If this event isn&#39;t
listened for, then clients requesting a CONNECT method will have their
connections closed.

request is the arguments for the http request, as it is in the request
event.
socket is the network socket between the server and client.
head is an instance of Buffer, the first packet of the tunneling stream,
this may be empty.

After this event is emitted, the request&#39;s socket will not have a &#39;data&#39;
event listener, meaning you will need to bind to it in order to handle data
sent to the server on that socket.
Event: &#39;connection&#39;

function (socket) { }
When a new TCP stream is established. socket is an object of type
net.Socket. Usually users will not want to access this event. In
particular, the socket will not emit &#39;readable&#39; events because of how
the protocol parser attaches to the socket. The socket can also be
accessed at request.connection.
Event: &#39;request&#39;

function (request, response) { }
Emitted each time there is a request. Note that there may be multiple requests
per connection (in the case of keep-alive connections).
 request is an instance of http.IncomingMessage and response is
an instance of http.ServerResponse.
Event: &#39;upgrade&#39;

function (request, socket, head) { }
Emitted each time a client requests a http upgrade. If this event isn&#39;t
listened for, then clients requesting an upgrade will have their connections
closed.

request is the arguments for the http request, as it is in the request
event.
socket is the network socket between the server and client.
head is an instance of Buffer, the first packet of the upgraded stream,
this may be empty.

After this event is emitted, the request&#39;s socket will not have a &#39;data&#39;
event listener, meaning you will need to bind to it in order to handle data
sent to the server on that socket.
server.close([callback])

Stops the server from accepting new connections.  See net.Server.close().
server.listen(handle[, callback])


handle {Object}
callback {Function}

The handle object can be set to either a server or socket (anything
with an underlying _handle member), or a {fd: &lt;n&gt;} object.
This will cause the server to accept connections on the specified
handle, but it is presumed that the file descriptor or handle has
already been bound to a port or domain socket.
Listening on a file descriptor is not supported on Windows.
This function is asynchronous. callback will be added as a listener for the
&#39;listening&#39; event. See also net.Server.listen().
Returns server.
server.listen(path[, callback])

Start a UNIX socket server listening for connections on the given path.
This function is asynchronous. callback will be added as a listener for the
&#39;listening&#39; event.  See also net.Server.listen(path).
server.listen(port[, hostname][, backlog][, callback])

Begin accepting connections on the specified port and hostname. If the
hostname is omitted, the server will accept connections on any IPv6 address
(::) when IPv6 is available, or any IPv4 address (0.0.0.0) otherwise. Use a
port value of 0 to have the operating system assign an available port.
To listen to a unix socket, supply a filename instead of port and hostname.
Backlog is the maximum length of the queue of pending connections.
The actual length will be determined by your OS through sysctl settings such as
tcp_max_syn_backlog and somaxconn on linux. The default value of this
parameter is 511 (not 512).
This function is asynchronous. callback will be added as a listener for the
&#39;listening&#39; event.  See also net.Server.listen(port).
server.listening

A Boolean indicating whether or not the server is listening for
connections.
server.maxHeadersCount

Limits maximum incoming headers count, equal to 1000 by default. If set to 0 -
no limit will be applied.
server.setTimeout(msecs, callback)


msecs {Number}
callback {Function}

Sets the timeout value for sockets, and emits a &#39;timeout&#39; event on
the Server object, passing the socket as an argument, if a timeout
occurs.
If there is a &#39;timeout&#39; event listener on the Server object, then it
will be called with the timed-out socket as an argument.
By default, the Server&#39;s timeout value is 2 minutes, and sockets are
destroyed automatically if they time out.  However, if you assign a
callback to the Server&#39;s &#39;timeout&#39; event, then you are responsible
for handling socket timeouts.
Returns server.
server.timeout


{Number} Default = 120000 (2 minutes)

The number of milliseconds of inactivity before a socket is presumed
to have timed out.
Note that the socket timeout logic is set up on connection, so
changing this value only affects new connections to the server, not
any existing connections.
Set to 0 to disable any kind of automatic timeout behavior on incoming
connections.
Class: http.ServerResponse

This object is created internally by a HTTP server--not by the user. It is
passed as the second parameter to the &#39;request&#39; event.
The response implements, but does not inherit from, the Writable Stream
interface. This is an EventEmitter with the following events:
Event: &#39;close&#39;

function () { }
Indicates that the underlying connection was terminated before
response.end() was called or able to flush.
Event: &#39;finish&#39;

function () { }
Emitted when the response has been sent. More specifically, this event is
emitted when the last segment of the response headers and body have been
handed off to the operating system for transmission over the network. It
does not imply that the client has received anything yet.
After this event, no more events will be emitted on the response object.
response.addTrailers(headers)

This method adds HTTP trailing headers (a header but at the end of the
message) to the response.
Trailers will only be emitted if chunked encoding is used for the
response; if it is not (e.g., if the request was HTTP/1.0), they will
be silently discarded.
Note that HTTP requires the Trailer header to be sent if you intend to
emit trailers, with a list of the header fields in its value. E.g.,
response.writeHead(200, { &#39;Content-Type&#39;: &#39;text/plain&#39;,
                          &#39;Trailer&#39;: &#39;Content-MD5&#39; });
response.write(fileData);
response.addTrailers({&#39;Content-MD5&#39;: &#39;7895bf4b8828b55ceaf47747b4bca667&#39;});
response.end();

Attempting to set a header field name or value that contains invalid characters
will result in a TypeError being thrown.
response.end([data][, encoding][, callback])

This method signals to the server that all of the response headers and body
have been sent; that server should consider this message complete.
The method, response.end(), MUST be called on each response.
If data is specified, it is equivalent to calling
response.write(data, encoding) followed by response.end(callback).
If callback is specified, it will be called when the response stream
is finished.
response.finished

Boolean value that indicates whether the response has completed. Starts
as false. After response.end() executes, the value will be true.
response.getHeader(name)

Reads out a header that&#39;s already been queued but not sent to the client.  Note
that the name is case insensitive.  This can only be called before headers get
implicitly flushed.
Example:
var contentType = response.getHeader(&#39;content-type&#39;);

response.headersSent

Boolean (read-only). True if headers were sent, false otherwise.
response.removeHeader(name)

Removes a header that&#39;s queued for implicit sending.
Example:
response.removeHeader(&#39;Content-Encoding&#39;);

response.sendDate

When true, the Date header will be automatically generated and sent in
the response if it is not already present in the headers. Defaults to true.
This should only be disabled for testing; HTTP requires the Date header
in responses.
response.setHeader(name, value)

Sets a single header value for implicit headers.  If this header already exists
in the to-be-sent headers, its value will be replaced.  Use an array of strings
here if you need to send multiple headers with the same name.
Example:
response.setHeader(&#39;Content-Type&#39;, &#39;text/html&#39;);

or
response.setHeader(&#39;Set-Cookie&#39;, [&#39;type=ninja&#39;, &#39;language=javascript&#39;]);

Attempting to set a header field name or value that contains invalid characters
will result in a TypeError being thrown.
When headers have been set with response.setHeader(), they will be merged with
any headers passed to response.writeHead(), with the headers passed to
response.writeHead() given precedence.
// returns content-type = text/plain
const server = http.createServer((req,res) =&gt; {
  res.setHeader(&#39;Content-Type&#39;, &#39;text/html&#39;);
  res.setHeader(&#39;X-Foo&#39;, &#39;bar&#39;);
  res.writeHead(200, {&#39;Content-Type&#39;: &#39;text/plain&#39;});
  res.end(&#39;ok&#39;);
});

response.setTimeout(msecs, callback)


msecs {Number}
callback {Function}

Sets the Socket&#39;s timeout value to msecs.  If a callback is
provided, then it is added as a listener on the &#39;timeout&#39; event on
the response object.
If no &#39;timeout&#39; listener is added to the request, the response, or
the server, then sockets are destroyed when they time out.  If you
assign a handler on the request, the response, or the server&#39;s
&#39;timeout&#39; events, then it is your responsibility to handle timed out
sockets.
Returns response.
response.statusCode

When using implicit headers (not calling response.writeHead() explicitly),
this property controls the status code that will be sent to the client when
the headers get flushed.
Example:
response.statusCode = 404;

After response header was sent to the client, this property indicates the
status code which was sent out.
response.statusMessage

When using implicit headers (not calling response.writeHead() explicitly), this property
controls the status message that will be sent to the client when the headers get
flushed. If this is left as undefined then the standard message for the status
code will be used.
Example:
response.statusMessage = &#39;Not found&#39;;

After response header was sent to the client, this property indicates the
status message which was sent out.
response.write(chunk[, encoding][, callback])

If this method is called and response.writeHead() has not been called,
it will switch to implicit header mode and flush the implicit headers.
This sends a chunk of the response body. This method may
be called multiple times to provide successive parts of the body.
chunk can be a string or a buffer. If chunk is a string,
the second parameter specifies how to encode it into a byte stream.
By default the encoding is &#39;utf8&#39;. callback will be called when this chunk
of data is flushed.
Note: This is the raw HTTP body and has nothing to do with
higher-level multi-part body encodings that may be used.
The first time response.write() is called, it will send the buffered
header information and the first body to the client. The second time
response.write() is called, Node.js assumes you&#39;re going to be streaming
data, and sends that separately. That is, the response is buffered up to the
first chunk of body.
Returns true if the entire data was flushed successfully to the kernel
buffer. Returns false if all or part of the data was queued in user memory.
&#39;drain&#39; will be emitted when the buffer is free again.
response.writeContinue()

Sends a HTTP/1.1 100 Continue message to the client, indicating that
the request body should be sent. See the &#39;checkContinue&#39; event on Server.
response.writeHead(statusCode[, statusMessage][, headers])

Sends a response header to the request. The status code is a 3-digit HTTP
status code, like 404. The last argument, headers, are the response headers.
Optionally one can give a human-readable statusMessage as the second
argument.
Example:
var body = &#39;hello world&#39;;
response.writeHead(200, {
  &#39;Content-Length&#39;: Buffer.byteLength(body),
  &#39;Content-Type&#39;: &#39;text/plain&#39; });

This method must only be called once on a message and it must
be called before response.end() is called.
If you call response.write() or response.end() before calling this,
the implicit/mutable headers will be calculated and call this function for you.
When headers have been set with response.setHeader(), they will be merged with
any headers passed to response.writeHead(), with the headers passed to
response.writeHead() given precedence.
// returns content-type = text/plain
const server = http.createServer((req,res) =&gt; {
  res.setHeader(&#39;Content-Type&#39;, &#39;text/html&#39;);
  res.setHeader(&#39;X-Foo&#39;, &#39;bar&#39;);
  res.writeHead(200, {&#39;Content-Type&#39;: &#39;text/plain&#39;});
  res.end(&#39;ok&#39;);
});

Note that Content-Length is given in bytes not characters. The above example
works because the string &#39;hello world&#39; contains only single byte characters.
If the body contains higher coded characters then Buffer.byteLength()
should be used to determine the number of bytes in a given encoding.
And Node.js does not check whether Content-Length and the length of the body
which has been transmitted are equal or not.
Attempting to set a header field name or value that contains invalid characters
will result in a TypeError being thrown.
Class: http.IncomingMessage

An IncomingMessage object is created by http.Server or
http.ClientRequest and passed as the first argument to the &#39;request&#39;
and &#39;response&#39; event respectively. It may be used to access response status,
headers and data.
It implements the Readable Stream interface, as well as the
following additional events, methods, and properties.
Event: &#39;aborted&#39;

function () { }
Emitted when the request has been aborted by the client and the network
socket has closed.
Event: &#39;close&#39;

function () { }
Indicates that the underlying connection was closed.
Just like &#39;end&#39;, this event occurs only once per response.
message.destroy([error])


error {Error}

Calls destroy() on the socket that received the IncomingMessage. If error
is provided, an &#39;error&#39; event is emitted and error is passed as an argument
to any listeners on the event.
message.headers

The request/response headers object.
Key-value pairs of header names and values. Header names are lower-cased.
Example:
// Prints something like:
//
// { &#39;user-agent&#39;: &#39;curl/7.22.0&#39;,
//   host: &#39;127.0.0.1:8000&#39;,
//   accept: &#39;*/*&#39; }
console.log(request.headers);

Duplicates in raw headers are handled in the following ways, depending on the
header name:

Duplicates of age, authorization, content-length, content-type,
etag, expires, from, host, if-modified-since, if-unmodified-since,
last-modified, location, max-forwards, proxy-authorization, referer,
retry-after, or user-agent are discarded.
set-cookie is always an array. Duplicates are added to the array.
For all other headers, the values are joined together with &#39;, &#39;.

message.httpVersion

In case of server request, the HTTP version sent by the client. In the case of
client response, the HTTP version of the connected-to server.
Probably either &#39;1.1&#39; or &#39;1.0&#39;.
Also message.httpVersionMajor is the first integer and
message.httpVersionMinor is the second.
message.method

Only valid for request obtained from http.Server.
The request method as a string. Read only. Example:
&#39;GET&#39;, &#39;DELETE&#39;.
message.rawHeaders

The raw request/response headers list exactly as they were received.
Note that the keys and values are in the same list.  It is not a
list of tuples.  So, the even-numbered offsets are key values, and the
odd-numbered offsets are the associated values.
Header names are not lowercased, and duplicates are not merged.
// Prints something like:
//
// [ &#39;user-agent&#39;,
//   &#39;this is invalid because there can be only one&#39;,
//   &#39;User-Agent&#39;,
//   &#39;curl/7.22.0&#39;,
//   &#39;Host&#39;,
//   &#39;127.0.0.1:8000&#39;,
//   &#39;ACCEPT&#39;,
//   &#39;*/*&#39; ]
console.log(request.rawHeaders);

message.rawTrailers

The raw request/response trailer keys and values exactly as they were
received.  Only populated at the &#39;end&#39; event.
message.setTimeout(msecs, callback)


msecs {Number}
callback {Function}

Calls message.connection.setTimeout(msecs, callback).
Returns message.
message.statusCode

Only valid for response obtained from http.ClientRequest.
The 3-digit HTTP response status code. E.G. 404.
message.statusMessage

Only valid for response obtained from http.ClientRequest.
The HTTP response status message (reason phrase). E.G. OK or Internal Server Error.
message.socket

The net.Socket object associated with the connection.
With HTTPS support, use request.socket.getPeerCertificate() to obtain the
client&#39;s authentication details.
message.trailers

The request/response trailers object. Only populated at the &#39;end&#39; event.
message.url

Only valid for request obtained from http.Server.
Request URL string. This contains only the URL that is
present in the actual HTTP request. If the request is:
GET /status?name=ryan HTTP/1.1\r\n
Accept: text/plain\r\n
\r\n

Then request.url will be:
&#39;/status?name=ryan&#39;

If you would like to parse the URL into its parts, you can use
require(&#39;url&#39;).parse(request.url).  Example:
$ node
&gt; require(&#39;url&#39;).parse(&#39;/status?name=ryan&#39;)
{
  href: &#39;/status?name=ryan&#39;,
  search: &#39;?name=ryan&#39;,
  query: &#39;name=ryan&#39;,
  pathname: &#39;/status&#39;
}

If you would like to extract the parameters from the query string,
you can use the require(&#39;querystring&#39;).parse function, or pass
true as the second argument to require(&#39;url&#39;).parse.  Example:
$ node
&gt; require(&#39;url&#39;).parse(&#39;/status?name=ryan&#39;, true)
{
  href: &#39;/status?name=ryan&#39;,
  search: &#39;?name=ryan&#39;,
  query: {name: &#39;ryan&#39;},
  pathname: &#39;/status&#39;
}

http.METHODS


{Array}

A list of the HTTP methods that are supported by the parser.
http.STATUS_CODES


{Object}

A collection of all the standard HTTP response status codes, and the
short description of each.  For example, http.STATUS_CODES[404] === &#39;Not
Found&#39;.
http.createClient([port][, host])

Stability: 0 - Deprecated: Use [`http.request()`][] instead.
Constructs a new HTTP client. port and host refer to the server to be
connected to.
http.createServer([requestListener])

Returns a new instance of http.Server.
The requestListener is a function which is automatically
added to the &#39;request&#39; event.
http.get(options[, callback])

Since most requests are GET requests without bodies, Node.js provides this
convenience method. The only difference between this method and http.request()
is that it sets the method to GET and calls req.end() automatically.
Example:
http.get(&#39;http://www.google.com/index.html&#39;, (res) =&gt; {
  console.log(`Got response: ${res.statusCode}`);
  // consume response body
  res.resume();
}).on(&#39;error&#39;, (e) =&gt; {
  console.log(`Got error: ${e.message}`);
});

http.globalAgent

Global instance of Agent which is used as the default for all http client
requests.
http.request(options[, callback])

Node.js maintains several connections per server to make HTTP requests.
This function allows one to transparently issue requests.
options can be an object or a string. If options is a string, it is
automatically parsed with url.parse().
Options:

protocol: Protocol to use. Defaults to &#39;http:&#39;.
host: A domain name or IP address of the server to issue the request to.
Defaults to &#39;localhost&#39;.
hostname: Alias for host. To support url.parse() hostname is
preferred over host.
family: IP address family to use when resolving host and hostname.
Valid values are 4 or 6. When unspecified, both IP v4 and v6 will be
used.
port: Port of remote server. Defaults to 80.
localAddress: Local interface to bind for network connections.
socketPath: Unix Domain Socket (use one of host:port or socketPath).
method: A string specifying the HTTP request method. Defaults to &#39;GET&#39;.
path: Request path. Defaults to &#39;/&#39;. Should include query string if any.
E.G. &#39;/index.html?page=12&#39;. An exception is thrown when the request path
contains illegal characters. Currently, only spaces are rejected but that
may change in the future.
headers: An object containing request headers.
auth: Basic authentication i.e. &#39;user:password&#39; to compute an
Authorization header.
agent: Controls Agent behavior. When an Agent is used request will
default to Connection: keep-alive. Possible values:
undefined (default): use http.globalAgent for this host and port.
Agent object: explicitly use the passed in Agent.
false: opts out of connection pooling with an Agent, defaults request to
Connection: close.


createConnection: A function that produces a socket/stream to use for the
request when the agent option is not used. This can be used to avoid
creating a custom Agent class just to override the default createConnection
function. See agent.createConnection() for more details.

The optional callback parameter will be added as a one time listener for
the &#39;response&#39; event.
http.request() returns an instance of the http.ClientRequest
class. The ClientRequest instance is a writable stream. If one needs to
upload a file with a POST request, then write to the ClientRequest object.
Example:
var postData = querystring.stringify({
  &#39;msg&#39; : &#39;Hello World!&#39;
});

var options = {
  hostname: &#39;www.google.com&#39;,
  port: 80,
  path: &#39;/upload&#39;,
  method: &#39;POST&#39;,
  headers: {
    &#39;Content-Type&#39;: &#39;application/x-www-form-urlencoded&#39;,
    &#39;Content-Length&#39;: Buffer.byteLength(postData)
  }
};

var req = http.request(options, (res) =&gt; {
  console.log(`STATUS: ${res.statusCode}`);
  console.log(`HEADERS: ${JSON.stringify(res.headers)}`);
  res.setEncoding(&#39;utf8&#39;);
  res.on(&#39;data&#39;, (chunk) =&gt; {
    console.log(`BODY: ${chunk}`);
  });
  res.on(&#39;end&#39;, () =&gt; {
    console.log(&#39;No more data in response.&#39;);
  });
});

req.on(&#39;error&#39;, (e) =&gt; {
  console.log(`problem with request: ${e.message}`);
});

// write data to request body
req.write(postData);
req.end();

Note that in the example req.end() was called. With http.request() one
must always call req.end() to signify that you&#39;re done with the request -
even if there is no data being written to the request body.
If any error is encountered during the request (be that with DNS resolution,
TCP level errors, or actual HTTP parse errors) an &#39;error&#39; event is emitted
on the returned request object. As with all &#39;error&#39; events, if no listeners
are registered the error will be thrown.
There are a few special headers that should be noted.

Sending a &#39;Connection: keep-alive&#39; will notify Node.js that the connection to
the server should be persisted until the next request.

Sending a &#39;Content-length&#39; header will disable the default chunked encoding.

Sending an &#39;Expect&#39; header will immediately send the request headers.
Usually, when sending &#39;Expect: 100-continue&#39;, you should both set a timeout
and listen for the &#39;continue&#39; event. See RFC2616 Section 8.2.3 for more
information.

Sending an Authorization header will override using the auth option
to compute basic authentication.

https.html.body:
title: https
tags: node
date: 2016-08-11 10:27:51
HTTPS
Stability: 2 - Stable
HTTPS is the HTTP protocol over TLS/SSL. In Node.js this is implemented as a
separate module.
Class: https.Agent

An Agent object for HTTPS similar to http.Agent.  See https.request()
for more information.
Class: https.Server

This class is a subclass of tls.Server and emits events same as
http.Server. See http.Server for more information.
server.setTimeout(msecs, callback)

See http.Server#setTimeout().
server.timeout

See http.Server#timeout.
https.createServer(options[, requestListener])

Returns a new HTTPS web server object. The options is similar to
tls.createServer().  The requestListener is a function which is
automatically added to the &#39;request&#39; event.
Example:
// curl -k https://localhost:8000/
const https = require(&#39;https&#39;);
const fs = require(&#39;fs&#39;);

const options = {
  key: fs.readFileSync(&#39;test/fixtures/keys/agent2-key.pem&#39;),
  cert: fs.readFileSync(&#39;test/fixtures/keys/agent2-cert.pem&#39;)
};

https.createServer(options, (req, res) =&gt; {
  res.writeHead(200);
  res.end(&#39;hello world\n&#39;);
}).listen(8000);

Or
const https = require(&#39;https&#39;);
const fs = require(&#39;fs&#39;);

const options = {
  pfx: fs.readFileSync(&#39;server.pfx&#39;)
};

https.createServer(options, (req, res) =&gt; {
  res.writeHead(200);
  res.end(&#39;hello world\n&#39;);
}).listen(8000);

server.close([callback])

See http.close() for details.
server.listen(handle[, callback])
server.listen(path[, callback])
server.listen(port[, host][, backlog][, callback])
See http.listen() for details.
https.get(options, callback)

Like http.get() but for HTTPS.
options can be an object or a string. If options is a string, it is
automatically parsed with url.parse().
Example:
const https = require(&#39;https&#39;);

https.get(&#39;https://encrypted.google.com/&#39;, (res) =&gt; {
  console.log(&#39;statusCode:&#39;, res.statusCode);
  console.log(&#39;headers:&#39;, res.headers);

  res.on(&#39;data&#39;, (d) =&gt; {
    process.stdout.write(d);
  });

}).on(&#39;error&#39;, (e) =&gt; {
  console.error(e);
});

https.globalAgent

Global instance of https.Agent for all HTTPS client requests.
https.request(options, callback)

Makes a request to a secure web server.
options can be an object or a string. If options is a string, it is
automatically parsed with url.parse().
All options from http.request() are valid.
Example:
const https = require(&#39;https&#39;);

var options = {
  hostname: &#39;encrypted.google.com&#39;,
  port: 443,
  path: &#39;/&#39;,
  method: &#39;GET&#39;
};

var req = https.request(options, (res) =&gt; {
  console.log(&#39;statusCode:&#39;, res.statusCode);
  console.log(&#39;headers:&#39;, res.headers);

  res.on(&#39;data&#39;, (d) =&gt; {
    process.stdout.write(d);
  });
});
req.end();

req.on(&#39;error&#39;, (e) =&gt; {
  console.error(e);
});

The options argument has the following options

host: A domain name or IP address of the server to issue the request to.
Defaults to &#39;localhost&#39;.
hostname: Alias for host. To support url.parse() hostname is
preferred over host.
family: IP address family to use when resolving host and hostname.
Valid values are 4 or 6. When unspecified, both IP v4 and v6 will be
used.
port: Port of remote server. Defaults to 443.
localAddress: Local interface to bind for network connections.
socketPath: Unix Domain Socket (use one of host:port or socketPath).
method: A string specifying the HTTP request method. Defaults to &#39;GET&#39;.
path: Request path. Defaults to &#39;/&#39;. Should include query string if any.
E.G. &#39;/index.html?page=12&#39;. An exception is thrown when the request path
contains illegal characters. Currently, only spaces are rejected but that
may change in the future.
headers: An object containing request headers.
auth: Basic authentication i.e. &#39;user:password&#39; to compute an
Authorization header.
agent: Controls Agent behavior. When an Agent is used request will
default to Connection: keep-alive. Possible values:
undefined (default): use globalAgent for this host and port.
Agent object: explicitly use the passed in Agent.
false: opts out of connection pooling with an Agent, defaults request to
Connection: close.



The following options from tls.connect() can also be specified. However, a
globalAgent silently ignores these.

pfx: Certificate, Private key and CA certificates to use for SSL. Default null.
key: Private key to use for SSL. Default null.
passphrase: A string of passphrase for the private key or pfx. Default null.
cert: Public x509 certificate to use. Default null.
ca: A string, Buffer or array of strings or Buffers of trusted
certificates in PEM format. If this is omitted several well known &quot;root&quot;
CAs will be used, like VeriSign. These are used to authorize connections.
ciphers: A string describing the ciphers to use or exclude. Consult
https://www.openssl.org/docs/apps/ciphers.html#CIPHER-LIST-FORMAT for
details on the format.
rejectUnauthorized: If true, the server certificate is verified against
the list of supplied CAs. An &#39;error&#39; event is emitted if verification
fails. Verification happens at the connection level, before the HTTP
request is sent. Default true.
secureProtocol: The SSL method to use, e.g. SSLv3_method to force
SSL version 3. The possible values depend on your installation of
OpenSSL and are defined in the constant SSL_METHODS.
servername: Servername for SNI (Server Name Indication) TLS extension.

In order to specify these options, use a custom Agent.
Example:
var options = {
  hostname: &#39;encrypted.google.com&#39;,
  port: 443,
  path: &#39;/&#39;,
  method: &#39;GET&#39;,
  key: fs.readFileSync(&#39;test/fixtures/keys/agent2-key.pem&#39;),
  cert: fs.readFileSync(&#39;test/fixtures/keys/agent2-cert.pem&#39;)
};
options.agent = new https.Agent(options);

var req = https.request(options, (res) =&gt; {
  ...
});

Alternatively, opt out of connection pooling by not using an Agent.
Example:
var options = {
  hostname: &#39;encrypted.google.com&#39;,
  port: 443,
  path: &#39;/&#39;,
  method: &#39;GET&#39;,
  key: fs.readFileSync(&#39;test/fixtures/keys/agent2-key.pem&#39;),
  cert: fs.readFileSync(&#39;test/fixtures/keys/agent2-cert.pem&#39;),
  agent: false
};

var req = https.request(options, (res) =&gt; {
  ...
});

path.html.body:
title: path
tags: node
date: 2016-08-11 10:27:51
Path
Stability: 2 - Stable
The path module provides utilities for working with file and directory paths.
It can be accessed using:
const path = require(&#39;path&#39;);

Windows vs. POSIX
The default operation of the path module varies based on the operating system
on which a Node.js application is running. Specifically, when running on a
Windows operating system, the path module will assume that Windows-style
paths are being used.
For example, using the path.basename() function with the Windows file path
C:\temp\myfile.html, will yield different results when running on POSIX than
when run on Windows:
On POSIX:
path.basename(&#39;C:\\temp\\myfile.html&#39;);
  // returns &#39;C:\temp\myfile.html&#39;

On Windows:
path.basename(&#39;C:\\temp\\myfile.html&#39;);
  // returns &#39;myfile.html&#39;

To achieve consistent results when working with Windows file paths on any
operating system, use path.win32:
On POSIX and Windows:
path.win32.basename(&#39;C:\\temp\\myfile.html&#39;);
  // returns &#39;myfile.html&#39;

To achieve consistent results when working with POSIX file paths on any
operating system, use path.posix:
On POSIX and Windows:
path.posix.basename(&#39;/tmp/myfile.html&#39;);
  // returns &#39;myfile.html&#39;

path.basename(path[, ext])


path {String}
ext {String} An optional file extension

The path.basename() methods returns the last portion of a path, similar to
the Unix basename command.
For example:
path.basename(&#39;/foo/bar/baz/asdf/quux.html&#39;)
  // returns &#39;quux.html&#39;

path.basename(&#39;/foo/bar/baz/asdf/quux.html&#39;, &#39;.html&#39;)
  // returns &#39;quux&#39;

A TypeError is thrown if path is not a string or if ext is given
and is not a string.
path.delimiter

Provides the platform-specific path delimiter:

; for Windows
: for POSIX

For example, on POSIX:
console.log(process.env.PATH)
// &#39;/usr/bin:/bin:/usr/sbin:/sbin:/usr/local/bin&#39;

process.env.PATH.split(path.delimiter)
// returns [&#39;/usr/bin&#39;, &#39;/bin&#39;, &#39;/usr/sbin&#39;, &#39;/sbin&#39;, &#39;/usr/local/bin&#39;]

On Windows:
console.log(process.env.PATH)
// &#39;C:\Windows\system32;C:\Windows;C:\Program Files\node\&#39;

process.env.PATH.split(path.delimiter)
// returns [&#39;C:\\Windows\\system32&#39;, &#39;C:\\Windows&#39;, &#39;C:\\Program Files\\node\\&#39;]

path.dirname(path)


path {String}

The path.dirname() method returns the directory name of a path, similar to
the Unix dirname command.
For example:
path.dirname(&#39;/foo/bar/baz/asdf/quux&#39;)
// returns &#39;/foo/bar/baz/asdf&#39;

A TypeError is thrown if path is not a string.
path.extname(path)


path {String}

The path.extname() method returns the extension of the path, from the last
occurance of the . (period) character to end of string in the last portion of
the path.  If there is no . in the last portion of the path, or if the
first character of the basename of path (see path.basename()) is ., then
an empty string is returned.
For example:
path.extname(&#39;index.html&#39;)
// returns &#39;.html&#39;

path.extname(&#39;index.coffee.md&#39;)
// returns &#39;.md&#39;

path.extname(&#39;index.&#39;)
// returns &#39;.&#39;

path.extname(&#39;index&#39;)
// returns &#39;&#39;

path.extname(&#39;.index&#39;)
// returns &#39;&#39;

A TypeError is thrown if path is not a string.
path.format(pathObject)


pathObject {Object}
dir {String}
root {String} 
base {String}
name {String}
ext {String}



The path.format() method returns a path string from an object. This is the
opposite of path.parse().
The following process is used when constructing the path string:

output is set to an empty string.
If pathObject.dir is specified, pathObject.dir is appended to output
followed by the value of path.sep;
Otherwise, if pathObject.root is specified, pathObject.root is appended
to output.
If pathObject.base is specified, pathObject.base is appended to output;
Otherwise:
If pathObject.name is specified, pathObject.name is appended to output
If pathObject.ext is specified, pathObject.ext is appended to output.


Return output

For example, on POSIX:
// If `dir` and `base` are provided,
// `${dir}${path.sep}${base}`
// will be returned.
path.format({
  dir: &#39;/home/user/dir&#39;,
  base: &#39;file.txt&#39;
});
// returns &#39;/home/user/dir/file.txt&#39;

// `root` will be used if `dir` is not specified.
// If only `root` is provided or `dir` is equal to `root` then the
// platform separator will not be included.
path.format({
  root: &#39;/&#39;,
  base: &#39;file.txt&#39;
});
// returns &#39;/file.txt&#39;

// `name` + `ext` will be used if `base` is not specified.
path.format({
  root: &#39;/&#39;,
  name: &#39;file&#39;,
  ext: &#39;.txt&#39;
});
// returns &#39;/file.txt&#39;

// `base` will be returned if `dir` or `root` are not provided.
path.format({
  base: &#39;file.txt&#39;
});
// returns &#39;file.txt&#39;

On Windows:
path.format({
    root : &quot;C:\\&quot;,
    dir : &quot;C:\\path\\dir&quot;,
    base : &quot;file.txt&quot;,
    ext : &quot;.txt&quot;,
    name : &quot;file&quot;
});
// returns &#39;C:\\path\\dir\\file.txt&#39;

path.isAbsolute(path)


path {String}

The path.isAbsolute() method determines if path is an absolute path.
If the given path is a zero-length string, false will be returned.
For example on POSIX:
path.isAbsolute(&#39;/foo/bar&#39;) // true
path.isAbsolute(&#39;/baz/..&#39;)  // true
path.isAbsolute(&#39;qux/&#39;)     // false
path.isAbsolute(&#39;.&#39;)        // false

On Windows:
path.isAbsolute(&#39;//server&#39;)  // true
path.isAbsolute(&#39;C:/foo/..&#39;) // true
path.isAbsolute(&#39;bar\\baz&#39;)  // false
path.isAbsolute(&#39;.&#39;)         // false

A TypeError is thrown if path is not a string.
path.join([path[, ...]])


[path[, ...]] {String} A sequence of path segments

The path.join() method join all given path segments together using the
platform specific separator as a delimiter, then normalizes the resulting path.
Zero-length path segments are ignored. If the joined path string is a
zero-length string then &#39;.&#39; will be returned, representing the current
working directory.
For example:
path.join(&#39;/foo&#39;, &#39;bar&#39;, &#39;baz/asdf&#39;, &#39;quux&#39;, &#39;..&#39;)
// returns &#39;/foo/bar/baz/asdf&#39;

path.join(&#39;foo&#39;, {}, &#39;bar&#39;)
// throws TypeError: Arguments to path.join must be strings

A TypeError is thrown if any of the path segments is not a string.
path.normalize(path)


path {String}

The path.normalize() method normalizes the given path, resolving &#39;..&#39; and
&#39;.&#39; segments.
When multiple, sequential path segment separation characters are found (e.g.
/ on POSIX and \ on Windows), they are replaced by a single instance of the
platform specific path segment separator. Trailing separators are preserved.
If the path is a zero-length string, &#39;.&#39; is returned, representing the
current working directory.
For example on POSIX:
path.normalize(&#39;/foo/bar//baz/asdf/quux/..&#39;)
// returns &#39;/foo/bar/baz/asdf&#39;

On Windows:
path.normalize(&#39;C:\\temp\\\\foo\\bar\\..\\&#39;);
// returns &#39;C:\\temp\\foo\\&#39;

A TypeError is thrown if path is not a string.
path.parse(path)


path {String}

The path.parse() method returns an object whose properties represent
significant elements of the path.
The returned object will have the following properties:

root {String}
dir {String}
base {String}
ext {String}
name {String}

For example on POSIX:
path.parse(&#39;/home/user/dir/file.txt&#39;)
// returns
// {
//    root : &quot;/&quot;,
//    dir : &quot;/home/user/dir&quot;,
//    base : &quot;file.txt&quot;,
//    ext : &quot;.txt&quot;,
//    name : &quot;file&quot;
// }

┌─────────────────────┬────────────┐
│          dir        │    base    │
├──────┬              ├──────┬─────┤
│ root │              │ name │ ext │
&quot;  /    home/user/dir / file  .txt &quot;
└──────┴──────────────┴──────┴─────┘
(all spaces in the &quot;&quot; line should be ignored -- they are purely for formatting)

On Windows:
path.parse(&#39;C:\\path\\dir\\file.txt&#39;)
// returns
// {
//    root : &quot;C:\\&quot;,
//    dir : &quot;C:\\path\\dir&quot;,
//    base : &quot;file.txt&quot;,
//    ext : &quot;.txt&quot;,
//    name : &quot;file&quot;
// }

┌─────────────────────┬────────────┐
│          dir        │    base    │
├──────┬              ├──────┬─────┤
│ root │              │ name │ ext │
&quot; C:\      path\dir   \ file  .txt &quot;
└──────┴──────────────┴──────┴─────┘
(all spaces in the &quot;&quot; line should be ignored -- they are purely for formatting)

A TypeError is thrown if path is not a string.
path.posix

The path.posix property provides access to POSIX specific implementations
of the path methods.
path.relative(from, to)


from {String}
to {String}

The path.relative() method returns the relative path from from to to.
If from and to each resolve to the same path (after calling path.resolve()
on each), a zero-length string is returned.
If a zero-length string is passed as from or to, the current working
directory will be used instead of the zero-length strings.
For example on POSIX:
path.relative(&#39;/data/orandea/test/aaa&#39;, &#39;/data/orandea/impl/bbb&#39;)
// returns &#39;../../impl/bbb&#39;

On Windows:
path.relative(&#39;C:\\orandea\\test\\aaa&#39;, &#39;C:\\orandea\\impl\\bbb&#39;)
// returns &#39;..\\..\\impl\\bbb&#39;

A TypeError is thrown if neither from nor to is a string.
path.resolve([path[, ...]])


[path[, ...]] {String} A sequence of paths or path segments

The path.resolve() method resolves a sequence of paths or path segments into
an absolute path.
The given sequence of paths is processed from right to left, with each
subsequent path prepended until an absolute path is constructed.
For instance, given the sequence of path segments: /foo, /bar, baz,
calling path.resolve(&#39;/foo&#39;, &#39;/bar&#39;, &#39;baz&#39;) would return /bar/baz.
If after processing all given path segments an absolute path has not yet
been generated, the current working directory is used.
The resulting path is normalized and trailing slashes are removed unless the
path is resolved to the root directory.
Zero-length path segments are ignored.
If no path segments are passed, path.resolve() will return the absolute path
of the current working directory.
For example:
path.resolve(&#39;/foo/bar&#39;, &#39;./baz&#39;)
// returns &#39;/foo/bar/baz&#39;

path.resolve(&#39;/foo/bar&#39;, &#39;/tmp/file/&#39;)
// returns &#39;/tmp/file&#39;

path.resolve(&#39;wwwroot&#39;, &#39;static_files/png/&#39;, &#39;../gif/image.gif&#39;)
// if the current working directory is /home/myself/node,
// this returns &#39;/home/myself/node/wwwroot/static_files/gif/image.gif&#39;

A TypeError is thrown if any of the arguments is not a string.
path.sep

Provides the platform-specific path segment separator:

\ on Windows
/ on POSIX

For example on POSIX:
&#39;foo/bar/baz&#39;.split(path.sep)
// returns [&#39;foo&#39;, &#39;bar&#39;, &#39;baz&#39;]

On Windows:
&#39;foo\\bar\\baz&#39;.split(path.sep)
// returns [&#39;foo&#39;, &#39;bar&#39;, &#39;baz&#39;]

path.win32

The path.win32 property provides access to Windows-specific implementations
of the path methods.

process.html.body:
title: process
tags: node
date: 2016-08-11 10:27:51
process

The process object is a global that provides information about, and control
over, the current Node.js process. As a global, it is always available to
Node.js applications without using require().
Process Events
The process object is an instance of EventEmitter.
Event: &#39;beforeExit&#39;

The &#39;beforeExit&#39; event is emitted when Node.js empties its event loop and has
no additional work to schedule. Normally, the Node.js process will exit when
there is no work scheduled, but a listener registered on the &#39;beforeExit&#39;
event can make asynchronous calls, and thereby cause the Node.js process to
continue.
The listener callback function is invoked with the value of
[process.exitCode][] passed as the only argument.
The &#39;beforeExit&#39; event is not emitted for conditions causing explicit
termination, such as calling process.exit() or uncaught exceptions.
The &#39;beforeExit&#39; should not be used as an alternative to the &#39;exit&#39; event
unless the intention is to schedule additional work.
Event: &#39;disconnect&#39;

If the Node.js process is spawned with an IPC channel (see the Child Process
and Cluster documentation), the &#39;disconnect&#39; event will be emitted when
the IPC channel is closed.
Event: &#39;exit&#39;

The &#39;exit&#39; event is emitted when the Node.js process is about to exit as a
result of either:

The process.exit() method being called explicitly;
The Node.js event loop no longer having any additional work to perform.

There is no way to prevent the exiting of the event loop at this point, and once
all &#39;exit&#39; listeners have finished running the Node.js process will terminate.
The listener callback function is invoked with the exit code specified either
by the [process.exitCode][] property, or the exitCode argument passed to the
process.exit() method, as the only argument.
For example:
process.on(&#39;exit&#39;, (code) =&gt; {
  console.log(`About to exit with code: ${code}`);
});

Listener functions must only perform synchronous operations. The Node.js
process will exit immediately after calling the &#39;exit&#39; event listeners
causing any additional work still queued in the event loop to be abandoned.
In the following example, for instance, the timeout will never occur:
process.on(&#39;exit&#39;, (code) =&gt; {
  setTimeout(() =&gt; {
    console.log(&#39;This will not run&#39;);
  }, 0);
});

Event: &#39;message&#39;

If the Node.js process is spawned with an IPC channel (see the Child Process
and Cluster documentation), the &#39;message&#39; event is emitted whenever a
message sent by a parent process using childprocess.send() is received by
the child process.
The listener callback is invoked with the following arguments:

message {Object} a parsed JSON object or primitive value
sendHandle {Handle object} a net.Socket or net.Server object, or
undefined.

Event: &#39;rejectionHandled&#39;

The &#39;rejectionHandled&#39; event is emitted whenever a Promise has been rejected
and an error handler was attached to it (using promise.catch(), for
example) later than one turn of the Node.js event loop.
The listener callback is invoked with a reference to the rejected Promise as
the only argument.
The Promise object would have previously been emitted in an
&#39;unhandledRejection&#39; event, but during the course of processing gained a
rejection handler.
There is no notion of a top level for a Promise chain at which rejections can
always be handled. Being inherently asynchronous in nature, a Promise
rejection can be handled at a future point in time — possibly much later than
the event loop turn it takes for the &#39;unhandledRejection&#39; event to be emitted.
Another way of stating this is that, unlike in synchronous code where there is
an ever-growing list of unhandled exceptions, with Promises there can be a
growing-and-shrinking list of unhandled rejections.
In synchronous code, the &#39;uncaughtException&#39; event is emitted when the list of
unhandled exceptions grows.
In asynchronous code, the &#39;unhandledRejection&#39; event is emitted when the list
of unhandled rejections grows, and the &#39;rejectionHandled&#39; event is emitted
when the list of unhandled rejections shrinks.
For example:
const unhandledRejections = new Map();
process.on(&#39;unhandledRejection&#39;, (reason, p) =&gt; {
  unhandledRejections.set(p, reason);
});
process.on(&#39;rejectionHandled&#39;, (p) =&gt; {
  unhandledRejections.delete(p);
});

In this example, the unhandledRejections Map will grow and shrink over time,
reflecting rejections that start unhandled and then become handled. It is
possible to record such errors in an error log, either periodically (which is
likely best for long-running application) or upon process exit (which is likely
most convenient for scripts).
Event: &#39;uncaughtException&#39;

The &#39;uncaughtException&#39; event is emitted when an uncaught JavaScript
exception bubbles all the way back to the event loop. By default, Node.js
handles such exceptions by printing the stack trace to stderr and exiting.
Adding a handler for the &#39;uncaughtException&#39; event overrides this default
behavior.
The listener function is called with the Error object passed as the only
argument.
For example:
process.on(&#39;uncaughtException&#39;, (err) =&gt; {
  fs.writeSync(1, `Caught exception: ${err}`);
});

setTimeout(() =&gt; {
  console.log(&#39;This will still run.&#39;);
}, 500);

// Intentionally cause an exception, but don&#39;t catch it.
nonexistentFunc();
console.log(&#39;This will not run.&#39;);

Warning: Using &#39;uncaughtException&#39; correctly
Note that &#39;uncaughtException&#39; is a crude mechanism for exception handling
intended to be used only as a last resort. The event should not be used as
an equivalent to On Error Resume Next. Unhandled exceptions inherently mean
that an application is in an undefined state. Attempting to resume application
code without properly recovering from the exception can cause additional
unforeseen and unpredictable issues.
Exceptions thrown from within the event handler will not be caught. Instead the
process will exit with a non-zero exit code and the stack trace will be printed.
This is to avoid infinite recursion.
Attempting to resume normally after an uncaught exception can be similar to
pulling out of the power cord when upgrading a computer -- nine out of ten
times nothing happens - but the 10th time, the system becomes corrupted.
The correct use of &#39;uncaughtException&#39; is to perform synchronous cleanup
of allocated resources (e.g. file descriptors, handles, etc) before shutting
down the process. It is not safe to resume normal operation after
&#39;uncaughtException&#39;.
To restart a crashed application in a more reliable way, whether uncaughtException
is emitted or not, an external monitor should be employed in a separate process
to detect application failures and recover or restart as needed.
Event: &#39;unhandledRejection&#39;

The &#39;unhandledRejection&#39; event is emitted whenever a Promise is rejected and
no error handler is attached to the promise within a turn of the event loop.
When programming with Promises, exceptions are encapsulated as &quot;rejected
promises&quot;. Rejections can be caught and handled using promise.catch() and
are propagated through a Promise chain. The &#39;unhandledRejection&#39; event is
useful for detecting and keeping track of promises that were rejected whose
rejections have not yet been handled.
The listener function is called with the following arguments:

reason {Error|any} The object with which the promise was rejected
(typically an Error objet).
p the Promise that was rejected.

For example:
process.on(&#39;unhandledRejection&#39;, (reason, p) =&gt; {
  console.log(&#39;Unhandled Rejection at: Promise&#39;, p, &#39;reason:&#39;, reason);
  // application specific logging, throwing an error, or other logic here
});

somePromise.then((res) =&gt; {
  return reportToUser(JSON.pasre(res)); // note the typo (`pasre`)
}); // no `.catch` or `.then`

The following will also trigger the &#39;unhandledRejection&#39; event to be
emitted:
function SomeResource() {
  // Initially set the loaded status to a rejected promise
  this.loaded = Promise.reject(new Error(&#39;Resource not yet loaded!&#39;));
}

var resource = new SomeResource();
// no .catch or .then on resource.loaded for at least a turn

In this example case, it is possible to track the rejection as a developer error
as would typically be the case for other &#39;unhandledRejection&#39; events. To
address such failures, a non-operational
.catch(() =&gt; { }) handler may be attached to
resource.loaded, which would prevent the &#39;unhandledRejection&#39; event from
being emitted. Alternatively, the &#39;rejectionHandled&#39; event may be used.
Event: &#39;warning&#39;

The &#39;warning&#39; event is emitted whenever Node.js emits a process warning.
A process warning is similar to an error in that it describes exceptional
conditions that are being brought to the user&#39;s attention. However, warnings
are not part of the normal Node.js and JavaScript error handling flow.
Node.js can emit warnings whenever it detects bad coding practices that could
lead to sub-optimal application performance, bugs or security vulnerabilities.
The listener function is called with a single warning argument whose value is
an Error object. There are three key properties that describe the warning:

name {String} The name of the warning (currently Warning by default).
message {String} A system-provided description of the warning.
stack {String} A stack trace to the location in the code where the warning
was issued.

process.on(&#39;warning&#39;, (warning) =&gt; {
  console.warn(warning.name);    // Print the warning name
  console.warn(warning.message); // Print the warning message
  console.warn(warning.stack);   // Print the stack trace
});

By default, Node.js will print process warnings to stderr. The --no-warnings
command-line option can be used to suppress the default console output but the
&#39;warning&#39; event will still be emitted by the process object.
The following example illustrates the warning that is printed to stderr when
too many listeners have been added to an event
$ node
&gt; event.defaultMaxListeners = 1;
&gt; process.on(&#39;foo&#39;, () =&gt; {});
&gt; process.on(&#39;foo&#39;, () =&gt; {});
&gt; (node:38638) Warning: Possible EventEmitter memory leak detected. 2 foo
... listeners added. Use emitter.setMaxListeners() to increase limit

In contrast, the following example turns off the default warning output and
adds a custom handler to the &#39;warning&#39; event:
$ node --no-warnings
&gt; var p = process.on(&#39;warning&#39;, (warning) =&gt; console.warn(&#39;Do not do that!&#39;));
&gt; event.defaultMaxListeners = 1;
&gt; process.on(&#39;foo&#39;, () =&gt; {});
&gt; process.on(&#39;foo&#39;, () =&gt; {});
&gt; Do not do that!

The --trace-warnings command-line option can be used to have the default
console output for warnings include the full stack trace of the warning.
Emitting custom warnings
The process.emitWarning() method can be used to issue
custom or application specific warnings.
// Emit a warning using a string...
process.emitWarning(&#39;Something happened!&#39;);
  // Prints: (node 12345) Warning: Something happened!

// Emit a warning using an object...
process.emitWarning(&#39;Something Happened!&#39;, &#39;CustomWarning&#39;);
  // Prints: (node 12345) CustomWarning: Something happened!

// Emit a warning using a custom Error object...
class CustomWarning extends Error {
  constructor(message) {
    super(message);
    this.name = &#39;CustomWarning&#39;;
    Error.captureStackTrace(this, CustomWarning);
  }
}
const myWarning = new CustomWarning(&#39;Something happened!&#39;);
process.emitWarning(myWarning);
  // Prints: (node 12345) CustomWarning: Something happened!

Emitting custom deprecation warnings
Custom deprecation warnings can be emitted by setting the name of a custom
warning to DeprecationWarning. For instance:
process.emitWarning(&#39;This API is deprecated&#39;, &#39;DeprecationWarning&#39;);

Or,
const err = new Error(&#39;This API is deprecated&#39;);
err.name = &#39;DeprecationWarning&#39;;
process.emitWarning(err);

Launching Node.js using the --throw-deprecation command line flag will
cause custom deprecation warnings to be thrown as exceptions.
Using the --trace-deprecation command line flag will cause the custom
deprecation to be printed to stderr along with the stack trace.
Using the --no-deprecation command line flag will suppress all reporting
of the custom deprecation.
The *-deprecation command line flags only affect warnings that use the name
DeprecationWarning.
Signal Events


Signal events will be emitted when the Node.js process receives a signal. Please
refer to sigaction(2) for a listing of standard POSIX signal names such as
SIGINT, SIGHUP, etc.
The name of each event will be the uppercase common name for the signal (e.g.
&#39;SIGINT&#39; for SIGINT signals).
For example:
// Begin reading from stdin so the process does not exit.
process.stdin.resume();

process.on(&#39;SIGINT&#39;, () =&gt; {
  console.log(&#39;Received SIGINT.  Press Control-D to exit.&#39;);
});

Note: An easy way to send the SIGINT signal is with &lt;Ctrl&gt;-C in most
terminal programs.
It is important to take note of the following:

SIGUSR1 is reserved by Node.js to start the debugger.  It&#39;s possible to
install a listener but doing so will not stop the debugger from starting.
SIGTERM and SIGINT have default handlers on non-Windows platforms that
resets the terminal mode before exiting with code 128 + signal number. If
one of these signals has a listener installed, its default behavior will be
removed (Node.js will no longer exit).
SIGPIPE is ignored by default. It can have a listener installed.
SIGHUP is generated on Windows when the console window is closed, and on
other platforms under various similar conditions, see signal(7). It can have a
listener installed, however Node.js will be unconditionally terminated by
Windows about 10 seconds later. On non-Windows platforms, the default
behavior of SIGHUP is to terminate Node.js, but once a listener has been
installed its default behavior will be removed.
SIGTERM is not supported on Windows, it can be listened on.
SIGINT from the terminal is supported on all platforms, and can usually be
generated with CTRL+C (though this may be configurable). It is not generated
when terminal raw mode is enabled.
SIGBREAK is delivered on Windows when &lt;Ctrl&gt;+&lt;Break&gt; is pressed, on
non-Windows platforms it can be listened on, but there is no way to send or
generate it.
SIGWINCH is delivered when the console has been resized. On Windows, this
will only happen on write to the console when the cursor is being moved, or
when a readable tty is used in raw mode.
SIGKILL cannot have a listener installed, it will unconditionally terminate
Node.js on all platforms.
SIGSTOP cannot have a listener installed.

Note: Windows does not support sending signals, but Node.js offers some
emulation with process.kill(), and ChildProcess.kill(). Sending
signal 0 can be used to test for the existence of a process. Sending SIGINT,
SIGTERM, and SIGKILL cause the unconditional termination of the target
process.
process.abort()

The process.abort() method causes the Node.js process to exit immediately and
generate a core file.
process.arch

The process.arch property returns a String identifying the processor
architecture that the Node.js process is currently running on. For instance
&#39;arm&#39;, &#39;ia32&#39;, or &#39;x64&#39;.
console.log(`This processor architecture is ${process.arch}`);

process.argv

The process.argv property returns an array containing the command line
arguments passed when the Node.js process was launched. The first element will
be process.execPath. The second element will be the path to the
JavaScript file being executed. The remaining elements will be any additional
command line arguments.
For example, assuming the following script for process-args.js:
// print process.argv
process.argv.forEach((val, index) =&gt; {
  console.log(`${index}: ${val}`);
});

Launching the Node.js process as:
$ node process-2.js one two=three four

Would generate the output:
0: /usr/local/bin/node
1: /Users/mjr/work/node/process-2.js
2: one
3: two=three
4: four

process.chdir(directory)


directory {String}

The process.chdir() method changes the current working directory of the
Node.js process or throws an exception if doing so fails (for instance, if
the specified directory does not exist).
console.log(`Starting directory: ${process.cwd()}`);
try {
  process.chdir(&#39;/tmp&#39;);
  console.log(`New directory: ${process.cwd()}`);
}
catch (err) {
  console.log(`chdir: ${err}`);
}

process.config

The process.config property returns an Object containing the JavaScript
representation of the configure options used to compile the current Node.js
executable. This is the same as the config.gypi file that was produced when
running the ./configure script.
An example of the possible output looks like:
{
  target_defaults:
   { cflags: [],
     default_configuration: &#39;Release&#39;,
     defines: [],
     include_dirs: [],
     libraries: [] },
  variables:
   {
     host_arch: &#39;x64&#39;,
     node_install_npm: &#39;true&#39;,
     node_prefix: &#39;&#39;,
     node_shared_cares: &#39;false&#39;,
     node_shared_http_parser: &#39;false&#39;,
     node_shared_libuv: &#39;false&#39;,
     node_shared_zlib: &#39;false&#39;,
     node_use_dtrace: &#39;false&#39;,
     node_use_openssl: &#39;true&#39;,
     node_shared_openssl: &#39;false&#39;,
     strict_aliasing: &#39;true&#39;,
     target_arch: &#39;x64&#39;,
     v8_use_snapshot: &#39;true&#39;
   }
}

Note: The process.config property is not read-only and there are
existing modules in the ecosystem that are known to extend, modify, or entirely
replace the value of process.config.
process.connected

If the Node.js process is spawned with an IPC channel (see the Child Process
and Cluster documentation), the process.connected property will return
true so long as the IPC channel is connected and will return false after
process.disconnect() is called.
Once process.connected is false, it is no longer possible to send messages
over the IPC channel using process.send().
process.cpuUsage([previousValue])


previousValue {Array} A previous return value from calling
process.cpuUsage()

The process.cpuUsage() method returns the user and system CPU time usage of
the current process, in an object with properties user and system, whose
values are microsecond values (millionth of a second). These values measure time
spent in user and system code respectively, and may end up being greater than
actual elapsed time if multiple CPU cores are performing work for this process.
The result of a previous call to process.cpuUsage() can be passed as the
argument to the function, to get a diff reading.
const startUsage = process.cpuUsage();
// { user: 38579, system: 6986 }

// spin the CPU for 500 milliseconds
const now = Date.now();
while (Date.now() - now &lt; 500);

console.log(process.cpuUsage(startUsage));
// { user: 514883, system: 11226 }

process.cwd()

