Exit Codes
Node.js will normally exit with a 0 status code when no more async
operations are pending.  The following status codes are used in other
cases:

1 Uncaught Fatal Exception - There was an uncaught exception,
and it was not handled by a domain or an &#39;uncaughtException&#39; event
handler.
2 - Unused (reserved by Bash for builtin misuse)
3 Internal JavaScript Parse Error - The JavaScript source code
internal in Node.js&#39;s bootstrapping process caused a parse error.  This
is extremely rare, and generally can only happen during development
of Node.js itself.
4 Internal JavaScript Evaluation Failure - The JavaScript
source code internal in Node.js&#39;s bootstrapping process failed to
return a function value when evaluated.  This is extremely rare, and
generally can only happen during development of Node.js itself.
5 Fatal Error - There was a fatal unrecoverable error in V8.
Typically a message will be printed to stderr with the prefix FATAL
ERROR.
6 Non-function Internal Exception Handler - There was an
uncaught exception, but the internal fatal exception handler
function was somehow set to a non-function, and could not be called.
7 Internal Exception Handler Run-Time Failure - There was an
uncaught exception, and the internal fatal exception handler
function itself threw an error while attempting to handle it.  This
can happen, for example, if a &#39;uncaughtException&#39; or
domain.on(&#39;error&#39;) handler throws an error.
8 - Unused.  In previous versions of Node.js, exit code 8 sometimes
indicated an uncaught exception.
9 - Invalid Argument - Either an unknown option was specified,
or an option requiring a value was provided without a value.
10 Internal JavaScript Run-Time Failure - The JavaScript
source code internal in Node.js&#39;s bootstrapping process threw an error
when the bootstrapping function was called.  This is extremely rare,
and generally can only happen during development of Node.js itself.
12 Invalid Debug Argument - The --debug, --inspect and/or
--debug-brk options were set, but the port number chosen was invalid
or unavailable.
&gt;128 Signal Exits - If Node.js receives a fatal signal such as
SIGKILL or SIGHUP, then its exit code will be 128 plus the
value of the signal code.  This is a standard Unix practice, since
exit codes are defined to be 7-bit integers, and signal exits set
the high-order bit, and then contain the value of the signal code.

punycode.html.body:
title: punycode
tags: node
date: 2016-08-11 10:27:51
punycode
Stability: 2 - Stable
The punycode module is a bundled version of the Punycode.js module. It
can be accessed using:
const punycode = require(&#39;punycode&#39;);

Punycode is a character encoding scheme defined by RFC 3492 that is
primarily intended for use in Internationalized Domain Names. Because host
names in URLs are limited to ASCII characters only, Domain Names that contain
non-ASCII characters must be converted into ASCII using the Punycode scheme.
For instance, the Japanese character that translates into the English word,
&#39;example&#39; is &#39;例&#39;. The Internationalized Domain Name, &#39;例.com&#39; (equivalent
to &#39;example.com&#39;) is represented by Punycode as the ASCII string
&#39;xn--fsq.com&#39;.
The punycode module provides a simple implementation of the Punycode standard.
Note: The punycode module is a third-party dependency used by Node.js and
made available to developers as a convenience. Fixes or other modifications to
the module must be directed to the Punycode.js project.
punycode.decode(string)


string {String}

The punycode.decode() method converts a Punycode string of ASCII-only
characters to the equivalent string of Unicode codepoints.
punycode.decode(&#39;maana-pta&#39;); // &#39;mañana&#39;
punycode.decode(&#39;--dqo34k&#39;); // &#39;☃-⌘&#39;

punycode.encode(string)


string {String}

The punycode.encode() method converts a string of Unicode codepoints to a
Punycode string of ASCII-only characters.
punycode.encode(&#39;mañana&#39;); // &#39;maana-pta&#39;
punycode.encode(&#39;☃-⌘&#39;); // &#39;--dqo34k&#39;

punycode.toASCII(domain)


domain {String}

The punycode.toASCII() method converts a Unicode string representing an
Internationalized Domain Name to Punycode. Only the non-ASCII parts of the
domain name will be converted. Calling punycode.toASCII() on a string that
already only contains ASCII characters will have no effect.
// encode domain names
punycode.toASCII(&#39;mañana.com&#39;);  // &#39;xn--maana-pta.com&#39;
punycode.toASCII(&#39;☃-⌘.com&#39;);   // &#39;xn----dqo34k.com&#39;
punycode.toASCII(&#39;example.com&#39;); // &#39;example.com&#39;

punycode.toUnicode(domain)


domain {String}

The punycode.toUnicode() method converts a string representing a domain name
containing Punycode encoded characters into Unicode. Only the Punycode
encoded parts of the domain name are be converted.
// decode domain names
punycode.toUnicode(&#39;xn--maana-pta.com&#39;); // &#39;mañana.com&#39;
punycode.toUnicode(&#39;xn----dqo34k.com&#39;);  // &#39;☃-⌘.com&#39;
punycode.toUnicode(&#39;example.com&#39;);       // &#39;example.com&#39;

punycode.ucs2

punycode.ucs2.decode(string)


string {String}

The punycode.ucs2.decode() method returns an array containing the numeric
codepoint values of each Unicode symbol in the string.
punycode.ucs2.decode(&#39;abc&#39;); // [0x61, 0x62, 0x63]
// surrogate pair for U+1D306 tetragram for centre:
punycode.ucs2.decode(&#39;\uD834\uDF06&#39;); // [0x1D306]

punycode.ucs2.encode(codePoints)


codePoints {Array}

The punycode.ucs2.encode() method returns a string based on an array of
numeric code point values.
punycode.ucs2.encode([0x61, 0x62, 0x63]); // &#39;abc&#39;
punycode.ucs2.encode([0x1D306]); // &#39;\uD834\uDF06&#39;

punycode.version

Returns a string identifying the current Punycode.js version number.

readline.html.body:
title: readline
tags: node
date: 2016-08-11 10:27:51
Readline
Stability: 2 - Stable
The readline module provides an interface for reading data from a Readable
stream (such as process.stdin) one line at a time. It can be accessed using:
const readline = require(&#39;readline&#39;);

The following simple example illustrates the basic use of the readline module.
const readline = require(&#39;readline&#39;);

const rl = readline.createInterface({
  input: process.stdin,
  output: process.stdout
});

rl.question(&#39;What do you think of Node.js? &#39;, (answer) =&gt; {
  // TODO: Log the answer in a database
  console.log(&#39;Thank you for your valuable feedback:&#39;, answer);

  rl.close();
});

Note Once this code is invoked, the Node.js application will not
terminate until the readline.Interface is closed because the interface
waits for data to be received on the input stream.
Class: Interface

Instances of the readline.Interface class are constructed using the
readline.createInterface() method. Every instance is associated with a
single input Readable stream and a single output Writable stream.
The output stream is used to print prompts for user input that arrives on,
and is read from, the input stream.
Event: &#39;close&#39;

The &#39;close&#39; event is emitted when one of the following occur:

The rl.close() method is called and the readline.Interface instance has
relinquished control over the input and output streams;
The input stream receives its &#39;end&#39; event;
The input stream receives &lt;ctrl&gt;-D to signal end-of-transmission (EOT);
The input stream receives &lt;ctrl&gt;-C to signal SIGINT and there is no
SIGINT event listener registered on the readline.Interface instance.

The listener function is called without passing any arguments.
The readline.Interface instance should be considered to be &quot;finished&quot; once
the &#39;close&#39; event is emitted.
Event: &#39;line&#39;

The &#39;line&#39; event is emitted whenever the input stream receives an
end-of-line input (\n, \r, or \r\n). This usually occurs when the user
presses the &lt;Enter&gt;, or &lt;Return&gt; keys.
The listener function is called with a string containing the single line of
received input.
For example:
rl.on(&#39;line&#39;, (input) =&gt; {
  console.log(`Received: ${input}`);
});

Event: &#39;pause&#39;

The &#39;pause&#39; event is emitted when one of the following occur:

The input stream is paused.
The input stream is not paused and receives the SIGCONT event. (See
events SIGTSTP and SIGCONT)

The listener function is called without passing any arguments.
For example:
rl.on(&#39;pause&#39;, () =&gt; {
  console.log(&#39;Readline paused.&#39;);
});

Event: &#39;resume&#39;

The &#39;resume&#39; event is emitted whenever the input stream is resumed.
The listener function is called without passing any arguments.
rl.on(&#39;resume&#39;, () =&gt; {
  console.log(&#39;Readline resumed.&#39;);
});

Event: &#39;SIGCONT&#39;

The &#39;SIGCONT&#39; event is emitted when a Node.js process previously moved into
the background using &lt;ctrl&gt;-Z (i.e. SIGTSTP) is then brought back to the
foreground using fg(1).
If the input stream was paused before the SIGSTP request, this event will
not be emitted.
The listener function is invoked without passing any arguments.
For example:
rl.on(&#39;SIGCONT&#39;, () =&gt; {
  // `prompt` will automatically resume the stream
  rl.prompt();
});

Note: The &#39;SIGCONT&#39; event is not supported on Windows.
Event: &#39;SIGINT&#39;

The &#39;SIGINT&#39; event is emitted whenever the input stream receives a
&lt;ctrl&gt;-C input, known typically as SIGINT. If there are no &#39;SIGINT&#39; event
listeners registered when the input stream receives a SIGINT, the &#39;pause&#39;
event will be emitted.
The listener function is invoked without passing any arguments.
For example:
rl.on(&#39;SIGINT&#39;, () =&gt; {
  rl.question(&#39;Are you sure you want to exit?&#39;, (answer) =&gt; {
    if (answer.match(/^y(es)?$/i)) rl.pause();
  });
});

Event: &#39;SIGTSTP&#39;

The &#39;SIGTSPT&#39; event is emitted when the input stream receives a &lt;ctrl&gt;-Z
input, typically known as SIGTSTP. If there are no SIGTSTP event listeners
registered when the input stream receives a SIGTSTP, the Node.js process
will be sent to the background.
When the program is resumed using fg(1), the &#39;pause&#39; and SIGCONT events
will be emitted. These can be used to resume the input stream.
The &#39;pause&#39; and &#39;SIGCONT&#39; events will not be emitted if the input was
paused before the process was sent to the background.
The listener function is invoked without passing any arguments.
For example:
rl.on(&#39;SIGTSTP&#39;, () =&gt; {
  // This will override SIGTSTP and prevent the program from going to the
  // background.
  console.log(&#39;Caught SIGTSTP.&#39;);
});

Note: The &#39;SIGTSTP&#39; event is not supported on Windows.
rl.close()

The rl.close() method closes the readline.Interface instance and
relinquishes control over the input and output streams. When called,
the &#39;close&#39; event will be emitted.
Closes the Interface instance, relinquishing control on the input and
output streams. The &#39;close&#39; event will also be emitted.
rl.pause()

The rl.pause() method pauses the input stream, allowing it to be resumed
later if necessary.
Calling rl.pause() does not immediately pause other events (including
&#39;line&#39;) from being emitted by the readline.Interface instance.
rl.prompt([preserveCursor])


preserveCursor {boolean} If true, prevents the cursor placement from
being reset to 0.

The rl.prompt() method writes the readline.Interface instances configured
prompt to a new line in output in order to provide a user with a new
location at which to provide input.
When called, rl.prompt() will resume the input stream if it has been
paused.
If the readline.Interface was created with output set to null or
undefined the prompt is not written.
rl.question(query, callback)


query {String} A statement or query to write to output, prepended to the
prompt.
callback {Function} A callback function that is invoked with the user&#39;s
input in response to the query.

The rl.question() method displays the query by writing it to the output,
waits for user input to be provided on input, then invokes the callback
function passing the provided input as the first argument.
When called, rl.question() will resume the input stream if it has been
paused.
If the readline.Interface was created with output set to null or
undefined the query is not written.
Example usage:
rl.question(&#39;What is your favorite food?&#39;, (answer) =&gt; {
  console.log(`Oh, so your favorite food is ${answer}`);
});

Note: The callback function passed to rl.question() does not follow the
typical pattern of accepting an Error object or null as the first argument.
The callback is called with the provided answer as the only argument.
rl.resume()

The rl.resume() method resumes the input stream if it has been paused.
rl.setPrompt(prompt)


prompt {String}

The rl.setPrompt() method sets the prompt that will be written to output
whenever rl.prompt() is called.
rl.write(data[, key])


data {String}
key {Object}
ctrl {boolean} true to indicate the &lt;ctrl&gt; key.
meta {boolean} true to indicate the &lt;Meta&gt; key.
shift {boolean} true to indicate the &lt;Shift&gt; key.
name {String} The name of the a key.



The rl.write() method will write either data or a key sequence  identified
by key to the output. The key argument is supported only if output is
a TTY text terminal.
If key is specified, data is ignored.
When called, rl.write() will resume the input stream if it has been
paused.
If the readline.Interface was created with output set to null or
undefined the data and key are not written.
For example:
rl.write(&#39;Delete this!&#39;);
// Simulate Ctrl+u to delete the line written previously
rl.write(null, {ctrl: true, name: &#39;u&#39;});

readline.clearLine(stream, dir)


stream {Writable}
dir {number}
-1 - to the left from cursor
1 - to the right from cursor
0 - the entire line



The readline.clearLine() method clears current line of given TTY stream
in a specified direction identified by dir.
readline.clearScreenDown(stream)


stream {Writable}

The readline.clearScreenDown() method clears the given TTY stream from
the current position of the cursor down.
readline.createInterface(options)


options {Object}
input {Readable} The Readable stream to listen to. This option is
required.
output {Writable} The Writable stream to write readline data to.
completer {Function} An optional function used for Tab autocompletion.
terminal {boolean} true if the input and output streams should be
treated like a TTY, and have ANSI/VT100 escape codes written to it.
Defaults to checking isTTY on the output stream upon instantiation.
historySize {number} maximum number of history lines retained. To disable
the history set this value to 0. Defaults to 30. This option makes sense
only if terminal is set to true by the user or by an internal output
check, otherwise the history caching mechanism is not initialized at all.
prompt - the prompt string to use. Default: &#39;&gt; &#39;



The readline.createInterface() method creates a new readline.Interface
instance.
For example:
const readline = require(&#39;readline&#39;);
const rl = readline.createInterface({
  input: process.stdin,
  output: process.stdout
});

Once the readline.Interface instance is created, the most common case is to
listen for the &#39;line&#39; event:
rl.on(&#39;line&#39;, (line) =&gt; {
  console.log(`Received: ${line}`);
});

If terminal is true for this instance then the output stream will get
the best compatibility if it defines an output.columns property and emits
a &#39;resize&#39; event on the output if or when the columns ever change
(process.stdout does this automatically when it is a TTY).
Use of the completer Function
When called, the completer function is provided the current line entered by
the user, and is expected to return an Array with 2 entries:

An Array with matching entries for the completion.
The substring that was used for the matching.

For instance: [[substr1, substr2, ...], originalsubstring].
function completer(line) {
  var completions = &#39;.help .error .exit .quit .q&#39;.split(&#39; &#39;);
  var hits = completions.filter((c) =&gt; { return c.indexOf(line) == 0 });
  // show all completions if none found
  return [hits.length ? hits : completions, line];
}

The completer function can be called asynchronously if it accepts two
arguments:
function completer(linePartial, callback) {
  callback(null, [[&#39;123&#39;], linePartial]);
}

readline.cursorTo(stream, x, y)


stream {Writable}
x {number}
y {number}

The readline.cursorTo() method moves cursor to the specified position in a
given TTY stream.
readline.emitKeypressEvents(stream[, interface])


stream {Readable}
interface {readline.Interface}

The readline.emitKeypressEvents() method causes the given Writable
stream to begin emitting &#39;keypress&#39; events corresponding to received input.
Optionally, interface specifies a readline.Interface instance for which
autocompletion is disabled when copy-pasted input is detected.
If the stream is a TTY, then it must be in raw mode.
readline.emitKeypressEvents(process.stdin);
if (process.stdin.isTTY)
  process.stdin.setRawMode(true);

readline.moveCursor(stream, dx, dy)


stream {Writable}
dx {number}
dy {Number}

The readline.moveCursor() method moves the cursor relative to its current
position in a given TTY stream.
Example: Tiny CLI
The following example illustrates the use of readline.Interface class to
implement a small command-line interface:
const readline = require(&#39;readline&#39;);
const rl = readline.createInterface({
  input: process.stdin,
  output: process.stdout,
  prompt: &#39;OHAI&gt; &#39;
});

rl.prompt();

rl.on(&#39;line&#39;, (line) =&gt; {
  switch(line.trim()) {
    case &#39;hello&#39;:
      console.log(&#39;world!&#39;);
      break;
    default:
      console.log(`Say what? I might have heard &#39;${line.trim()}&#39;`);
      break;
  }
  rl.prompt();
}).on(&#39;close&#39;, () =&gt; {
  console.log(&#39;Have a great day!&#39;);
  process.exit(0);
});

Example: Read File Stream Line-by-Line
A common use case for readline is to consume input from a filesystem
Readable stream one line at a time, as illustrated in the following
example:
const readline = require(&#39;readline&#39;);
const fs = require(&#39;fs&#39;);

const rl = readline.createInterface({
  input: fs.createReadStream(&#39;sample.txt&#39;)
});

rl.on(&#39;line&#39;, (line) =&gt; {
  console.log(&#39;Line from file:&#39;, line);
});

repl.html.body:
title: repl
tags: node
date: 2016-08-11 10:27:51
REPL
Stability: 2 - Stable
The repl module provides a Read-Eval-Print-Loop (REPL) implementation that
is available both as a standalone program or includable in other applications.
It can be accessed using:
const repl = require(&#39;repl&#39;);

Design and Features
The repl module exports the repl.REPLServer class. While running, instances
of repl.REPLServer will accept individual lines of user input, evaluate those
according to a user-defined evaluation function, then output the result. Input
and output may be from stdin and stdout, respectively, or may be connected
to any Node.js stream.
Instances of repl.REPLServer support automatic completion of inputs,
simplistic Emacs-style line editing, multi-line inputs, ANSI-styled output,
saving and restoring current REPL session state, error recovery, and
customizable evaluation functions.
Commands and Special Keys
The following special commands are supported by all REPL instances:

.break - When in the process of inputting a multi-line expression, entering
the .break command (or pressing the &lt;ctrl&gt;-C key combination) will abort
further input or processing of that expression.
.clear - Resets the REPL context to an empty object and clears any
multi-line expression currently being input.
.exit - Close the I/O stream, causing the REPL to exit.
.help - Show this list of special commands.
.save - Save the current REPL session to a file:
&gt; .save ./file/to/save.js
.load - Load a file into the current REPL session.
&gt; .load ./file/to/load.js

The following key combinations in the REPL have these special effects:

&lt;ctrl&gt;-C - When pressed once, has the same effect as the .break command.
When pressed twice on a blank line, has the same effect as the .exit
command.
&lt;ctrl&gt;-D - Has the same effect as the .exit command.
&lt;tab&gt; - When pressed on a blank line, displays global and local(scope)
variables. When pressed while entering other input, displays relevant
autocompletion options.

Default Evaluation
By default, all instances of repl.REPLServer use an evaluation function that
evaluates JavaScript expressions and provides access to Node.js&#39; built-in
modules. This default behavior can be overridden by passing in an alternative
evaluation function when the repl.REPLServer instance is created.
JavaScript Expressions
The default evaluator supports direct evaluation of JavaScript expressions:
&gt; 1 + 1
2
&gt; var m = 2
undefined
&gt; m + 1
3

Unless otherwise scoped within blocks (e.g. { ... }) or functions, variables
declared either implicitly or using the var keyword are declared at the
global scope.
Global and Local Scope
The default evaluator provides access to any variables that exist in the global
scope. It is possible to expose a variable to the REPL explicitly by assigning
it to the context object associated with each REPLServer.  For example:
const repl = require(&#39;repl&#39;);
var msg = &#39;message&#39;;

repl.start(&#39;&gt; &#39;).context.m = msg;

Properties in the context object appear as local within the REPL:
$ node repl_test.js
&gt; m
&#39;message&#39;

It is important to note that context properties are not read-only by default.
To specify read-only globals, context properties must be defined using
Object.defineProperty():
const repl = require(&#39;repl&#39;);
var msg = &#39;message&#39;;

const r = repl.start(&#39;&gt; &#39;);
Object.defineProperty(r, &#39;m&#39;, {
  configurable: false,
  enumerable: true,
  value: msg
});

Accessing Core Node.js Modules
The default evaluator will automatically load Node.js core modules into the
REPL environment when used. For instance, unless otherwise declared as a
global or scoped variable, the input fs will be evaluated on-demand as
global.fs = require(&#39;fs&#39;).
&gt; fs.createReadStream(&#39;./some/file&#39;);

Assignment of the _ (underscore) variable
The default evaluator will, by default, assign the result of the most recently
evaluated expression to the special variable _ (underscore).
&gt; [ &#39;a&#39;, &#39;b&#39;, &#39;c&#39; ]
[ &#39;a&#39;, &#39;b&#39;, &#39;c&#39; ]
&gt; _.length
3
&gt; _ += 1
4

Explicitly setting _ to a value will disable this behavior.
Custom Evaluation Functions
When a new repl.REPLServer is created, a custom evaluation function may be
provided. This can be used, for instance, to implement fully customized REPL
applications.
The following illustrates a hypothetical example of a REPL that performs
translation of text from one language to another:
const repl = require(&#39;repl&#39;);
const Translator = require(&#39;translator&#39;).Translator;

const myTranslator = new Translator(&#39;en&#39;, &#39;fr&#39;);

function myEval(cmd, context, filename, callback) {
  callback(null, myTranslator.translate(cmd));
}

repl.start({prompt: &#39;&gt; &#39;, eval: myEval});

Recoverable Errors
As a user is typing input into the REPL prompt, pressing the &lt;enter&gt; key will
send the current line of input to the eval function. In order to support
multi-line input, the eval function can return an instance of repl.Recoverable
to the provided callback function:
function eval(cmd, context, filename, callback) {
  var result;
  try {
    result = vm.runInThisContext(cmd);
  } catch (e) {
    if (isRecoverableError(e)) {
      return callback(new repl.Recoverable(e));
    }
  }
  callback(null, result);
}

function isRecoverableError(error) {
  if (error.name === &#39;SyntaxError&#39;) {
    return /^(Unexpected end of input|Unexpected token)/.test(error.message);
  }
  return false;
}

Customizing REPL Output
By default, repl.REPLServer instances format output using the
util.inspect() method before writing the output to the provided Writable
stream (process.stdout by default). The useColors boolean option can be
specified at construction to instruct the default writer to use ANSI style
codes to colorize the output from the util.inspect() method.
It is possible to fully customize the output of a repl.REPLServer instance
by passing a new function in using the writer option on construction. The
following example, for instance, simply converts any input text to upper case:
const repl = require(&#39;repl&#39;);

const r = repl.start({prompt: &#39;&gt;&#39;, eval: myEval, writer: myWriter});

function myEval(cmd, context, filename, callback) {
  callback(null,cmd);
}

function myWriter(output) {
  return output.toUpperCase();
}

Class: REPLServer

The repl.REPLServer class inherits from the readline.Interface class.
Instances of repl.REPLServer are created using the repl.start() method and
should not be created directly using the JavaScript new keyword.
Event: &#39;exit&#39;

The &#39;exit&#39; event is emitted when the REPL is exited either by receiving the
.exit command as input, the user pressing &lt;ctrl&gt;-C twice to signal SIGINT,
or by pressing &lt;ctrl&gt;-D to signal &#39;end&#39; on the input stream. The listener
callback is invoked without any arguments.
replServer.on(&#39;exit&#39;, () =&gt; {
  console.log(&#39;Received &quot;exit&quot; event from repl!&#39;);
  process.exit();
});

Event: &#39;reset&#39;

The &#39;reset&#39; event is emitted when the REPL&#39;s context is reset. This occurs
whenever the .clear command is received as input unless the REPL is using
the default evaluator and the repl.REPLServer instance was created with the
useGlobal option set to true. The listener callback will be called with a
reference to the context object as the only argument.
This can be used primarily to re-initialize REPL context to some pre-defined
state as illustrated in the following simple example:
const repl = require(&#39;repl&#39;);

function initializeContext(context) {
  context.m = &#39;test&#39;;
}

var r = repl.start({prompt: &#39;&gt;&#39;});
initializeContext(r.context);

r.on(&#39;reset&#39;, initializeContext);

When this code is executed, the global &#39;m&#39; variable can be modified but then
reset to its initial value using the .clear command:
$ ./node example.js
&gt;m
&#39;test&#39;
&gt;m = 1
1
&gt;m
1
&gt;.clear
Clearing context...
&gt;m
&#39;test&#39;
&gt;

replServer.defineCommand(keyword, cmd)


keyword {String} The command keyword (without a leading . character).
cmd {Object|Function} The function to invoke when the command is processed.

The replServer.defineCommand() method is used to add new .-prefixed commands
to the REPL instance. Such commands are invoked by typing a . followed by the
keyword. The cmd is either a Function or an object with the following
properties:

help {String} Help text to be displayed when .help is entered (Optional).
action {Function} The function to execute, optionally accepting a single
string argument.

The following example shows two new commands added to the REPL instance:
const repl = require(&#39;repl&#39;);

var replServer = repl.start({prompt: &#39;&gt; &#39;});
replServer.defineCommand(&#39;sayhello&#39;, {
  help: &#39;Say hello&#39;,
  action: function(name) {
    this.lineParser.reset();
    this.bufferedCommand = &#39;&#39;;
    console.log(`Hello, ${name}!`);
    this.displayPrompt();
  }
});
replServer.defineCommand(&#39;saybye&#39;, function() {
  console.log(&#39;Goodbye!&#39;);
  this.close();
});

The new commands can then be used from within the REPL instance:
&gt; .sayhello Node.js User
Hello, Node.js User!
&gt; .saybye
Goodbye!

replServer.displayPrompt([preserveCursor])


preserveCursor {Boolean}

The replServer.displayPrompt() method readies the REPL instance for input
from the user, printing the configured prompt to a new line in the output
and resuming the input to accept new input.
When multi-line input is being entered, an ellipsis is printed rather than the
&#39;prompt&#39;.
When preserveCursor is true, the cursor placement will not be reset to 0.
The replServer.displayPrompt method is primarily intended to be called from
within the action function for commands registered using the
replServer.defineCommand() method.
repl.start([options])


options {Object}
prompt {String} The input prompt to display. Defaults to &gt;.
input {Readable} The Readable stream from which REPL input will be read.
Defaults to process.stdin.
output {Writable} The Writable stream to which REPL output will be
written. Defaults to process.stdout.
terminal {boolean} If true, specifies that the output should be
treated as a a TTY terminal, and have ANSI/VT100 escape codes written to it.
Defaults to checking the value of the isTTY property on the output
stream upon instantiation.
eval {Function} The function to be used when evaluating each given line
of input. Defaults to an async wrapper for the JavaScript eval()
function.  An eval function can error with repl.Recoverable to indicate
the input was incomplete and prompt for additional lines.
useColors {boolean} If true, specifies that the default writer
function should include ANSI color styling to REPL output. If a custom
writer function is provided then this has no effect. Defaults to the
 REPL instances terminal value.
useGlobal {boolean} If true, specifies that the default evaluation
 function will use the JavaScript global as the context as opposed to
 creating a new separate context for the REPL instance. Defaults to false.
ignoreUndefined {boolean} If true, specifies that the default writer
 will not output the return value of a command if it evaluates to
 undefined. Defaults to false.
writer {Function} The function to invoke to format the output of each
 command before writing to output. Defaults to util.inspect().
completer {Function} An optional function used for custom Tab auto
 completion. See readline.InterfaceCompleter for an example.
replMode - A flag that specifies whether the default evaluator executes
all JavaScript commands in strict mode, default mode, or a hybrid mode
(&quot;magic&quot; mode.) Acceptable values are:
repl.REPL_MODE_SLOPPY - evaluates expressions in sloppy mode.
repl.REPL_MODE_STRICT - evaluates expressions in strict mode. This is
equivalent to prefacing every repl statement with &#39;use strict&#39;.
repl.REPL_MODE_MAGIC - attempt to evaluates expressions in default
mode.  If expressions fail to parse, re-try in strict mode.


breakEvalOnSigint - Stop evaluating the current piece of code when
SIGINT is received, i.e. Ctrl+C is pressed. This cannot be used together
with a custom eval function. Defaults to false.



The repl.start() method creates and starts a repl.REPLServer instance.
The Node.js REPL
Node.js itself uses the repl module to provide its own interactive interface
for executing JavaScript. This can used by executing the Node.js binary without
passing any arguments (or by passing the -i argument):
$ node
&gt; a = [1, 2, 3];
[ 1, 2, 3 ]
&gt; a.forEach((v) =&gt; {
...   console.log(v);
...   });
1
2
3

Environment Variable Options
Various behaviors of the Node.js REPL can be customized using the following
environment variables:

NODE_REPL_HISTORY - When a valid path is given, persistent REPL history
will be saved to the specified file rather than .node_repl_history in the
user&#39;s home directory. Setting this value to &quot;&quot; will disable persistent
REPL history. Whitespace will be trimmed from the value.
NODE_REPL_HISTORY_SIZE - Defaults to 1000. Controls how many lines of
history will be persisted if history is available. Must be a positive number.
NODE_REPL_MODE - May be any of sloppy, strict, or magic. Defaults
to magic, which will automatically run &quot;strict mode only&quot; statements in
strict mode.

Persistent History
By default, the Node.js REPL will persist history between node REPL sessions
by saving inputs to a .node_repl_history file located in the user&#39;s home
directory. This can be disabled by setting the environment variable
NODE_REPL_HISTORY=&quot;&quot;.
NODE_REPL_HISTORY_FILE

   Stability: 0 - Deprecated: Use NODE_REPL_HISTORY instead.
Previously in Node.js/io.js v2.x, REPL history was controlled by using a
NODE_REPL_HISTORY_FILE environment variable, and the history was saved in JSON
format. This variable has now been deprecated, and the old JSON REPL history
file will be automatically converted to a simplified plain text format. This new
file will be saved to either the user&#39;s home directory, or a directory defined
by the NODE_REPL_HISTORY variable, as documented in the
Environment Variable Options.
Using the Node.js REPL with advanced line-editors
For advanced line-editors, start Node.js with the environmental variable
NODE_NO_READLINE=1. This will start the main and debugger REPL in canonical
terminal settings which will allow you to use with rlwrap.
For example, you could add this to your bashrc file:
alias node=&quot;env NODE_NO_READLINE=1 rlwrap node&quot;

Starting multiple REPL instances against a single running instance
It is possible to create and run multiple REPL instances against a single
running instance of Node.js that share a single global object but have
separate I/O interfaces.
The following example, for instance, provides separate REPLs on stdin, a Unix
socket, and a TCP socket:
const net = require(&#39;net&#39;);
const repl = require(&#39;repl&#39;);
var connections = 0;

repl.start({
  prompt: &#39;Node.js via stdin&gt; &#39;,
  input: process.stdin,
  output: process.stdout
});

net.createServer((socket) =&gt; {
  connections += 1;
  repl.start({
    prompt: &#39;Node.js via Unix socket&gt; &#39;,
    input: socket,
    output: socket
  }).on(&#39;exit&#39;, () =&gt; {
    socket.end();
  });
}).listen(&#39;/tmp/node-repl-sock&#39;);

net.createServer((socket) =&gt; {
  connections += 1;
  repl.start({
    prompt: &#39;Node.js via TCP socket&gt; &#39;,
    input: socket,
    output: socket
  }).on(&#39;exit&#39;, () =&gt; {
    socket.end();
  });
}).listen(5001);

Running this application from the command line will start a REPL on stdin.
Other REPL clients may connect through the Unix socket or TCP socket. telnet,
for instance, is useful for connecting to TCP sockets, while socat can be used
to connect to both Unix and TCP sockets.
By starting a REPL from a Unix socket-based server instead of stdin, it is
possible to connect to a long-running Node.js process without restarting it.
For an example of running a &quot;full-featured&quot; (terminal) REPL over
a net.Server and net.Socket instance, see: https://gist.github.com/2209310
For an example of running a REPL instance over curl(1),
see: https://gist.github.com/2053342

